    'title': 'Anatomie, Ökologie und Ontogenie von Mesosauriern unter Anwendung von 3D-Bildtechnologien',
    'abstract': 'Mesosaurier stellen als erste voll aquatischen Amnioten eine einzigartige und sehr spezialisierte Wirbeltiergruppe dar. Sie werden oftmals zu den Parareptilia gestellt, wohingegen manche Studien indizieren dass sie basale Sauropsiden außerhalb der Parareptilien-Eureptilien-Aufspaltung repräsentieren. Sie sind ausschließlich aus dem Unterperm von Gondwana bekannt. Allerdings stellen sie trotz ihrer eingeschränkten stratigraphischen und geographischen Verbreitung einen wichtigen Schritt in der Evolutionsgeschichte der Tetrapoden dar, indem sie hochspezialisiert für einen aquatischen Lebensstil sind: inklusive langem Schädel mit extrem verlängertem Rostrum, mit langen, dünnen, konischen Zähnen, einem schlanken Hals, einem langen abgeflachten Schwanz für lateral undulierende Bewegungen, und paddelförmige Vorder- und Hinterextremitäten. Nur drei monotypische Mesosaurier-Gattungen werden zur Zeit als valide angesehen: Mesosaurus tenuidens, Stereosternum tumidum, and Brazilosaurus sanpauloensis. Obwohl sie eine Schlüsselgruppe in der frühen Evolution der Amnioten verkörpern, sind Mesosaurier recht schlecht erforscht, trotz einiger jüngster Forschungsfortschritte in Bezug auf M. tenuidens. Die Hauptziele des hier vorgestellten Projekts beinhalten die detaillierte anatomische Untersuchung der weiteren Mesosaurier-Gattungen Stereosternum und Brazilosaurus unter Anwendung von 3D-Bildtechnologien basierend auf CT Daten, um neue phylogenetische Merkmale aufzudecken und existierende Hypothesen über ihre Verwandtschaftsverhältnisse zu testen. Eine geplante 3D-Rekonstruktion des Mesosaurierschädels zielt darauf ab, die kontroverse und historische Frage zu klären, ob Mesosaurier eine anapside oder synapside Schädelkonfiguration haben. Die geplante 3D-Analyse des Schädels (inklusive seiner internen Strukturen wie beispielsweise des Hirnschädels, Schädelausgusses und Innenohrs) beabsichtigt darüber hinaus weitere Wissenslücken zu schließen und wichtige Daten zur frühen Evolution des Amniotenschädels hervorzubringen. Des weiteren wird eine Finite Element Analyse (FEA) der Schädel von Stereosternum und Brazilosaurus angewandt und mit anderen rezenten und fossilen sekundär aquatischen Tetrapoden verglichen, um ihre respektive Beißkraft und Schädelresistenz zu testen und zu untersuchen, ob es Unterschiede in Fressverhalten (filtrierende Nahrungsaufnahme vs. aktive Prädation) und Lokomotion innerhalb der Mesosaurier gab. Abschließend bezweckt eine ontogenetische Studie mit speziellem Fokus auf postcranialen (aber auch cranialen) Proportionen mit morphometrischem Ansatz, inklusive linearen Messungen sowie geometrischer Morphometrie, potenzielle Variationen in den Wachstumsmustern von Mesosauriern zu untersuchen. Darauf basierend soll festgestellt werden, ob es Unterschiede im Fressverhalten zwischen juvenilen und adulten Mesosauriern gab. Die Ergebnisse dieses Projekts versprechen neuartige Einblicke in die Paläobiologie dieser frühesten sekundär aquatischen Amnioten.',
