    'title': 'Biodiversitätsmuster, Paläoökologie und funktionelle Diversität des "Great Ordovician Biodiversification Event" in der Basin and Range Provinz, USA.',
    'abstract': 'Die Analyse von Mechanismen biologischer Diversifizierung ist seit jeher ein zentraler Aspekt makroevolutionärer Forschung. Angesichts der gegenwärtigen Artenkrise ist ein tieferes Verständnis solcher Prozesse für den Aufbau und den Erhalt biologischer Artenvielfalt unabdingbar. Paläontologische Ansätze sind besonders wichtig, da sie in der Lage sind historische Diversitätsentwicklungen offen zu legen. Neben externen Faktoren spielen biotische Prozesse, wie Jagd- und Konkurrenzdruck, bei der Diversifizierung eine entscheidende Rolle. Insbesondere Konkurrenz ist als Steuerungsfaktor nur unzureichend verstanden. Verschiedene Modelle stellen Konkurrenzdruck als Treiber sowie als Hemmnis für Artbildungsprozesse dar. Eigene Arbeiten zum Thema weisen darauf hin, dass Artbildungsraten an sich diversitätsgebunden sind. In niedrig diversen Ökosystemen ermöglicht der geringe Konkurrenzdruck Organismen große Habitatbreiten zu realisieren, was für eine niedrige Gesamtdiversität der Region führt. Hohe Konkurrenz tritt in lokal diversen Systemen hervor, wo Organismen zunehmend auf ihr ökologisches Optimum beschränkt bleiben, was sich in einer höheren Beta-Diversität ausdrückt. Ein hypothetischer Phasenübergang von "ungesättigten" zu "gesättigten" Bedingungen erklärt zwei Effekte, die typisch für Diversifizierungsereignisse zu sein scheinen: (1) eine zeitliche Verzögerung zwischen der Etablierung (oder dem Überleben) von Taxa höher systematischen Ebenen und er eigentlichen Diversifizierung, sowie (2) einem schließlich relativ raschen Diversitätsanstieg. Die differentielle Analyse von Alpha und Beta-Diversität kann helfen, den Einfluss intrinsischer Effekte (v.a. Konkurrenzdruck) auf die Diversitätsdynamik abzuschätzen. Das "Great Ordovician Biodiversification Event" (GOBE) markiert das umfassendste Diversifizierungsereignis mariner Organismen in der Erdgeschichte und gilt als "natürliches Experiment", welches es erlaubt fragliche Diversitätsparameter repräsentativ für einen größeren Zeitraum zu erfassen und damit Rückschlüsse auf Wirkmechanismen zu treffen. Mit Hilfe quantitativer paläoökologischer Methoden soll versucht werden Diversitäten innerhalb sowie zwischen benachbarten marinen Habitaten zu charakterisieren. Aus diesen Daten lässt sich ableiten, ob Konkurrenzdruck maßgeblich an der ökologischen Ausdifferenzierung (Spezialisierung) entlang von Umweltgradienten beteiligt war oder ob der Anstieg eher zufällig geschieht bzw. durch andere Faktoren gesteuert wird. Die marinen Abfolgen der Basin and Range Provinz (USA) bieten mit ihrem Fossilreichtum, der nahezu kontinuierlichen Ablagerungsgeschichte, sowie der abwechslungsreichen Faziesarchitektur ideale Bedingungen um diesen Fragen nachzugehen. Die zu erwartenden Ergebnisse sind entscheidend für die Abschätzung des Einflusses biologischer Interaktionen auf Diversifizierungsprozesse und tragen somit zum grundlegenden Verständnis zentraler Evolutionsmechanismen bei.',
