    'title': 'Closing the corridor –Suche nach archaeoceten Überresten (Mammalia: Cetartiodactyla) in den eozänen Ablagerungen bei Kangan (Golfregion, Iran)',
    'abstract': 'In der Region Bandar-e-Kangan am Persischen Golf im Iran wurden in marinen Ablagerungen der Pabdeh Formation (paläogene Folgen) fossilisierte Knochen großer Wirbeltiere gefunden. Eine Kurzexpedition erbrachte die Gewissheit, dass dort in den eozänen Schichten der Kangan-Antiklinie höchstwahrscheinlich Urwal-Überreste eingebettet wurden. Die gesichteten Oberflächenfunde waren jedoch sehr stark verwittert, so dass eine konkrete Ansprache nicht möglich war. Eine gezielte Prospektion und Grabung ist nun geplant, um möglichst unverwitterte Skelettreste zu finden und zu bergen. Die Lokalität befindet sich im Korridor zwischen den ausgezeichnet dokumentierten basalen Archaeoceten aus den meist ufernahen, flachmarinen Ablagerungen Indopakistans (Ypresium-Bartonium) und der westlichen Tethys-Provinz von Wadi Al-Hitan in Ägypten (Bartonium-Priabonium) mit überwiegend abgeleiteten, vollmarinen Vertretern der Basilosauridae. Funden aus dem Iran könnte ein große Bedeutung für die Interpretation der Phylogenie und Entwicklung der paraphyletischen Urwale zukommen und unser Wissen um die Evolution der Wale erweitern. Die Diskussion ist letztendlich abhängig vom Erfolg unserer Grabungsaktivitäten bzw. von Art und Erhaltung der Funde. Geodaten von Fundstellen sollen helfen, Alter und Lebensraum entdeckter Fossilien zu rekonstruieren.',
