    'title': 'Das Fenster zur Natur und Kunst: Eine historisch-kritische Aufarbeitung der Brandenburgisch-Preußischen Kunstkammer als Observatorium, Laboratorium, Kommunikationsfläche und Schauraum des Wissens',
    'abstract': 'Ziel des Forschungsvorhabens ist zum Ersten eine umfassende Rekonstruktion der Sammlungen der Brandenburgisch-Preußischen Kunstkammer, die den Nukleus der Berliner Museumslandschaft bilden. Zum zweiten sollen die Strahlkraft des Prinzips Kunstkammer als Ausstellungsprinzip kritisch reflektiert und drittens seine Potentiale im Sinne eines wieder geöffneten Fensters zur Welt als Spiritus Rector des Humboldt-Forums erschlossen werden. In diesem ersten Arbeitsfeld wird die systematische Generierung von Objektbiografen der ehemaligen Kunstkammerobjekte seitens des Museums für Naturkunde, der Staatlichen Museen zu Berlin sowie der Humboldt-Universität zu Berlin im Vordergrund stehen. Zum Zweiten soll es um die Erschließung der szientifischen und theoretischen Grundlagen der Kunstkammer sowie der diesem universalen Sammlungsprinzip folgenden Szenografen und Praktiken der Wissensgenerierung gehen, wie sie in den letzten 15 Jahren zu beobachten waren. In diesem Zusammenhang soll mittels einer kulturhistorischen und sozialgeografischen Untersuchung der Versuch einer Rekonstruktion und begrifflichen Klärung des genuinen Sammlungs- und Ausstellungsprinzips in allen Kulturen unternommen werden. Der dritte Schwerpunkt wird darin liegen, die Potenziale der Kunstkammer als Zukunftsmodell auszuloten. Im Zentrum steht das kulturübergreifende Modell Kunstkammer als universales Sammlungskonzept. In diesem Kontext werden zeitgenössische Ausstellungsgestaltungen, die dem Kunstkammerprinzip folgen, im Hinblick auf ihre Strategien zur Wissensgenerierung befragt. Darüber hinaus wird geprüft, inwiefern sich die Strukturen einer Entäußerung, wie sie das Digitale und Analoge bieten, als Strategien einer »Vergewisserung des Wissens« miteinander verknüpft und als Ansätze für eine grundlegende Neuformulierung und Aktualisierung dieses Ordnungs- und Präsentationstyps nutzbar gemacht werden können. In gedanklicher Weiterführung soll das in diesen umfangreichen Recherchen zusammengetragene Wissen in Form einer virtuellen Sammlung Eingang in eine digitale Datenbank finden, die über den Abschluss des Forschungsprojekts hinaus einen geistigen Zugang zur Brandenburgisch-Preußischen Kunstkammer ermöglicht. Darüber hinaus werden ideelle Konzepte entwickelt, um der zukünftigen dreidimensional angelegten Präsenz der Brandenburgisch-Preußischen Kunstkammer im Humboldt-Forum Gestalt und Substanz zu verleihen.',
