    'title': 'Die Auswirkungen eiszeitlicher Klimaschwankungen auf die Evolution afrikanischer Säugetiere am Beispiel der Pferdeböcke',
    'abstract': 'Eiszeitliche Klimaschwankungen haben zu Glazial-Interglazial-Zyklen in höheren Breiten und Feucht-Trocken-Zyklen in tropischen und subtropischen Regionen geführt. Letztere Zyklen, mit einer Dauer von etwa 100,000 Jahren, wurden in Afrika anhand geologischer und palynologischer Studien direkt, und anhand ihrer Auswirkungen auf die Phylogeographie afrikanischer Herbivoren indirekt untersucht. Im beantragten Projekt beabsichtigen wir, Populationsgrößenschwankungen mit Hilfe kompletter Genome zu bestimmen, um die Auswirkung der eiszeitlichen Feucht-Trocken-Zyklen auf die Ausbreitung afrikanischer Großsäuger zu untersuchen. Wir werden uns dabei auf die Gruppe der Pferdeantilopen (Hippotragini) konzentrieren, die mit acht bis heute oder vor kurzem überlebenden Arten in Habitaten von Wüsten bis Savanne verbreitet waren. Wir wollen dabei die Hypothese testen, dass die an trockene Habitate angepassten Arten der Gattungen Oryx und Addax die höchsten Populationsgrößen während trockener Phasen (Glaziale) erreichten. Die umgekehrte Voraussage trifft auf die stärker von Wasser abhängigen Arten der Gattung Hippotragus zu. Wir werden außerdem DNA des ausgestorbenen Blaubocks (H. leucocephalus) aus eiszeitlichen und holozänen Proben sequenzieren, um die Hypothese zu testen, dass die Populationsgröße dieser Art bereits Ende des 18. Jahrhunderts nicht überlebensfähig klein war und die Bejagung mit Feuerwaffen durch europäische Siedler sein Aussterben lediglich beschleunigt hat. Zudem werden wir die genetische Variabilität von Blaubock-Populationen aus dem westlichen und östlichen Südafrika vergleichen, um zu untersuchen ob es sich um eine saisonal wandernde Art gehandelt hat und die Klimaveränderungen zu Beginn des Holozäns durch eine Unterbrechung der Wanderrouten zum Aussterben des Blaubocks beigetragen haben.',
