    'title': 'Die Biogeographie Spätpaläozoischer Tetrapoden',
    'abstract': 'Das späte Paläozoikum repräsentiert eine entscheidende Phase in der Entwicklung und Organisation terrestrischer Wirbeltierökosysteme mit der Etablierung komplexer Lebensgemeinschaften und vielschichtigen trophischen Hierarchien. Zu dieser Zeit, dokumentiert die frühe Evolution und Diversifikation der Amnioten (voll terrestrischer Tetrapoden) eine Bifurkation in zwei Evolutionslinien: die Synapsiden (inklusive der Säugetiere) und die Sauropsiden (inklusive der Reptilien und Vögel). Oberkarbonische und unterpermische Ökosysteme stellen vor allem wassernahe Habitate in einem humiden äquatorialen Tropengürtel dar. Allerdings haben zum Ende des Unterperm erhebliche Veränderungen im terrestrischen Milieu zur Abschmelzung der Eiskappe am Südpol und damit einhergehenden Klimaveränderungen geführt, wie beispielsweise der Reduzierung und letztendlich auch des Verlustes des immer feuchten Tropengürtels. Zu dieser Zeit haben sich terrestrische Ökosysteme erstmalig von paläoäquatorialen Regionen in gemäßigte Klimazonen der höheren Breiten ausgedehnt. Obwohl die biogeographischen Muster im Allgemeinen bekannt sind, wurden diese bisher nicht konsequent mit quantitativen Methoden getestet. In der hier vorgeschlagenen Studie werden spezifische Hypothesen bezüglich der biogeographischen Verbreitung früher Tetrapoden mit kladistisch-biogeographischen Methoden getestet. Zu diesem Zweck werden ausgewählte kritische Tetrapodenarten aus Nordamerika und Russland taxonomisch neu evaluiert und deren Verwandtschaftsverhältnisse innerhalb basaler Amnioten mit Hilfe globaler phylogenetischer Analysen untersucht. Darüber hinaus wird eine existierende Datenbank terrestrischer Wirbeltiere aus dem südafrikanischen Karoo Becken aktualisiert und weitere quantitative Untersuchungen an dieser lokalen sowie zusätzlichen globalen Datenbanken durchgeführt. Dies dient unter anderem dazu, Endemismus innerhalb und zwischen den einzelnen Becken sowie Veränderungen in der faunalen Homogenität durch die geologische Zeit zu untersuchen. Die Resultate dieses Projektes werden wichtige Einblicke in die frühe Verbreitungsgeschichte der Tetrapoden und insbesondere der vollterrestrischen Amnioten geben.',
