    'title': 'Die Evolution von Knochenzellen in der Tiefenzeit und die Implikationen für den Knochenstoffwechsel in der Geschichte der Wirbeltiere',
    'abstract': 'Die meisten Wirbeltiere besitzen zelluläre Knochen, in welchen Knochenzellen (Osteozyten) in höhlenartigen Lakunen eingeschlossen und über dendritische Zellfortsätze miteinander verbunden sind, die in einem hochkomplexen Netzwerk von Kanälchen (Kanalikuli) verlaufen. Neue Studien haben gezeigt, dass dieses sogenannte lakunokanalikuläre Netzwerk eine zentrale Rolle im Knochenstoffwechsel spielt. So regeln Osteozyten das Formen und die Umbildung von Knochenoberflächen entsprechend der einwirkenden mechanischen Belastungsänderungen, erkennen Mikrorisse im Knochen und veranlassen ihre Reparatur und spielen eine grundlegende Rolle im Gleichgewicht des Mineralstoffwechsels. Darüber hinaus wurde gezeigt, dass die Anzahl von Osteozyten per Volumeneinheit Knochen proportional zur Wachstumsrate des Knochens ist, und ihre Dichte und Form variiert gemäß der örtlichen mechanischen Belastung während der Knochenbildung. Aufgrund dieser vielfältigen Aufgaben im Knochenstoffwechsel heutiger Wirbeltiere ist anzunehmen, dass die Muster der Verbreitung und Morphologie der Osteozyten neue Erkenntnisse zur Biologie fossiler Wirbeltiere ermöglichen. Obwohl das lakunokanalikuläre Netzwerk normalerweise in fossilem Knochen sehr gut erhalten ist, ist die evolutionäre Geschichte von Osteozyten noch wenig bekannt. In dem beantragten Projekt soll das lakunokanalikuläre Netzwerk durch die gesamte Wirbeltierevolution, von den ersten Wirbeltieren mit zellulärem Knochen, den kieferlosen Osteostracen, zu den basalen kiefertragenden Wirbeltieren (Placodermen und Acanthodier), Knochenfischen, Stamm-Tetrapoden, Amphibien und Amnioten quantitativ und qualitativ untersucht werden, um eine Tiefenzeit-Perspektive der Osteozyten-Evolution zur erhalten. Fossiler Knochen wird mit Licht- und Rasterelektronenmikroskopie (REM) sowie Röntgentomographie am Synchrotron untersucht. Der Schwerpunkt liegt dabei auf der Dichte und Anordnung der Lakunen, ihrer Form und Größe, der Morphologie der Kanalikuli sowie der Art der Knochenmatrix, in die das lakunokanalikuläre System eingebettet ist. Die Ergebnisse der Fossiluntersuchungen werden mit Knochendünnschliffen rezenter Formen verglichen, von denen die Stoffwechselrate bekannt ist, sowie mit Daten moderner Knochenzellbiologie. Dies erlaubt Rückschlüsse auf die Stoffwechselrate, Bildung und Umbau des Knochens sowie seine örtlichen mechanischen Belastungen bei fossilen Wirbeltieren, die im Rahmen von Körpergröße, Wachstumsstadium und Lebensraum (z.B. aquatisch oder terrestrisch) betrachtet werden. Auch soll ein Test auf phylogenetische Signale des lakunokanalikulären Netzwerks in den verschiedenen Wirbeltierlinien basierend auf unterschiedlichen mathematischen Methoden ausgeführt werden. Die Projektergebnisse werden für unser Verständnis der Entwicklung des Knochenstoffwechsels in der Geschichte der Wirbeltiere und insbesondere vor dem Hintergrund bedeutender evolutionärer Umwandlungen von großer Wichtigkeit sein.',
