    'title': 'Die Evolution von Regenerationsvermögen in Tetrapodenextremitäten unter Einbeziehung rezenter und fossiler Daten',
    'abstract': "Salamander spielen eine besondere Rolle innerhalb der Tetrapoden aufgrund ihres außergewöhnlich hohen Regenerationsvermögens, welches Teile von inneren Organen, die Linsen der Augen und vollständige Schwanz- und Extremitätenregeneration beinhaltet. Insbesondere das Regenerationsvermögen der Extremitäten war in den letzten Jahrzehnten Gegenstand intensiver Forschung, die speziell in Hinsicht auf die molekularen Mechanismen der Extremitätenregeneration große Fortschritte erzielt hat. Die überwiegende Mehrheit der Studien konzentriert sich dabei auf den mexikanischen Axolotl, Ambystoma mexicanum, einen neotenen ambystomatiden Salamander, als Modelorganismus für Laborversuche. Im Gegensatz dazu ist nur sehr wenig zur Diversität von regenerativen Fähigkeiten innerhalb der ökologisch und morphologisch extrem diversen Gruppe der Salamander bekannt und wie das Regenerationsvermögen sich in Salamandern mit 'life history' Strategien unterschiedlich der des Axolotls unterscheiden. In Kombination mit Daten aus dem Fossilbericht können diese Informationen wichtige Aufschlüsse über die Evolutionsgeschichte von Regenerationsvermögen in der Tetrapodenextremität liefern und somit wesentlich zu der Identifizierung von plesiomorphen versus abgeleiteten Faktoren beitragen. Dieses Projekt verfolgt einen integrativen Ansatz, der paläohistologische Daten aus der fossilen Stammlinie moderner Amphibien mit histologischen Daten moderner Salamander, sowie vergleichenden Transkriptomdaten kombiniert, um ein vielgestaltiges Bild der Evolution von Regenerationsvermögen in den Extremitäten von Tetrapoden zu generieren. Extremitätenregeneration wird mit histologischen Methoden sowie CT Datensätzen ausgewählter Salamander untersucht, um Variationen in der Geschwindigkeit und Genauigkeit der Extremitätenregeneration innerhalb der Ontogenese eines Taxons sowie zwischen verschiedenen Taxa mit unterschiedlichen 'life history' Strategien (Neotenie, Metamorphose und Direktentwicklung) zu erfassen. Eine paläohistologische Untersuchung regenerierter Extremitäten des permischen Dissorophoiden Micromelerpeton bildet die Basis für einen Vergleich mit rezenten Salamandern in Hinsicht auf Organisation von Gewebestrukturen und Anomalien in der Regeneration. Darüber hinaus werden die molekularen Signaturen in der Extremitätenentwicklung von larvalen, neotenen und metamorphosierten Salamandern, sowie Fröschen und Lungenfischen anhand vergleichender Transkriptomdaten untersucht. Die Kombination der Daten aus diesen verschiedenen Ansätzen bildet einen neuen, integrativen Rahmen für das Verständnis der Evolution von Regenerationsvermögen in den Extremitäten von Tetrapoden und weist zukünftige Forschungsansätze zum Einfluss von Ontogenese und 'life history' Strategien auf Regenerationsvermögen auf, darunter auch mögliche Veränderungen in der Rolle bestimmter molekularer Signale wie z.B. Stammzellensignale, entlang dieser Parameter.",
