    'title': 'Die Perspektive vom anderen Ende der Welt: Mitteltriassische Ichthyosaurier aus Nevada und ihre Bedeutung für die initiale Phase der Mesozoic Marine Revolution im Bereich des Ostpazifik',
    'abstract': 'Die frühe und mittlere Trias sind Schlüsselperioden für unser Verständnis der Organisation und Evolution von Ökosystemen, da in dieser Zeit die modernen Ökosystemstrukturen nach dem größten Massenaussterbeereignis der Erdgeschichte am Ende des Perms etabliert wurden. Im marinen Milieu radiierten sekundär aquatische Reptilien, insbesondere Ichthyosaurier und Sauropterygier, und gelten daher als Schlüsselelement der s.g. Mesozoic Marine Revolution (MMR), während der die Reorganisation der marinen trophischen Netzwerke hin zu der modernen Struktur statt fand. Während es viele Daten zu den Flachwasserhabitaten des Tethys-Raumes gibt, ist vergleichsweise wenig über die Fauna des Tiefwasserbereichs im Pazifischen Raum bekannt und stellt somit eine signifikante Lücke in unserem Wissen zu dieser wichtigen Phase der Wirbeltierevolution dar. Wir streben hier an diese Lücke zu schließen, um ein umfassendes Bild der faunistischen Unterschiede zwischen Tethys und Pazifischem Raum zu bekommen. Dies bildet die Basis für ein Verständnis der Erholungsphase und Ökosystemstrukturierung nach dem permotriassischen Aussterbeereignis und den damit verbundenen biogeographischen Verbreitungsmustern. Konkret streben wir an, die bisher unerforschten fossilführenden Schichten des mitteltriassischen Fossil Hill Member in den Augusta Mountains systematisch zu prospektieren, da dies mit großer Wahrscheinlichkeit weitere hoch relevante Funde mariner Reptilien des Tiefwasserbereiches des pazifischen Raums hervorbringen wird. In vorherigen Geländekampagnen wurde das gut erhaltene Skelett eines mittelgroßen trächtigen Ichthyosauriers sowie das vordere Drittel des Skelettes eines sehr großen Ichthyosauriers (Schädellänge 1,95 m) geborgen. Dieser spektakuläre Neufund unterscheidet sich deutlich von Thalattoarchon, dem ersten Großräuber unter den sekundär aquatischen Tetrapoden, durch seine noch größeren Ausmaße und besonders sein Fischfressergebiss. In Kombination mit einer Revision der mixosauriden und cymbospondyliden Ichthyosaurier des Fossil Hill Member werden detaillierte anatomische Beschreibungen dieser Funde wichtige neue Daten für ein Verständnis der morphologischen Disparität und Reproduktionsstrategien in frühen Ichthyosauriern liefern. Eine phylogenetische Analyse wird darüber hinaus die Basis für eine detaillierte Diskussion der frühen Evolution der Ichthyosaurier bilden, sowie die Grundlage für weiterführende Analysen zur Biogeographie und Ökosystemstrukturierung. Insbesondere die trophischen Interaktionen spielen eine integrale Rolle in der Neustrukturierung der Ökosysteme und der Radiation der marinen Reptilien. Daher ist das Projekt eng mit einem laufenden DFG-Projekt verknüpft, das der Untersuchung der Ammonoideen-Fauna und -Biostratigraphie des Fossil Hill Member gilt.',
