    'title': 'Diversitäts-kontrollierende Faktoren bei terrestrischen herbivoren Säugetieren des Känozoikums',
    'abstract': 'Ist Artenvielfalt unbegrenzt oder gibt es ökologische Limitierungen? Fluktuieren diese Limitierungen oder sind sie fixiert? Gibt es Limitierungen durch biotische Faktoren (Kompetition) oder sind sie abiotischer Natur (z.B. Klima)? Gibt es einen Zusammenhang zwischen phänotypischer Innovation und ökologisch bedingten Grenzen der Artenvielfalt? All diese makroevolutionären und ökologischen Fragestellungen sind bisher nur unzureichend verstanden. Während in der Neontologie zur Untersuchung dieser Aspekte bereits analytische Ansätze auf Basis molekularer Phylogenien entwickelt wurden, sind diese Methoden leider nicht in der Lage, vergangene Veränderungen in Diversifikation und phänotypischer Evolution adäquat zu rekonstruieren. Gleichzeitig gibt es komplementäre, analytisch-bioinformatische Techniken unter gemeinsamer Verwendung des Fossilnachweises sowie anderer ökologischer Faktoren erst seit dem Jahr 2015. In dem hier beantragten Vorhaben möchte ich letztere Methoden anwenden und weiterentwickeln (unter Verwendung des Programms PyRate) um jene Faktoren zu untersuchen, welche die Diversifikation känozoischer terrestrischer herbivorer Säugetiere (Artiodactyla, Perissodactyla, Proboscidea; mehr als 2000 Arten) massgeblich beeinflusst haben. Insbesondere soll untersucht werden, (i) ob es Grenzen der Diversifikation gibt und (ii) ob intrinsische Faktoren (z.B. density dependence, Kompetition, Prädation, phänotypische Innovation) eine bedeutendere Rolle spielen als extrinsische Einflüsse (Klima, Produktivität, etc.). In dem beantragten Projekt sollen Diversitäts Abhängigkeit, Kompetition, Morphospace Evolution und Klima in gemeinsame Diversifikation Modelle eingearbeitet und in einem probabilistischen Rahmen analysiert werden. Dieser integrative Ansatz verspricht neue evolutionäre Einblicke in die Dynamiken von Aussterben und Speziation bei den drei großen Herbivoren Säugetier Kladen über das Känozoikum hinweg. Zudem werden durch das Projekt neue Funktionsweisen für die Software PyRate entwickelt, um Diversitätsdynamik und Diversifikation in Zukunft noch detaillierter untersuchen zu können.',
