    'title': 'Evolution der tropischen marinen Biodiversität: vergleichende Analyse der triassischen Fauna der Cassian Formation mit modernen Faunen',
    'abstract': 'Die triassische Cassian Formation birgt eine außerordentlich diverse marine tropische Invertebratenfauna, die ein weitgehend unverzerrtes Bild der Diversität und Komplexität frühmesozoischer Ökosysteme bietet. Die Fauna setzt sich aus etlichen Assoziationen von verschiedenen Lokalitäten mit unterschiedlichen Paläoumweltbedingungen zusammen, die bezüglich Diversität und Artenspektrum erheblich variieren. Die Erhaltung der Fossilien ist gewöhnlich sehr gut einschließlich Aragoniterhaltung und einer reichen Fauna kleinwüchsiger Arten. Basierend auf umfangreichen Proben, die auf standardisierte Weise entnommen und aufgeschlossen werden, wollen wir die Diversität dieser Proben möglichst vollständig erfassen. Neben der Diversität der einzelnen Proben (Alphadiversität) werden wir die Diversitäten zwischen den Proben ermitteln (Betadiversität). Somit erfassen wir Komplexität, taxonomische Struktur und Größenverteilungen der Organismen eines frühmesozoischen tropischen marinen Ökosystems. Vergleiche mit Vergesellschaftungen aus rezenten und quartären tropischen Habitaten werden Schlussfolgerungen über den biologischen Wandel tropischer Ökosysteme seit mehr als 200 Millionen Jahren ermöglichen. Vergleiche mit bereits existierenden Daten über fossile, diagenetisch stärker verzerrte (`normale´) marine Faunen ermöglichen eine Abschätzung, wie taphonomische Prozesse sich auf die überlieferte Diversität, Größenverteilung und ökologische Struktur auswirken. Viele der Invertebratengruppen, die in rezenten tropischen marinen Ökosystemen hochdivers sind (z. B. heterodonte Muscheln und Neogastropoden) radiierten nicht vor der Kreide. Wir wollen prüfen, ob ähnlich diverse Gruppen bereits in der Trias existierten oder ob sich die Diversität gleichmäßiger auf höhere Taxa verteilte.',
