    'title': 'Evolution von Photorezeptoren bei Deuterostomia - neue Erkenntnisse durch Untersuchungen an Echinodermen und Enteropneusten',
    'abstract': 'Die Evolution von Augen ist Gegenstand wissenschaftlicher Forschung seit über 150 Jahren. Durch die Untersuchung von Lichtsinnesorganen bei Echinodermata und Enteropneusta, basalen Vertretern der Deuterostomia,werden neue Erkenntnisse bezüglich der Evolution spezifischer Photorezeptorzelltypen und -Systemen gewonnen, die schließlich in der Entwicklung komplexer Sehsinnesorgane wie denen der Wirbeltiere mündeten. Genutzt wird ein integrativer Ansatz mit einem breiten molekularen, strukturellen, verhaltensbiologischen und funktional molekularen Methodenspektrum. Über Antikörperfärbungen verschiedener Opsintypen (Photopigmente) können bislang unentdeckt gebliebene Photorezeptoren (PRZ) über ein breites Artenspektrum identifiziert werden. Im Folgenden wird über Genexpressionsprofile mittels in situ-Hybridisierung ein sogenannter Molekularer Fingerabdruck jedes identifizierten PRZtyps erstellt. Anhand dieser Genexpressionsprofile lassen sich Aussagen zu möglichen Mechanismen der Evolution spezifischer PRZtypen (z.B. Evolutive Aufspaltung multifunktionaler Zelltypen in Schwesterzelltypen mit reduzierten Funktionen, unabhängige Gen-co-option) neu bewerten. Die Verbindung von PRZ und Nervensystem und damit der Modus der Stimulusintegration ist entscheidend für die Funktion der PRZ und wird im Projekt mittels immunhistochemischer und transmissionselektronenmikroskopischer Methoden untersucht. Verschiedene Echinodermengruppen benutzen Skelettelemente entweder zum Abschirmen oder Focussieren von Licht gegenüber den PRZ. Die funktionale Rolle des Skelettes wird daher bei verschiedenen Echinodermengruppen und -arten mittels Röntgen Microtomographie untersucht. Das aus allen vorangegangenen Methoden resultierende integrative Datenset erlaubt den Vergleich zwischen PRZ von Echinodermen uund Enteropneusten und solchen von anderen Deuterostomia. Desweiteren bilden diese Daten die Basis für das biophysikalische Modellieren von optischen Eigenschaften von Echinodermen und Enteropneusten PRZ Systemen, mit dem bereits in Kollaboration mit Dan-E. Nilsson von der Universität Lund in Schweden begonnen wurde. Funktionelle molekulare Analyse, vorerst mit Schwerpunkt auf zwei Opsintypen des Seeigels Strongylocentrotus purpuratus, wird uns schließlich erlauben, den ersten direkten Nachweis der Funktion eines PRZ Sytems in einem Echinodermen zu führen. Diese Experimente werden in enger Zusammenarbeit mit meiner Kollaborationspartnerin Maria I. Arnone, Stazione Zoologica, Neapel, durchgeführt und beinhalten sowohl konventionellen Gen Knock Down über Morpholino Injektion, als auch die neue Möglichkeit eines Gen Knock Outs über Sigma Customized Zink Finger Nuclease Technologie. Die Summe aller erzielten Daten wird uns erlauben, wichtige Rückschlüsse über die Evolution von PRZ an der Basis der Deuterostomia zu ziehen. Die Daten werden aber auch neue Einblicke in optische Fähigkeiten von PRZ liefern, die in einem evolutiv ursprünglichen ökologischen Kontext funktionieren.',
