    'title': 'Känozoische Fossil-Lagerstätten im Atbara Valley, Sudan',
    'abstract': 'Paläontologische Untersuchungen im Känozoikum Sudans beschränkten sich bisher nur auf mittelpleistozäne Lagerstätten, trotz des Vorhandenseins fossilführender paläogener und neogener Schichten im nahegelegenen Äthiopien und Eritrea. In dem hier beantragten Projekt soll speziell das im östlichen Teil des Sudan gelegene Atbara Valley diesbezüglich explorativ untersucht werden. Als Resultat des tektonischen Uplift des Äthiopischen Hochlands befinden sich dort mächtige känozoische Sedimentfolgen, gleichzeitig sind die Aufschlussverhältnisse im semi- bis hyperariden Atabara Valley exzellent. Da sowohl paläogene wie neogene Informationen zur Wirbeltierfauna für diese Region des Kontinents immer noch sehr unvollständig sind, versprechen känozoische Wirbeltierfunde aus dem Atbara Valley neuartige Einblicke in die Evolution und Paläoumwelt des nordöstlichen Afrikas. Dies ist auch speziell vor dem Hintergrund der globalen känozoischen Aridifizierung sowie dem afrikanischen Ursprung des Menschen von besonderer Bedeutung.',
