    'title': 'Molekulare Extremitätenentwicklung in dem basalen Squamaten Hemidactylus',
    'abstract': 'Die Extremitäten von Wirbeltieren stellen von jeher Meilensteine in der evolutionären Entwicklungsbiologie dar, da sie immens zu unserem Verständnis von entwicklungsbiologischen Prozessen und der Homologie von Organsystemen beitragen. In den letzten Jahre hat unser Wissen über den Ursprung, die Evolution und Entwicklung von Wirbeltier-Extremitäten Dank eines stark erweiterten Taxon Samplings von Nicht-Modellorganismen zu den bisher bestens untersuchten traditionellen Modellorganismen Maus und Huhn einen neuen Umfang bekommen. Taxa mit aussergewöhnlichen Morphologien, welche mit ökologischer Spezialisierung in Zusammenhang stehen, haben ungemein unser Wissen über den Ursprung und die molekulare Grundlage der Vielfalt in den Extremitäten verbessert. Jedoch sind squamate Reptilien, obschon sie einen grossen und ökologisch sehr diversen Teil in unseren heutigen Ökosystemen ausmachen, noch unterrepräsentiert in Evo-Devo Studien der Extremitäten, besonders im Hinblick auf basale Taxa.In dem vorliegenden Forschungsprojekt wird der basale Gecko Hemidactylus als neuer nicht-traditioneller Modellorganismus etabliert. Mithilfe Genexpressionsanalysen wird dieser das Untersuchungsobjekt für detaillierte Untersuchungen der Extremitätenentwicklung darstellen. Hemidactylus eignet sich ideal, zum einen um die Entwicklung von einzigartigen Extremitäten-Morphologien in Zusammenhang mit ökologischer Spezialisierung, genauer zu untersuchen, da er eine Bandbreite von morphologischen Modifikationen in seinen Autopodien aufweist, z.B. Grössenreduktion von Phalangenelementen, das Vorhandensein von selbsthaftenden Zehen sowie Paraphalangen. Zum anderen ist seine basale phylogenetische Stellung innerhalb der Squamaten von grosser Bedeutung. Eine bereits erfolgreich bestehende Tierzucht liefert frisches embryologisches Material für die angestrebten Analysen. Eine Beschreibung der morphologischen Modifikationen in den Autopodien von Hemidactylus wird als Grundlage für Genexpressionsanalysen dienen. Die zeitliche und räumliche Expression von neun Kandidatengenen, von denen anhand traditioneller Modellorganismen bekannt ist, dass sie eine wichtige Rolle in der Extremitätenentwicklung spielen, wird untersucht mithilfe der In situ Hybridisierungsmethode auf histologischen Serienschnitten. Die Ergebnisse werden mit denen in dem Madagaskargekko Paroedura picta sowie der Kanareneidechse Gallotia galloti direkt verglichen, und werden einen wichtigen Schlüsselbeitrag zu unserem Verständnis der entwicklungsbiologischen Programme und Prozesse in der Squamaten-Extremität leisten.',
