    'title': 'Nischendifferenzierung bei Herbivoren und die Intensivierung der Konkurrenz in afrikanischen Savannen',
    'abstract': 'Im heutigen Afrika weisen Savannen-Habitate eine große Diversität an herbivoren Säugetieren auf und zeigen ein hohes Mass an Nischen-Partitionierung, welches sich insbesondere in unterschiedlichen Körpergrößen und Nahrungspräferenzen widerspiegelt. In diesem Projekt soll die Evolution der Nischen-Partitionierung bei Savannen-Antilopen (Bovidae) mittels des plio-pleistozänen Fossilnachweises aus Ostafrika rekonstruiert werden. Im Gegensatz zu anderen Studien, welche sich primär auf evolutionären Wandel als Antwort auf Umweltveränderungen konzentrierten, soll hier jedoch der Fokus auf den Einfluss biotischer Interaktionen durch die Zeit gelegt werden. Methodisch beinhaltet dies einen trait-basierten Ansatz mit der Ausgangshypothese, dass herbivore trait-Diversität als Folge zunehmender Spezialisierung und stärker werdender interspezifischer Konkurrenz durch die Zeit hinweg ansteigen sollte. Um diese Hypothese zu testen, soll a) eine große morphologische trait-Datenbank generiert werden, b) ein neuer phylogenetischer Datensatz mit morphologischen und molekularen Merkmalen erstellt werden, und c) fossile Boviden-Gemeinschaft aus Äthiopien, Kenia und Tanzania im Detail untersucht werden.',
