    'title': 'Phonologische Syntax in den Lautäußerungen von Fledermäusen - ein biolinguistischer Forschungsansatz',
    'abstract': 'Biolinguistik ist ein interdisziplinäres Forschungsgebiet, das Erkenntnisse aus den Kognitionswissenschaften, der Ethologie, Neurobiologie, Genetik, Anthropologie, vergleichenden Psychologie und der theoretischen Linguistik miteinander vereint, um die Evolution menschlicher Sprache zu verstehen. Eine fundamentale Frage in diesem Kontext ist, welche Aspekte von Sprache ausschließlich beim Menschen vorkommen und welche homologen Merkmale man auch in den Lautäußerungen von Tieren findet. Momentan geht man davon aus, dass für menschliche Sprache drei wesentliche Bestandteile notwendig sind, nämlich die Fähigkeit zur vokalen Imitation, Syntax und Semantik. Der linguistische Begriff phonologische Syntax wird oft verwendet, um eine sequentielle Abfolge von akustischen Elementen zu beschrieben, die nicht notwendigerweise semantische Bedeutung haben muss, z.B. die Lautäußerungen von Tieren. Es kann sehr informativ sein, die phonologische Syntax in tierischen Lautäußerungen mit formellen linguistischen Methoden zu studieren. Allerdings sind die akustisch versatilsten Säugetiere, Wale und Fledermäuse, momentan nicht ausreichend untersucht. Ich möchte Syntaxproduktion und -perzeption bei Fledermäusen mit einem biolinguistischen Forschungsansatz untersuchen, indem ich verschiedene deskriptive, experimentelle und computerlinguistische Methoden anwende. Meine Fokusart Saccopteryx bilineata ist für die biolinguistische Syntaxforschung hochinteressant, da sie als eines der wenigen Säugetiere zu vokaler Imitation in der Lage ist; diese Fähigkeit ist neben Syntax ein weiterer wesentlicher Bestandteil von menschlicher Sprache. Ich werde Syntaxontogenie, regionale syntaktische Unterschiede sowie Syntaxflexibilität an verschiedenen Lautäußerungen von S. bilineata untersuchen. Zudem werde ich computerlinguistische Methoden anwenden, um Syntax bei Fledermäusen mit einem interdisziplinären Ansatz zu untersuchen.',
