    'title': 'Phylogenetische Rekonstruktion der thermalen Nischen von Palaearktischen Eidechsen der Familie Lacertidae',
    'abstract': 'Halsbandeidechsen (Lacertidae) sind die häufigsten und bekanntesten Echsen in Europa und der Mittelmeerregion, und auch im Fossilbericht äußerst häufig vertreten. Sie enthalten sowohl mikroendemisch als auch extrem weit verbreitete Arten. Angesichts ihrer Habitat-Vorlieben kann postuliert werden, dass verschiedene Lacertiden-Kladen sich durch unterschiedliche Anpassungen an Temperatur- und Feuchtigkeits-Regimes auszeichnen und dadurch ideale Modellgruppen zum Verständnis biotischer Auswirkungen von vergangenen und gegenwärtigen Klimaänderungen darstellen. Das hier beantragte Projekt wird phylogenomische, physiologische, osteologische und paläontologische Ansätze integrieren, um die Evolution von thermophysiologischen Nischen der Halsbandeidechsen zu rekonstruieren. Ein zeitkalibrierter Stammbaum der Lacertiden, mit besonderem Fokus auf der westpaläarktischen Lacertini-Klade, wird mittels einer Supermatrix von DNA-Sequenzen ermittelt, die sich aus Transkriptomen, "Anchored Hybrid Enrichment" und traditionellen Sanger-Sequenzen zusammensetzt. Micro-CT Scans der Skelette aller 124 Lacertini-Arten werden zur Definition von osteologischen Merkmalszuständen dienen, welche dann gemeinsam mit DNA-Merkmalen phylogenetisch analysiert werden. Die so phylogenetisch optimierten Merkmalszustände werden in der Folge dazu dienen, eine maximale Anzahl von Fossilien bestimmten osteologisch gut definierten Kladen zuzuordnen. Bevorzugte Optimal-, Vorzugs-, Freiland- und kritische Minimal- und Maximaltemperaturen aller Lacertini-Arten werden experimentell bestimmt und dazu verwendet, potentielle Verbreitungsgebiete in Gegenwart und Vergangenheit zu modellieren. Thermophysiologische Nischen werden als Merkmale entlang der Phylogenie rekonstruiert, um entsprechend spezialisierte Kladen zu identifizieren. Das Projekt wird u.a. die folgenden Hypothesen testen: (a) eine Kombination phylogenomischer und osteologischer Daten kann eine schnelle känozoische Radiation wie die der Lacertini, inklusive vieler fossiler Taxa, aufklären; (b) eine bedeutende Menge von Halsbandeidechsen-Fossilien können durch kladistisch definierte Skelettmerkmale bestimmten Kladen zugeordnet werden; (c) thermophysiologische Anpassungen charakterisieren häufig ganze Lacertiden-Kladen und ermöglichen in Verbindung mit Fossilfunden paläoklimatische Aussagen; (d) Variation in thermophysiologischen Anpassungen korreliert mit latitudinaler Verbreitung; (e) die Paläoverbreitung von Fossilien kann eine schlüssige Validierung von Physiologie-basierten Verbreitungsmodellen liefern. Weiterhin werden unsere Ergebnisse durch eine sorgfältige Auswahl der Außengruppen für Transkriptom-Sequenzierung entscheidend zur Aufklärung der tiefen Phylogenie der Squamata beitragen. Zudem werden die Physiologie-basierten Verbreitungsmodelle direkt in eine globale Analyse der Klimawandel-bedingten Aussterbewahrscheinlichkeit von Reptilien einfließen.',
