    'title': 'Phylogenie und Evolution der aculeaten Hymenopteren',
    'abstract': 'Aculeate Hymenopteren (Wespen, Bienen, Ameisen und Verwandte) sind eine mit mehr als 50.000 beschriebenen Arten enorm vielfältige Insektengruppe innerhalb der Hautflügler, die durch ihre hohe Diversität und ihre komplexe Lebensweise bis hin zu hoch-sozialen Staatenbildungen seit je her Ziel evolutionsbiologischer und phylogenetischer Untersuchungen gewesen ist. Andererseits kann die Phylogenie innerhalb der Aculeata als nicht befriedigend geklärt gelten. Sowohl neuere molekulare als auch morphologische Arbeiten betreffen meist die gesamten Hymenopteren und leiden unter einem ungenügenden, lokalen Taxonsampling. Zudem sind die morphologischen Daten meist älterer Literatur entnommen und schlecht dokumentiert. Das vorliegende Projekt zielt daher auf die Erstellung einer umfassenden und qualitativ hochwertigen morphologischen Datensatzes für eine Klärung der phylogenetischen Beziehungen innerhalb der aculeaten Hymenopteren. Der Schwerpunkt der Arbeit liegt dabei einerseits auf denjenigen Taxa, die mutmaßlich paraphyletisch oder in ihrem phylogenetischen Status zumindest widersprüchlich sind und solchen morphologischen Merkmalssystemen, die bislang nicht oder ungenügend bei Aculeaten untersucht wurden oder deren Homologieverhältnisse unklar sind. Grundlage des Projekts ist ein gezieltes Taxonsampling, der Einsatz innovativer Techniken (3D-Rekonstruktion auf der Basis von Mikro-CT-Untersuchungen, ergänzt durch REM) und einen innovative, detaillierte Dokumentation der Merkmale. Die morphologischen Daten sowie die verwendete Terminologie sollen unmittelbar einfliessen in das Projekt Hymenoptera Anatomy Ontology (HAO), das wiederum durch seine Verknüpfung mit Morphbank erlaubt, die gewonnenen Daten und Abbildungen in geeigneter Form in einer Datenbank zu verknüpfen. Auf der Basis der resultierenden, umfangreichen Datenmatrix morphologischer Merkmale soll die Phylogenie der Aculeata rekonstruiert werden. Auf Grundlage der resultierenden Hypothesen sollen evolutive Szenarien der Merkmalstransformation diskutiert werden.',
