    'title': 'Planetare Entwicklung - Eine Studie zur thermischen Entwicklung des Mond.',
    'abstract': 'Neben der Erde sind auch für den Moon umfassende und globale Datensätze verfügbar, um die Entwicklung des inneren Aufbaus eines planetaren Körpers zu verstehen. Die thermo-chemische Entwicklung des Mondes ist auf seiner Oberfläche durch großflächigen basaltischen Vulkanismus aufgeschlossen. Anhand von Gesteinsproben kann die zeitliche Abfolge und chemische Zusammensetzung der Lavaflüsse bestimmt werden. Zusammen mit spektralen, topographischen, chemischen und gravimetrischen Fernerkundungsdaten bilden diese Gesteinsanalysen einen selenologischen Kontext. Während Fernerkundungsdaten eine ca. 3,2 Milliarden Jahre andauernde vulkanische Aktivität des Mondes anzeigen, ist durch radiometrische Datierungen von Mondmeteoriten und größeren Apollo und Luna Gesteinsproben bisher nur ein deutlich kürzerer Zeitraum von ~1,8 Milliarden Jahren belegt. Im Gegensatz zu den Gramm schweren Apollo Proben sind die Milligramm schweren basaltischen Fragmente aus Apollo 15 Regolithproben (Apollo 17 Proben wurden in der ersten Projektphase untersucht) von eine große Anzahl unterschiedlicher Gesteine. Ich will weitführend die regionale Vielfalt von Basaltflüssen um die Apollo 15 Landestelle dokumentieren durch Messung der 1) chemischen Zusammensetzung (Mikrosonde); 2) 40Ar-39Ar Alter und 3) U-Pb Alter akzessorischer Minerale (In-Situ). Untersucht wird damit die Entwicklung von Heterogenitäten im Mantel des Monds. Das Potential dieser multidisziplinären Strategie wurde bisher noch nicht ausgeschöpft.Die neuen Daten der Apollo 15 Basaltproben, zusammen mit den schon gewonnenen Daten der Apollo 17 Basaltproben, beschreiben zwei sehr unterschiedliche vulkanische Provinzen des Mondes, innerhalb und außerhalb des Procellarum-KREEP Terrain. Diese Daten liefern wichtige Randbedingungen bezüglich der thermischen Entwicklung und Schmelzbildung im Mondinneren. Mit den neuen mineralogischen, geochemischen und chronologischen Daten sowie Mineral-Schmelz Partitionskoeffizienten will ich die thermo-chemische Entwicklung des Mondmantels unterhalb der Impaktbecken Imbrium und Serenitatis erfassen. Die bekannten chemischen und isotopischen Variationen der Mondproben lassen sich nur bedingt durch Vier verschiedene Mantelquellen für Ti-reiche und -arme Basalte, KREEP Gesteine, und Anorthosite erklären. Dies deutet auf Heterogenität des Mondmantels und regionale Variationen der Magmabildung im Laufe der Zeit. Die Resultate werden zusammen mit 3D-thermo-chemischen Modellen basierend auf einem finite Differenz/finites Volumen Computercode StagYY evaluiert um die magmatische Entwicklung eines Planeten ohne Plattentektonik besser zu verstehen.',
