    'title': 'Rekonstruktion der Evolutionsgeschichte ökologischer Anpassungen bei Säugetieren anhand mikroanatomischer Studien',
    'abstract': 'Säugetiere haben im Lauf ihrer Evolution mehrfach komplett unterschiedliche Lebensweisen entwickelt, u.a. aktiven Flug und Anpassungen an das subterrane und aquatische Milieu. Um die evolutionäre Geschichte solcher Lebensweisen adäquat rekonstruieren zu können, ist eine Kombination rezenter und fossiler Taxa im Rahmen vergleichend-phylogenetischer Untersuchungen unerlässlich. Aufgrund der Limitierung durch die Fossilerhaltung kann sich dabei aber nur auf Merkmale im knöchernen Skelett konzentriert werden. Dabei ist es ein Vorteil, dass sich funktionelle Anpassungen oftmals in der Mikroanatomie von Knochen wiederspiegeln. Im gegenwärtigen Projekt soll daher auf Basis von zwei- (2D) und dreidimensionalen (3D) Ansätzen die Mikroanatomie von aquatischen, subterranen und fliegenden Säugetieren über größere taxonomische Skalen hinweg sowohl bei rezenten wie fossilen Taxa untersucht werden. Speziell bei 3D-Ansätzen blieben bisherige Untersuchungen weitgehend auf Primaten beschränkt. Dabei werden jeweils der Humerus und der Lumbalwirbel eines Taxons mittels Mikro-Röntgentomographie (mikroCT) digital erfasst. Aus dem Datensatz werden anschließend quantitative 2D- und 3D-Daten extrahiert und in einem phylogenetischen Rahmen vergleichend analysiert. Neben der ökologischen Einordnung von fossilen Taxa soll dabei auch auf Korrelationen zwischen Lebensweise und Mikroanatomie getestet und die anzestralen Zustände für größere Kladen geschätzt werden. Abschließend sollen die größeren Muster in der Evolution unterschiedlicher Lebensweisen analysiert werden, insbesondere in Bezug auf Exaptationen und die zeitliche Abfolge morphologischer und mikroanatomischer Neuerungen.',
