    'title': 'Rekonstruktion der Zusammensetzung von Inselbiozönosen auf evolutionären Zeitskalen: Ein phylogenetischer Modellierungsansatz',
    'abstract': 'Die zeitliche Entwicklung der Artenvielfalt ist eine der grundlegendsten Fragen der Biologie. Die Rekonstruktion der Veränderungen der globalen Biodiversität über evolutionäre Zeiträume auf den Kontinenten ist eine große Herausforderung. Inseln stellen dank ihrer isolierten Lage, den definierten Grenzen und eines vergleichsweise geringen Artenreichtums ideale Modellsysteme biologischer Prozesse dar, die in kontinentalem Maßstab meist zu komplex für eine Untersuchung sind. Auch wenn in letzter Zeit Fortschritte gemacht wurden im Verständnis der Prozesse, die der Entwicklung der Vielfalt auf Inseln zugrunde liegen, so bleiben doch einige Fragen bislang unbeantwortet. Die Biodiversität ergibt sich aus dem Zusammenspiel von Kolonisierung, Artenbildung und Aussterben. Wir wissen bislang jedoch wenig darüber, wie diese Prozesse auf Inseln weltweit abhängig von Alter, Fläche und Isoliertheit variieren. Wir wissen auch noch nicht, ob die Artenvielfalt grenzenlos wachsen kann oder ob sie durch Gleichgewichtsprozesse reguliert wird (zu einer konstanten Artenzahl tendiert). Zudem haben sich die Entwicklungen in letzter Zeit vor allem auf ozeanische Inseln (die nie mit anderen Landmassen verbunden waren) konzentriert, während die Mehrzahl der existierenden Inseln mindestens einmal Verbindung mit einem Kontinent hatten (nicht-ozeanische Inseln). Ein wichtiger Teil der Inselsysteme wurde also von der Forschung oft vernachlässigt. Durch Entwicklung neuartiger dynamischer Modelle der Inselbiogeographie und ihre Anwendung auf neu erstellte molekulare Stammbäume von sowohl ozeanischen als auch nicht-ozeanischen Inseln wird das vorliegende Vorhaben diese Fragen behandeln. Ziel des Projekts ist die Rekonstruktion der Muster der Artenakkumulation auf Inseln weltweit, um in globalem Maßstab zu verstehen, wie Inselcharakteristika, Wechselwirkungen der Arten und historische Ereignisse (z. B. Bildung neuer Inseln und Verschmelzung von Landmassen) den Artenreichtum in isolierten Lebensräumen formen. Dieses Vorhaben wird den ersten globalen Datensatz zu den Zeitpunkten der Kolonisierung durch Vogelarten erstellen. Zudem wird erstmals die Existenz eines inselweiten Diversitätslimits (max. Artenzahl, die eine Insel beherbergen kann) untersucht. Das Projekt wird wegweisende phylogenetische Modelle hervorbringen, die ausdrücklich nicht-ozeanische Inseln berücksichtigen (wird anhand der Inseln Socotra und Sulawesi getestet), und damit die weitere Forschung an diesen bislang wenig untersuchten Systemen stimulieren. Alle entwickelten Methoden werden in ein neues Softwarepaket integriert, das zum Standardwerkzeug zur Untersuchung der Inselbiogeographie mittels phylogenetischer Daten werden soll. Dieses Projekt wird einen neuen grundlegenden Rahmen für die Untersuchung der langfristigen Evolutionsdynamik in isolierten Lebensräumen zur Verfügung stellen und wird dringend erwartete Antworten liefern in einem Themenbereich mit weit reichenden Implikationen für Biodiversität.',
