    'title': 'Schmelzen, Impakte und der Volatilgehalt des Inneren und der Atmosphären von Mars und Venus',
    'abstract': 'Schmelzprozesse in planetaren Mänteln haben in vieler Hinsicht die chemische Evolution von Planeten seit ihrer Entstehung geprägt. Eine ihrer wichtigsten Folgen ist die Mobilisierung und Umverteilung volatiler Spurenbestandteile des Mantels, insbesondere Wasser und Kohlendioxid, im Mantel, zwischen Mantel und Kruste sowie schließlich zwischen Innerem und Atmosphäre, indem Volatile durch vulkanische Aktivität ausgegast werden. Schmelzbildung beeinflusst daher nicht nur den chemischen Zustand des Inneren, sondern spielt auch eine wesentliche Rolle beim Aufbau der Atmosphäre und der anschließenden Klimaentwicklung. Die Atmosphäre hat jedoch auch eine Rückwirkung auf das Innere, indem sie die Effizienz der Ausgasung über den Druck an der Oberfläche kontrolliert.Meteoriteneinschläge waren eine bedeutende geologische Kraft in der frühen Planetenentwicklung. Impaktoren aller Arten und Größen haben die Atmosphären ihrer Zielplaneten in verschiedenem Ausmaß sowohl erodiert als auch angereichert, und die größeren vermochten tiefer in den festen Körper einzudringen und geodynamische Prozesse auszulösen; Schmelzbildung ist auch hier einer der wichtigsten. Es besteht also ein komplexes Wechselspiel zwischen Schmelzvorgängen im allgemeinen, Impakten und der Atmosphäre, das Planeten auf unterschiedlichste Entwicklungspfade führen kann.Im beantragten Projekt sollen diese Wechselwirkungen mit numerischen Modellen der Mantelkonvektion, Impaktdynamik und Atmosphärenentwicklung untersucht werden, die auf unterschiedliche Weise gekoppelt werden; die dafür vorgesehenen Algorithmen existieren entweder bereits und werden angepasst und verbessert oder sie werden für diesen Zweck entwickelt. Die Mantelkonvektion bildet den langfristigen Rahmen des Evolutionsmodells und wird von Impakten, die als instantane Störungen auftreten, beeinflusst; die Atmosphäre fungiert als Randbedingung für den Mantel, die jedoch nicht bloß statisch ist, sondern eine Eigendynamik besitzt und in Wechselwirkung mit dem Mantel und den Impakten treten kann.Dieses kombinierte Modell wird speziell zur Modellierung der Entwicklung von Mars und Venus, der beiden in vieler Hinsicht erdähnlichsten Körper unseres Sonnensystems, eingesetzt. Unter anderem soll es verwendet werden, um die initialen Wasser- und Kohlendioxidkonzentrationen in ihren Mänteln und ihre Umverteilung zu modellieren, einen Vergleich mit Messdaten zu versuchen sowie die dynamischen Auswirkungen des säkularen Verlusts der Volatile etwa im Hinblick auf die Bildung eines "Stagnant lid" zu untersuchen. Das Atmosphärenmodul soll zur Aufklärung der Rückkopplungen zwischen Ausgasung und Klima verwendet werden, insbesondere in Fällen wie der Eskalation zu Hochdruck-Hochtemperatur-Treibhausbedingungen wie auf der Venus. Das Impaktmodul wird prüfen, wie entscheidend die Modulation der chemischen Entwicklung des Inneren und der Atmosphäre durch Impakte war und ob sie in der Summe die Atmosphäre abgetragen oder aufgebaut haben.',
