    'title': 'Seeberge als potentielle Trittsteine für die Verbreitung des Meiobenthos. Vergleichende taxonomische, faunistische und biogeographische Untersuchungen der Kinorhyncha von verschiedenen Seebergen und Inseln des Nordost-Atlantiks und des Mittelmeeres',
    'abstract': 'Das hier beantragte Forschungsvorhaben ist eingebettet in ein umfassendes Vorhaben zur Untersuchung der möglichen Bedeutung von Seebergen für die Verbreitung mariner meiobenthonischer Gruppen und zur Leistung eines Beitrags zur Klärung des sogenannten Meiofauna-Paradoxons. Obwohl für Vertreter des Meiobenthos aufgrund ihrer geringen Körpergröße, fehlender Freiwasserstadien und ihrer streng bodengebundenen Lebensweise nur sehr begrenzte Ausbreitungsmöglichkeiten angenommen werden, zeigen viele Vertreter der Meiofauna auf Gattungs- und sogar auf Artebene eine sehr weite bis kosmopolitische Verbreitung in den Ozeanen. In den letzten Jahrzehnten rücken Seeberge zunehmend ins Blickfeld der Forschung, weil sie unter Umständen eine Rolle als Trittsteine einnehmen und die Ausbreitung auch solcher benthonischer Taxa fördern, für die die Weiten und Tiefe der Meere eigentlich unüberwindliche Barrieren darstellen.Erst in jüngerer Zeit wenden sich entsprechende Untersuchungen auch dem Meiobenthos zu, indem einzelne meiobenthonische Großgruppen (Copepoda Harpacticoida, Halacarida, Loricifera) näheren chorologisch-faunistischen Vergleichen unterzogen wurden. Um für das Meiobenthos im Allgemeinen geltende Aussagen machen zu können, ist der Einbezug weiterer meiobenthonischer Taxa erforderlich. Kinorhyncha werden in Proben von Seebergen regelmäßig nachgewiesen, haben aber bisher noch keine faunistische Bearbeitung erfahren. Das für die hier beantragte Untersuchung verfügbare Material stammt von sieben nordost-atlantischen und mediterranen Seebergen, dazu liegt zusätzliches Material von den Inseln Madeira und Porto Santo vor. Damit steht erstmals umfangreiches Probenmaterial von unterseeischen Erhebungen einer Region für einen umfassenden faunistischen Vergleich zur Verfügung. Es gilt, die Kinorhynchenfauna der erwähnten Seeberge und Inseln einer quantitativen taxonomischen und multivariaten Gemeinschaftsanalyse zu unterziehen. Dabei soll vor allem erkundet werden, ob die Seeberggipfel/Inseln sich durch isolierte Kinorhynchengemeinschaften auszeichnen, die durch eine hohe Zahl endemischer Arten charakterisiert werden können, oder ob die Faunen gemeinsame Arten aufweisen, was für einen Austausch der Kinorhynchenfauna spräche. Zu Vergleichszwecken werden Arten des atlantischen und mediterranen Europäischen Festlands (Spanien, Italien) in die Studie einbezogen. Es wird erwartet, mit den erhaltenen Ergebnissen, zusammen mit denen bereits laufender Studien zu Harpacticoida einen wesentlichen Beitrag zu unserem Verständnis der Ausbreitung meiobenthonischer Organismen in den Ozeanen zu leisten.',
