    'title': 'Trias-Übergang: Analyse des Nischen-Austausches zwischen Großgruppen fossiler Wirbeltiere',
    'abstract': 'Der Wechsel von paläozoischen zu modernen Faunen während der Trias (ca. 252-200 Ma) war einer der signifikantesten biologischen Umschwünge in der Erdgeschichte. Die taxonomischen Umwälzungen während dieser Zeit sind gut bekannt, aber die zugrunde liegenden evolutionären Prozesse verbleiben bis dato ungeklärt. Es gibt zwei konkurrierende Hypothesen hinsichtlich der evolutionären Dynamik im Verlauf dieses Umschwunges der dominierenden terrestrischen Wirbeltiergruppen: Konkurrenz und ökologischer Opportunismus. In dieser Studie werden diese Hypothesen erstmalig direkt quantitativ getestet, mit Hilfe einer geometrisch morphometrischen Analyse der Unterkieferform (ein bekanntes Korrelat der Nahrungsnische) in terrestrischen Wirbeltieren aus dem Perm, der Trias und des Jura. Die zu erwartenden Forschungsergebnisse werden wichtige Implikationen für unser Verständnis der Ursprünge von Dinosauriern und Säugetieren haben. Sie werden darüber hinaus auch allgemein Einblicke in die Dynamik von Ökosystemerneuerungen nach Massenaussterben geben, welche wichtige Informationen für die Modellierung von Langzeiteffekten des gegenwärtigen, vom Menschen verursachten Artensterben darstellen.',
