    'title': 'Altersstellung und Paläoökologie der Dinosaurier-Lagerstätte Tendaguru in Tansania, Ostafrika',
    'abstract': 'Der Kenntnisstand über die Paläoökologie und Biostratigraphie der seit ca. 90 Jahren bekannten und heute berühmten Dinosaurier-Lagerstätte Tendaguru, Tansania, ist in vielen Details noch unbefriedigend. Dies gilt im besonderen auch für die Palynologie der Tendaguru-Schichten.Nachdem vom Verfasser bis Ende 1998 weit über einhundert Tendaguru-Proben untersucht wurden, ist es erstmals gelungen, palynologisch aussagefähige Mikrofloren aus Tendaguru-Sedi- menten zu isolieren. (...)Im Antragszeitraum soll die systematische Bearbeitung der schon vorhandenen Tendaguru-Palynomorphen (hauptsächlich Pollen, Sporen, Dinoflagellaten) fortgesetzt werden und darauf aufbauend die biostratigraphische und paläoökologische Interpretation der Schichtenfolge weiter präzisiert werden. (...)Durch die im ablaufenden Antragszeitraum gewonnenen Erfahrungen über die Verteilung von produktiven Proben im Tendaguru-Profil läßt sich jetzt abschätzen, wo die für Palynologie günstigsten - das sind die am tiefsten angeschnittenen und daher frischesten Profilbereiche - liegen. Diese Kenntnisse sollen bei eigener Probennahme im Gelände genutzt werden. (...)Ergänzend zu den Untersuchungen am Tendaguru selbst soll ein Parallel-Profil aus der ca. 50 km nordöstlich von Tendaguru gelegenen Erkundungsbohrung Kiranjeranje palynologisch untersucht werden. (...)',
