    'title': 'Chytridiomykose - Untersuchungen zur Gefährdung einheimischer Amphibien durch Batrachochytrium dendrobatids',
    'abstract': 'Chytridiomykose, eine durch Batrachochytrium dendrobatidis verursachte Pilzerkrankung, ist eine maßgebliche Ursache für z.T. drastische Bestandseinbrüche, die seit Anfang der 70er Jahre weltweit bei verschiedenen Amphibienarten beobachtet werden. Während B. dendrobatidis für einige Arten ein hoch virulenter Erreger ist, der sogar zum Aussterben einzelner Spezies führte, zeigen andere aus bisher unbekannten Gründen nur latente Infektionen ohne klinische Symptome. Um das von B. dendrobatidis ausgehende Gefährdungspotential für einheimische Amphibien einschätzen und effektive Konzepte zum Schutz der Populationen entwickeln zu können, sind Daten zum Wirtsspektrum, zu Übertragungswegen und den pathologischen Mechanismen sowie zur genetischen Diversität von B. dendrobatidis dringend erforderlich. Auf der Grundlage hochvariabler DNA-Marker soll die intraspezifische Variabilität des Erregers bestimmt werden. Durch molekulargenetische Analysen von Gewebeproben einheimischer Amphibien, einschließlich historischen Sammlungsmaterials, sollen weiterhin die Verbreitung des Erregers in Deutschland und das Spektrum der befallenen Arten ermittelt sowie Hinweise auf dessen Ursprung erlangt werden. Von Infektionsexperimenten, verbunden mit histologischen, molekularen und physiologischen Untersuchungen, erwarten wir neue Erkenntnisse zur Pathogenese der Chytridiomykose und zur Virulenz verschiedener Pilzstämme.',
