    'title': 'Das Kaokoveld in Namibia - eine eigenständige Region oder Teil der Western Escapment Mountains (WEM) ?',
    'abstract': 'Das Kaokoveld im Nordwesten Namibias ist geographisch der nördlichste Ausläufer der Western Escarpment Mountains, die sich von Kapstadt über Namibia bis nach Süd-Angola erstrecken. Die Gegend ist abgelegen und nur mit 4x4 Geländewagen zu erkunden. Die Kenntnis über die authochthone Lepidoptera und Trichoptera Fauna ist praktisch Null. Mit Hilfe einer zeitlich begrenzten Biodiversitätsaufhahme (Rapid Biodiversity Assessment) soll der Charakter (Zusammensetzung, Endemismus etc.) der dortigen Fauna erfasst und Verbreitungsdaten gesammelt werden. Es soll die Frage beantwortet werden, ob das Kaokoveld eine eigenständige Fauna mit eigenen Endemiten besitzt, oder ob es im wesentlichen die biogeographische Verlängerung der südlichen Bergregionen darstellt. Die bisherige, unklare biogeographische Stellung des Brandberges zwischen Kaokoveld und den südlichen Bergen (beginnend mit dem Khomas Hochland) soll mit dem Projekt einer Lösung näher gebracht werden.',
