    'title': 'Der Stachelapparat aculeater Hymenopteren: Morphologie, Evolution und die Bedeutung für Reproduktionsstrategien bei solitären Wespen',
    'abstract': 'Der Stachelapparat der aculeaten Hymenopteren (Bienen, Wespen, Ameisen und Verwandte) ist wohl die zentrale Schlüsselinnovation in der Evolution dieser enorm vielfältigen und artenreichen Gruppe. In diesem Projekt soll der Stachelapparat der solitären, also einzeln lebenden Wespen vergleichend-morphologisch untersucht werden. Voruntersuchungen haben gezeigt, dass der Stachelapparat eine aussagekräftige Struktur für das Verständnis phylogenetischer und evolutiver Prozesse der Aculeata ist. Darüber hinaus kann davon ausgegangen werden, dass der Stachelapparat in enger funktioneller Kopplung an seine spezifische biologische Rolle und Funktion evolviert ist, z.B. in Anpassung an die spezifische Beute, an parasitoide Lebensweise und an Verteidigungsstrategien. Ziel des Projekts ist damit in erster Linie eine umfassende Beschreibung und morphologische Analyse des Stachelapparates der Aculeaten (mit besonderer Berücksichtigung der besonders artenreichen und morphologischen und verhaltensbiologisch diversen Grabwespen) und der Überprüfung seine Bedeutung für Verwandtschaftsanalysen innerhalb der Aculeata und innerhalb der Apoidea (Bienen und Grabwespen). Auf der Basis dieser Ergebnisse sollen die gruppenspezifischen Merkmale des Stachelapparates mit der jeweiligen Reprodukionsstrategie (im Sinne von Nestbau- und Beutefangstrategien) korreliert und schließlich zu einem evolutiven Szenario der Evolution des Stachelapparates der Aculeata verknüpft werden.',
