    'end_date': 2003,
    'title': 'Die Bedeutung des Brandberg-Massivs in Namibia für die Entstehung und Erhaltung von Biodiversität am Beispiel der Lepidoptera- und Trichoptera-Fauna',
    'abstract': 'Die Untersuchungen am Brandberg sollen Antwort auf folgende zwei Fragestellungen bringen: 1. Welches Potential besitzen Inselberge (im Gegensatz zu Gebirgen) bei der Entstehung und Erhaltung von Biodiversität? 2. Gehört die Inselbergfauna als ein spezielles Element zum umgebenden Biom, oder ist sie eine Exklave eines anderen Bioms, oder ist sie eine Mischfauna verschiedener Biome? - Als Inselberg wird der Brandberg in Namibia ausgewählt. Die Lepidoptera und Trichoptera (Insecta) dienen als Beispielgruppen. Das Thema berührt einen zentralen Aspekt der Biodiversitätsforschung (=Entstehung). Seine Bearbeitung ist ein eigenständiger, deutscher Beitrag innerhalb eines umfangreichen internationalen Projekts. (p)',
