    'title': 'Die Bildungsbedingungen von Diamant in den Impaktformationen des Nördlinger Ries',
    'abstract': 'Durch Impaktmetamorphose entstandene Diamanten wurden weltweit in zahlreichen Kratern nachgewiesen. Die noch weitgehend unklaren Bildungsbedingungen und die noch unbekannte Verteilung der Impaktdiamanten in den verschiedenen Arten von Impaktbreccien eines Kraters sollen am Beispiel des Nördlinger Ries, wo sämtliche Typen von Breccien zugänglich sind, aufgeklärt werden. Die nach einem bereits entwickelten chemischen Verfahren zu extrahierenden Diamanten sollen mit optischen, röntgenographischen, elektronenoptischen und isotopengeochemischen Methoden analysiert werden. Die impaktmetamorphen Wirtsgesteine der Diamanten (z.B. Impaktgläser, stark geschockte Kristallingesteine) werden petrographisch und geochemisch untersucht, um sowohl die primären Ausgangsgesteine als auch den Stoßwellendruck zu diagnostizieren. Die Ziele der Untersuchungen sind: (1) die Ermittlung der Bestandteile von Impaktbreccien, die Träger von Impaktdiamanten sind, (2) die Bestimmung der primären Ausgangsgesteine (graphitführende Gneise und/oder Karbonate), (3) die Bestimmung des Druck- und Temperaturbereichs für die Diamantbildung und (4) die detaillierte Aufklärung der Phasentransformation Garphit > Diamant/Lonsdaleit bei der Stoßwellenmetamorphose.',
