    'title': 'Die Biodiversität endemitenreicher Gebiete des Iran und Untersuchungen zu ihrer historischen Biogeographie anhand ausgewählter Insekten-Taxa',
    'abstract': 'Noch immer ist die Diversität vieler Insekten nicht annähernd erforscht. Diese Aussage trifft hinsichtlich der in diesem Projekt zu untersuchenden Taxa der Coleoptera und Diptera aufweite Bereiche des Nahen und Mittleren Ostens und insbesondere auf den Iran zu, der eine Schlüsselrolle in dieser Region einnimmt. Vorarbeiten der Antragsteller (GZ 446 IRN-18/1/0,4446 IRN-18/2/04) belegen, dass im Iran neben einer bisher unbekannten Zahl von weiterverbreiteten Faunenelementen auch zahlreiche Endemiten vorkommen. Das derzeitige Wissensdefizit verursacht Probleme bei der biogeographischen und historischen Interpretation der vorliegenden Ergebnisse und erschwert die Bewertung der riesigen zentral- und westasiatischen Region sowie die Erforschung der Wechselwirkungen dieses Raumes mit der eurosibirischen Region im Norden, dem westlich angrenzenden Mediterraneum und den im Süden des Gebietes befindlichen Übergangsgebieten zur Afrotropis und Orientalis. Für ausgewählte Gattungen der Staphylinidae (Coleoptera), Tachinidae (Diptera) und Rhinophoridae (Diptera) sollen deshalb mit diesem Forschungsprojekt wesentliche Fortschritte in der Kenntnis der Biodiversität des Iran erreicht und damit Grundlagen geschaffen werden für Untersuchungen zur historischen Biogeographie auf der Basis phylogenetischer Verwandtschaft. Dabei sind Thesen zu verifizieren, die mehrere arboreale und einen eremialen Refugialraum für das Gebiet des Iran postulieren. Die noch weitgehend unbekannten endemischen Arten machen den besonderen Wert der Landesfauna des Iran aus. Dieses wissenschaftliche Erbe gilt es in Zusammenarbeit mit Wissenschaftlern aus dem Iran zu erforschen, zu dokumentieren und zu bewahren.',
