    'title': 'Die Heterogynaidae - Schwestergruppe von Grabwespen und Bienen?',
    'abstract': 'Die Heterogynaidae sind eine monophyletische Gruppe aculeater Hymenopteren, die derzeit sieben beschriebene und fünf unbeschriebene, aber bekannte Arten umfasst. Während die sehr seltenen Weibchen kurzflügelig sind, besitzen die weitaus häufigeren Männchen gut ausgebildete, in ihren Aderung aber reduzierte Flügel. Über das Verhalten der Heterogynaidae ist nichts bekannt, die geringe Körpergröße und die Kurzflügeligkeit der Weibchen deuten aber auf eine parasitäre Lebensweise hin. Es wird derzeit angenommen, dass es sich bei den Heterogynaidae um eine basale Linie der Apoidea (Grabwespen + Bienen) und damit entweder um die Schwestergruppe aller Apoidea um das mit etwa 30.000 beschriebenen Arten formenreichste und heterogenste Monophylum innerhalb der aculeaten Hymenopteren handelt, kommt der Frage nach der phylogenetischen Position der Apoidea und der Heterogynaidae besondere Bedeutung zu. Das derzeit in Museen vorhandene Material ist zu einem überwiegenden Teil trocken fixiert und nicht zur Präparation geeignet bzw. freigegeben, so dass verlgeichend-morphologische Untersuchungen, die vom Antragsteller derzeit in einer internationalen Kooperation durchgeführt werden, an Grenzen stoßen. Im Rahmen des hier vorgelegten Antrags auf Sachbeihilfe sollen daher für molekulare und morphologische Untersuchungen Exemplare einer bestimmten, sicher zu findenden Art, Heterogyna protea von Rhodos, gefangen und flüssigkeitsfixiert werden. (p)',
