    'title': 'Die Perm-Trias Grenze und die Untertrias transkaukasischer und zentraliranischer pelagischer Profile',
    'abstract': 'Die Aufschlüsse der Perm/Trias-Grenzschichten in Nortwest-Iran (Gegend von Julfa) und Zentraliran (Gegend von Abadeh) gehören zu den klassischen Lokalitäten, in welchen pelagische Sedimentgesteine studiert werden können im Hinblick auf das bedeutendste Massenaussterben in der Erdgeschichte. Beide Regionen zeigen eine kontinuierliche Abfolge von permischen und triassischen Kalksteinen, die von einem Grenzton unterbrochen wird, an dessen Basis der Aussterbehorizont liegt. Die gleichzeitige Untersuchung des Fossilinhaltes (besonders der Cephalopoden und Conodonten) und der Geochemie (delta13Ccarb, delta13Corg, delta18O und delta15N) sowie der Karbonatmikrofazies demonstriert, dass diese Profile das Potenzial für eine weit reichende Analyse der Ursachen des Massenaussterbens am Übergang vom Paläozoikum in das Mesozoikum haben. Die Entdeckung von bisher unbekannten, sehr fossilreichen Profilen in den Baghuk-Bergen in Zentraliran erlaubt eine detaillierte Korrelation mit den Profilen bei Jiulfa und können die Ergebnisse aus dieser Region untermauern.',
