    'title': 'Die Walfauna (Cetacea: Odontoceti, Mysticeti) aus dem untersten Obermiozän von Groß Pampau (Schleswig-Holstein), ihr phylogenetischer Status und ihre Entwicklung im atlantischen Raum',
    'abstract': 'Aus dem untersten Obermiozän von Groß Pampau in Schleswig-Holstein sind gegenwärtig Funde dreier artikulierter, relativ vollständiger Mysticeti, deren systematische Stellung bearbeitet werden soll, bekannt. Eines der Skelette wurde zunächst als Praemegaptera beschrieben (BEHRMANN 1995). Weitere Analysen lassen Zweifel an der Klassifizierung (HAMPE 1999). Neben den Bartenwalüberresten sind auch Odontoceti nachgewiesen. Der teilartikulierte Fund eines Delphin-Skelettes aus der Unterfamilie Steninae zählt zu den Besonderheiten in der Dokumentation neogener Zahnwale. Weitere Funde bestehen aus Wirbeln und Zähnen eines vermutlichen Schwertwals (RITZ & MÜLLER 1998). Der morphologischen Bearbeitung der Groß Pampauer Bartenwale soll eine phylogenetische Analyse der Mysticeti folgen. Es soll versucht werden, die zum Teil verwirrende Systematik innerhalb der Cetotheriidae unter Einbezug der Balaenopteridae zu entschlüsseln.',
