    'title': 'Diversifikationsmuster durch die Zeit: Geht die rezente Vielfalt der limnischen Schneckengruppe Viviparidae auf eine "alte" Radidation zurück?',
    'abstract': 'Die Untersuchung von Diversifikationsmustern durch die Zeit, also die Analyse der Geschwindigkeit und des Zeitpunktes der morphologischen und ökologischen Diversifizierung von Taxa, ist eine wesentliche Aufgabe der Evolutionsbiologie. Hier soll exemplarisch die Hypothese einer .alten Radiation, also einer lange zurückliegenden und vergleichsweise schnellen Aufspaltung von heute existierenden Linien, für die Viviparidae, eine Gruppe lebend gebärender Süßwassergastropoden, getestet werden. Dazu soll ihre Phylogenie mit molekularen Methoden basierend auf mitochondrialen und nuklearen Genen rekonstruiert werden. Der zeitliche Rahmen der Diversifikationsmuster kann dann mittels einer molekularen Uhr unter Verwendung des reichen und alten Fossilbelegs der Gruppe eingeschätzt werden. Insbesondere für die asiatischen Taxa, die sich durch einen sehr hohen Grad an schalenmorphologischer Vielfalt auszeichnen, sollen die genetischen Befunde in Verbindung mit morphologischen Befunden und Verbreitungsdaten zusätzlich auch genutzt werden, um Hypothesen zur Evolution der Schale in Abhängigkeit von Umweltbedingungen, historischen Biogeographie und lokalen adaptiven Radiation zu testen. Speziell für die bisher taxonomisch völlig unzureichend untersuchten asiatisch-australischen Taxa soll zusätzlich unter Einbeziehung von anatomisch-histologischen Daten sowie der Reproduktionsbiologie eine Revision auf Gattungsebene erreicht werden. Die an den Vivipariden gewonnenen Muster können mit bereits vorliegenden Ergebnissen von anderen Süßwasserschneckengruppen der Region verglichen werden, um so allgemeinere Aussagen über Diversifikationsmuster zu gewinnen.',
