    'title': 'Dynamische und chemische Entwicklung Mars- und Venus-ähnlicher Planeten',
    'abstract': '2D- und 3D-Modelle der Konvektion und Schmelzprozesse in Mars, Venus und ähnlichen Einplattenplaneten werden mit Modellen der Mineralogie und thermoelastischen Eigenschaften des Mantels kombiniert, um die Entwicklung dieser Planeten seit der Erstarrung des Mantels vor 4.4-4.5 Mrd. Jahren zu simulieren und gewisse geologische Strukturen auf ihrer Oberfläche zu erklären. Von besonderem Interesse sind die Stabilität ihrer Lithosphären, die verschiedenen vulkanischen Strukturen auf der Venus und die Bildung zweier anscheinend langlebiger vulkanischer Zentren auf dem Mars. Zentrale Aspekte sind der Einfluss von Phasenübergängen von Mantelmineralen auf globale Konvektionsmuster und die Dynamik von Mantelplumes sowie der Einfluss von Spurenkomponenten (Radionuklide und flüchtige Bestandteile) und ihre Umverteilung durch Konvektion, Schmelzen und Vulkanismus. Angesichts der begrenzten Kenntnis der Zusammensetzung und des Mantel-Kern-Verhältnisses werden gewisse Modellparameter wie die Dicke des Mantels, das Verhältnis von Magnesium und Eisen und der Radionuklid- und Wassergehalt variiert. Desweiteren werden die Bedeutung der Oberflächentemperatur und, im Fall von Mars, der Effekt lateraler Temperatur- und Dickevariationen in der Lithosphäre wie sie z.B. von der Krustendichotomie verursacht werden sowie die Rolle alter chemischer Heterogenitäten erkundet. Dabei sollen auch Parameterkombinationen einbezogen werden, die nicht für Mars oder Venus relevant, aber von allgemeinem Interesse z.B. im Hinblick auf Exoplaneten sind. Die Modelle werden geophysikalische und geochemische Observablen ergeben, die mit realen Beobachtungen verglichen werden können.',
