    'title': 'Entstehung und Evolution der nicht-hadrosauriden ornithopoden Dinosaurier',
    'abstract': 'Die Gruppe der ornithopoden Dinosaurier stellt eine der erfolgreichsten Radiationen der mesozoischen Reptilien dar und beinhaltet sowohl obligatorisch als auch fakultativ bipedale und digitigrade Formen, die über einen Zeitraum von über 100 Millionen Jahren jeden Kontinent bevölkerten. Ornithopoden sind eine wichtige Gruppe, da: i) Verständnis ihrer kosmopolitischen Verbreitung zur Aufklärung des Zusammenhangs zwischen geologischen Vorgängen und Evolution als auch Verteilung terrestrischer Faunen beitragen kann; ii) die Häufigkeit und hohe Qualität der fossilen Überreste dieser Gruppe die Erforschung von Zusammenhängen und Abhängigkeiten der Reptilien Anatomie mit biomechanischer Funktionalität und ökologischen Parametern erlaubt; iii) die großen Datensätze sowie ein weitläufiges Größenspektrum der Tiere es erlauben, anatomische Variation mit Spezies Identifikation, Reproduktionsverhalten, intraspezifischer Variation, Ontogenie und Populationsbiologie in Bezug zu setzten. Diese Fragestellungen können am Besten innerhalb eines phylogenetischen Kontext adressiert werden, da ein solches ein umfassendes evolutionäres Verständnis der Gruppe ermöglicht. Allerdings existiert keine gut aufgelöste, robuste Phylogenie dieser Tiere. Der Kern dieses Projektes umfasst daher zwei Ziele: Das Erstellen einer gut aufgelösten und robusten Phylogenie der Ornithopoden, die anschließend Anwendung auf eine Reihe von evolutionsbiologischen Problemen findet. Diese Ziele werden in einem aus fünf Phasen bestehendem Arbeitsplan erreicht. Phase 1: Vergleichende anatomische Untersuchungen und morphometrische Merkmalsanalysen für die Erkennung und Dokumentation neuer phylogenetisch informativer Charaktere, sowie Neubewertung bereits bekannter Merkmale. Hierbei dient der basale iguanodontide Ornithopode Dysalotosaurus lettowvorbecki als Modelorganismus, um ontogenetische und individuelle Einflüsse auf die Veränderlichkeit der einzelnen Skelettelemente bzw. Skelettregionen zu verstehen. Phase 2: Taxonomische Revision von wenig bekannten Taxa auf Grundlage der Erkenntnisse der Phase 1 und eigener Untersuchung an den Fundstücken. Phase 3: Integration der Ergebnisse von Phase 1 und 2 in den Aufbau einer Merkmalsstatus basierten Matrix als Grundlage für eine phylogenetische Analyse. Phase 4: Ableitung der Phylogenie und somit der verwandtschaftlichen Beziehungen der einzelnen Spezies der Ornithopoden mittels einer maximalen Parsimonie Analyse. Phase 5: Anwendung der in Phase 4 generierten Phylogenie auf Fragen der paläobiologischen und evolutionären Geschichte der Ornithopoden: Welche Attribute führten zur Diversifizierung dieser Gruppe? Wie entwickelte sich die Körpergröße der Ornithopoden? Sind Änderungen der Körpergröße möglicherweise mit der Evolution anderer morphologischer Merkmale und/oder Faktoren (z.B. paläoökologischen Faktoren) korreliert?',
