    'title': 'Evolutionary rates and evolutionary trends in Carboniferous and Permian ammonoids',
    'abstract': 'Ammonoideen ermöglichen ein weites Spektrum an paläobiologischen Studien. Im beantragten Pro-jekt sollen Evolutionsraten von karbonischen und permischen Ammonoideen untersucht werden. Es soll getestet werden, ob Evolutionsprozesse zufällig verlaufen oder klare Muster zeigen, ob Evolu-tionstrends passiv oder gerichtet sind und wie Evolutionsraten mit physischen Änderungen, zum Beispiel durch Plattenbewegungen, Klimaänderungen und Veränderungen des Meeresspiegels korreliert werden können. Der Zeitabschnitt zwischen der Devon/Karbon-Grenze und der Capitan-Stufe wurde gewählt, weil dieser ungefähr 100 Millionen Jahre ohne ernsthafte Aussterbeereignisse repräsentiert. Die Studie wird die Ontogenie der Ammonoideen als morphologisches Merkmal und damit evolutionsbiologische Aspekte einbeziehen. Es soll gezeigt werden, ob Evolutionsmuster bei bestimmten monophyletischen Einheiten von Ammonoideen auf andere Organismen übertragen werden können.',
