    'title': 'Evolution benthischer Kalkdinoflagellaten-Zysten',
    'abstract': 'Kalkige Dinoflagellaten sind wesentlicher Bestandteil moderner Planktongemeinschaften in allen Ozeanen. Sie bilden innerhalb ihres ontogenetischen Zyklusses kalkige Strukturen aus, meist in Form einer Zyste. Wegen ihres hohen Fossilisationspotentials sind sie erdgeschichtlich gut seit der Ober-Trias dokumentiert und werden, insbesondere seit den Massenvorkommen in Oberjura und Kreide, vielfach als Proxis für paläoökologische und paläoklimatologische Fragestellungen genutzt. Es bestehen jedoch noch deutliche Kenntnislücken zur Taxonomie und Phylogenie der rezenten Vertreter. Dies trifft im besonderen Maße für die überwiegend benthischen Zysten küstennaher Habitate zu, die für das Verständnis der Evolution der gesamten Gruppe insofern von entscheidender Bedeutung sind, als dass unter ihnen vor allem Angehörige ursprünglicher Linien vermutet werden, während die besser bekannten pelagischen Fuettererelloideae wohl erst auf eine känozoische Radiation zurückgehen. In einem interdisziplinären und methodisch vielfältigen Ansatz soll die Erfassung benthischer Kalk-Zysten und die Rekonstruktion ihrer Stammesgeschichte unter Einsatz molekularbiologischer, morphologischer (REM, TEM) und ökologischer Methoden erfolgen. Die Ergebnisse werden zu einer tief greifenden Revision kalkiger Dinoflagellaten hinsichtlich ihrer Taxonomie und Phylogenetischen Systematik führen.',
