    'title': 'Evolution und Biogeographie der benthischen Tiefseefauna des Ostpazifiks (Expedition SO 158)',
    'abstract': 'Während der Tiefsee-Expedition SO 158 mit F.S "Sonne" in das Gebiet zwischen Galapagosspreizungszentrum und -plattform sollen bodenlebende Meeresorganismen gesammelt werden. Die Auswertung wird sich auf die Schlüsselgruppen Kinorhyncha, Loricifera, Copepoda, Brachiopoda und Porifera konzentrieren, die nach den Erfahrungen bei früheren Tiefsee-Expeditionen in genügend hoher Anzahl im Weichboden und auf Steinen zu erwarten sind. Die großräumige Variabilität von Tiefsee-Tiergemeinschaften im Ostpazifik soll untersucht werden, um Aussagen über das Verbreitungsareal von Tierarten in der Tiefsee und über den Einfluß von geomorphologischen Strukturen wie dem Spreizungszentrum treffen zu können. Außerdem sollen potentielle Anpassungen (Sinnesorgane, endosymbiontische Bakterien in Darm oder Integument?) an das Leben in der Tiefsee bei den mikroskopischen Kinorhyncha und Loricifera ultastrukturell geprüft werden. Elektronenmikroskopische Arbeiten bei Kinorhyncha, Loricifera und Brachiopoda tragen zudem dazu bei, die Evolution dieser Tiergruppen besser zu verstehen.',
