    'project_leader': 'Anonym',
    'start_date': 2000,
    'end_date': 2002,
    'title': 'Flora und Paläoökologie der Jura-Kreide-Grenzschichten im Gebiet des Tendaguru (Tansania, Ost-Afrika)',
    'abstract': 'Die bisherigen Untersuchungen zur Flora der Tendaguruschichten im Übergang Jura-Kreide haben gezeigt, daß die Probenentnahme während der Tendaguru-Expedition 1909-1913 sowie natürliche, taphonomische Prozesse eine besonders starke Auslese bedingten. Die bis jetzt festgestellte extreme Dominanz der Gymnospermen - insbesondere der Koniferen - ist somit künstlich und spiegelt keinesfalls die tatsächlichen floristischen Verhältnisse am Tendaguru wider. Die Gymnospermenflora ist dabei gut belegt, von den 6 großen Gymnospermenfamilien der Jura/Kreide-Grenze sind mit den Cycadeen, Ginkgoaceen, Cupressaceen und Taxaceen 4 bisher mit ihren Hölzern (in Form von Holzkohle-Fusit) nachgewiesen. Eine - wenn auch nicht so extrem auf Gymnospermen reduzierte - verarmte Flora bieten auch die palynologischen Untersuchungsergebnisse (Antrag SCHRANK). Eine neue, fachwissenschaftliche Beprobung gesicherter Profile im Gelände soll ein genaueres Bild der paläoökologischen Verhältnisse im Lebensraum der Sauropoden ermöglichen, um gesichertere Daten für weiterführende Untersuchungen z.B. zur Ernährung und zum Stoffwechsel großer Sauropoden (Antrag GUNGA) zu liefern.',
