    'start_date': 2006,
    'end_date': 2012,
    'title': 'Fortpflanzungsbiologie und endokrinologische Grundlagen der Reproduktion von spermienspeichernden Fledermäusen',
    'abstract': 'Die Fortpflanzungszyklen von Winterschlaf haltenden Fledermäusen der gemäßigten Breiten weichen in mehrfacher Hinsicht von denen anderer Säugetiere ab. Bei den Männchen sind Spermatogenese und Paarung nicht synchron, und bei den Weibchen ist der Verhaltensöstrus durch den Winterschlaf vom physiologischen Östrus zeitlich entkoppelt. Die Paarungszeit beginnt nach dem Ende der Jungenaufzucht, wobei das sogenannte Schwärmverhalten vermutlich eine bedeutende Rolle spielt. Wie lange sich die Paarungszeit hinzieht, ist nur für wenige Arten bekannt. Spermien werden mehrere Monate im weiblichen Reproduktionstrakt gespeichert und die Ovulation erfolgt erst nach dem Winterschlaf im Frühjahr. Wir wollen über eine vergleichende Untersuchung an vier spermienspeichernden Fledermausarten (Myotis myotis, Myotis nattereri, Plecotus auritus und Eptesicus nilssonii) den Reproduktionszyklus und die hormonellen Grundlagen der Fortpflanzung untersuchen. Zum einen wollen wir herausfinden, welche Rolle die Sexualsteroide bei den einzelnen Reproduktionsphasen spielen. Zum anderen möchten wir den Paarungszeitraum erfassen, die Bedeutung des Schwärmverhaltens für die Fortpflanzung überprüfen und den Ovulationszeitpunkt bei freilebenden Fledermäusen bestimmen. Daraus ergeben sich wichtige Hinweise auf grundlegende Selektionsmechanismen, die zu Unterschieden im Paarungsverhalten zwischen Arten führten.',
    'href': '',
