    'title': 'Fortpflanzungsstrategien und Populationsstruktur der Sackflügelfledermaus Saccopteryx bilineata',
    'abstract': 'Die in Mittel- und Südamerika verbreitete Sackflügelfledermaus Saccopteryx bilineata lebt ganzjährig in Harems, die aus normalerweise einem Männchen und 1-6 Weibchen bestehen. Die Männchen haben große Duftsäcke am Vorderrand der Flügel und zeigen in den Tagesquartieren ein auffälliges Sozialverhalten mit ausgeprägten visuellen, akustischen und olfaktorischen Signalen. Besonders bemerkenswert sind regelmäßige Schwirrflüge, in denen die Männchen sekundenlang vor ihren Haremweibchen (aber auch vor gelegentlichen männlichen Eindringlingen) rütteln und ihre Duftsäcke öffnen. Diese energetisch vermutlich aufwendige Balz der Haremmännchen findet trotz synchronisierter Reproduktion der Weibchen über das ganze Jahr verteilt statt. Vaterschaftsuntersuchungen haben gezeigt, dass bei nur 30% der Jungtiere das Haremmännchen der Vater ist, während der überwiegende Anteil der Jungtiere von Männchen anderer Harems oder peripheren Männchen abstammen. Der Reproduktionserfolg der Männchen scheint trotz der sozialen Haremstruktur entscheidend durch sexuelle Selektion der Weibchen beeinflusst zu werden. Wir möchten untersuchen, inwieweit die olfaktorische und akustische Balz für den Reproduktionserfolg der Männchen entscheidend ist, indem wir die Bedeutung des MHCs bei der Partnerwahl überprüfen und die Anzahl und Dauer sozialer Verhaltenselemente mit dem reproduktiven Erfolg vergleichen, um auf diese Weise die Vorteile, die das Leben in Harems für diese Fledermäuse zu bieten scheint, besser zu verstehen. (p)',
    'href': '',
    'synergy': '1'
