    'start_date': 2010,
    'end_date': 2011,
    'title': 'Geburtsortstreue oder Abwanderung? Geschlechtsspezifische Abwanderungsstrategien bei neotropischen Fledermäusen',
    'abstract': 'Das Abwanderungsverhalten zählt zu den zentralen Lebenslaufstrategien bei Tieren und unterliegt unterschiedlichen Selektionsdrücken, wobei insbesondere Inzucht- und Konkurrenzvermeidung eine entscheidende Rolle spielen. Bei Säugetieren wandern im Allgemeinen die Männchen aus der Geburtsgruppe ab, während Weibchen häufig ihr ganzes Leben lang geburtsortstreu sind. Bei der Sackflügelfledermaus kam es zu einer Rollenumkehr im geschlechtsspezifischen Abwanderungsverhalten. Die Geburtsortstreue der Männchen führt zu patrilinearen Verwandtschaftsbeziehungen innerhalb von Kolonien und zur Konkurrenz unter verwandten Männchen um Weibchen. Diese lokale Paarungskonkurrenz wird als wesentlicher selektiver Faktor für das Abwandern von Männchen bei den meisten Säugetieren angesehen. Im Rahmen der geplanten Studie sollen mit Hilfe eines vergleichenden Ansatzes kausale Zusammenhänge in der Evolution der außergewöhnlichen Rollenumkehr im Abwanderungsverhalten aufgedeckt werden. Dafür werden bei fünf neotropischen Fledermausarten neben dem geschlechtsspezifischem Abwanderungsverhalten die Faktoren untersucht, die das Abwanderungsverhalten entscheidend beeinflussen können.',
    'href': '',
