    'title': 'Integrative Stratigraphie des Kulm-Sedimentationsbeckens',
    'abstract': 'Die Sedimentgesteine des Ober-Visé im Rheinischen Schiefer- gebirge und Harz bieten die Möglichkeit, mit verschiedenen Methoden (Biostratigraphie, Lithostratigraphie, Geochronologie) ermittelte Daten miteinander zu korrelieren. Diese Korrelation soll mit der quantitativen Methode der Graphischen Korrelation durchgeführt werden; alle Daten sollen dabei zu einer stratigraphischen Datenbank integriert werden. Besonders die Einbeziehung von absoluten Zeitdatierungen wird eine genauere Abschätzung der Dauer einzelner stratigraphischer Abschnitte erlauben. Mit den geplanten Untersuchungen soll die biostrati- graphische Verwertbarkeit von Leitfossilien und möglichen Indexhorizonten des höheren Unterkarbons getestet und das stratigraphische Gliederungsschema verfeinert werden. Es wird angestrebt, ein für das Gebiet des Rheinischen Schiefergebirges und des Harzes erarbeitetes Korrelationsschema auf andere Regionen des nördlichen Variszikums (Südwest-Portugal, Irland, England, Belgien, Polen) auszudehnen.',
