    'title': 'Morphologie und phylogenetische Signifikanz der Antennen und der antennalen Sensillen aculeater Hymenopteren',
    'abstract': 'Antennale Sensillen aculeater Hymenopteren (Bienen, Wespen, Ameisen und Verwandte) sind morphologisch komplexer Strukturen, die als sensorische Organe eine entscheidende Funktion im Nestbau- und Beutefangverhaltens sowie der inter- und intraspezifischen Kommunikation haben. In diesem Projekt sollen die Antennenform und die antennalen Sensillen solitärer, also einzeln lebenden Wespen vergleichendmorphologisch untersucht werden. Voruntersuchungen haben gezeigt, dass antennale Sensillen eine aussagekräftige Struktur für das Verständnis phylogenetischer und evolutiver Prozesse der Aculeata ist. Es kann davon ausgegangen werden, dass die Sensillen in enger funktioneller Kopplung an ihre spezifische biologische Rolle und Funktion evolviert sind, z. B. in Anpassung an Partnerfindung, spezifische Beute und parasitoide Lebensweise. Ziel des Projekts ist in erster Linie eine umfassende Beschreibung und morphologische Analyse der antennalen Sensillen der Aculeaten (mit besonderer Berücksichtigung der besonders artenreichen und morphologisch und verhaltensbiologisch diversen Grabwespen) und der Überprüfung ihrer Bedeutung für Verwandtschaftsanalysen innerhalb der Aculeata und innerhalb der Apoidea (Bienen und Grabwespen). Auf der Basis dieser Ergebnisse sollen die gruppenspezifischen Merkmale antennaler Sensillen mit der jeweiligen Reproduktionsstrategie (im Sinne von Nestbau- und Beutefangstrategien) korreliert und schließlich zu einem evolutiven Szenario der Evolution antennaler Sensillen bei Aculeaten verknüpft werden.',
