    'title': 'Morphologisch-phylogenetische Analyse der Buchlungen rezenter und fossiler Arachnida',
    'abstract': 'In dem geplanten interdisziplinären Projekt soll die Feinstruktur der Buchlungen von Skorpionen und Tetrapulmonaten mit modernen morphologischen Methoden (Lichtmikroskopie, Histologie mittels Kunststoffeinbettung, Raster- und Transmissionselektronenmikroskopie, computergestützte 3-D Rekonstruktion) analysiert werden. Das Hauptaugenmerk der Untersuchungen liegt dabei einerseits auf der Identifizierung neuer Merkmale zur Klärung der Phylogenie innerhalb der Skorpione und der Einordnung dieser Gruppe in das System derChelicerata. Die Merkmale der Buchlungen werden auf ihre Eignung und ihren Beitrag zur Auflösung kontroverser Fragen der Skorpionssystematik getestet. Darüber hinaus sollen die Untersuchungen auf die schon besser untersuchten Spinnen und auf andere, bisher so gut wie gar nicht, untersuchte Tetrapulmonaten (Uropygi, Amblypygi) ausgedehnt werden. Einen besonderen Schwerpunkt werden fossile Arachniden wie z.B. Trigonotarbida und Skorpione bilden, sofern bei diesen die Respirationsorgane erhalten sind. Davon erwarten wir wertvolle Hinweise für die Lesrichtung der Evolution der Buchlungen. Dies hat große Konsequenzen für die Frage, ob die nach den Hexapoden evolutiv erfolgreichste terrestrische Arthropodengruppe ein- oder mehrmalig das Land erobert hat.',
