    'start_date': 2005,
    'end_date': 2008,
    'title': 'Paläoökologie und Taphonomie der Unionoida (Mollusca: Bivalvia) unter Berücksichtigung der Ziele moderner Artenschutzprogramme von Süßwassermuscheln',
    'abstract': 'Unionoide Muscheln sind ein wichtiges Faunenelement heutiger Flüsse und Seen. Durch ihre Filterationsleistung leisten sie einen bedeutenden Beitrag zur Reinhaltung der Gewässer. Die physiologisch bedingte Sensibilität dieser Muscheln für Änderungen der Umweltbedingungen macht sie zu wichtigen Indikatoren der Wasserqualität. Diese Sensibilität ist aber auch verantwortlich für die starke Gefährdung der Unionoida in heutiger Zeit. Als Folge der überwiegend anthropogenen induzierten Umweltänderungen sind viele Arten weltweit stark vom Aussterben bedroht. Es werden deshalb große Anstrengungen unternommen, die Diversität der unionoiden Muscheln zu erhalten. Eine entscheidende Grundlage dafür ist ein besseres Verständnis der Aut- und Synökologie der Tiere. So ist zum Beispiel noch immer unzureichend bekannt, welche Faktoren die Verbreitung der Taxa und die Auswahl von geeigneten Habiaten steuern. Biologen in den USA und in Europa arbeiten zur Zeit verstärkt an diesen Problemen in heutigen Süßwasser-Ökosystemen. Ein neuer, erfolgversprechender Ansatz zur Beantwortung offener Fragen ist die Untersuchung fossiler Unionoida und der sie umgebenden Sedimentgesteine. Im Rahmen des hier beantragten Projektes sollen taphonomische, sedimentologische, taxonomische und morphologische Aspekte fossiler Unionoidenvergesellschaftungen untersucht werden. Ziele sind dabei die Rekonstruktion der kontrollierenden biotischen und abiotischen Faktoren der ehemaligen Lebensräume und die Analyse ökosystemarer Prozesse im Zusammenhang mit Faunenwechseln in limnischen Habitaten. Darüber hinaus leistet dieses Projekt einen wichtigen Beitrag zum besseren Verständnis der evolutiven Prozesse in Süßwasserökosystemen.',
