    'title': 'Phylogenetische und Paläoökologische Untersuchungen von Einkeimblättrigen Blütenpflanzen ausder Kreide von Nord Gondwana (Brasilien und Ägypten)',
    'abstract': 'Unsere Kenntnis über die Evolution der Monokotyledonen beruht hauptsächlich auf drei Quellen: Morphoanatomie plus molekulare Daten von rezenten Taxa, und dem Fossilbericht. Blüten und vegetative Teile von Monokotyledonen haben viele Merkmale gemeinsam, so dass Monokotyledonen bereits früh als natürliche Einheit erkannt wurden. Molekulare Daten klärten weitgehend die Verwandtschaftsverhältnisse innerhalb der Gruppe. Jedoch sind zwei wichtige Fragen immer noch offen. 1. Wann ereigneten sich die wesentlichen Aufspaltungen und 2. Wo und warum hatten diese Ereignisse einen Effekt auf die Gesamtevolution. Die zweite Frage kann hauptsächlich durch das Studium von fossilem Material und die Erhebung von (paläo)ökophysiologischen Daten beantwortet werden. Neues Fossil-Material aus der Kreide von Nord- Gondwana und rezentes Vergleichsmaterial sollen genutzt werden, um bessere Zeitmarken für die Divergenz innerhalb der größeren Clades der Monokotyledonen zu gewinnen. Dieses Kreidematerial wird Einblicke in den zeitlichen Ablauf von Radiations-Ereignissen liefern, die durch global change und ökologische Anpassungen an unterschiedliche Habitate ausgelöst wurden.',
