    'end_date': 2007,
    'title': 'Phylogenie und historische Biogeographie der Gattung Hydropsyche Pictet, 1834 (Insecta, Trichoptera: Hydropschidae)',
    'abstract': 'Die artenreiche Gattung Hydropsyche Pict. wird taxonomisch neustrukturiert. Grundlage der Neugliederung ist die phylogenetische Verknüpfung der eingeschlossenen Artengruppen. Die Phylogenie wird zunächst durch morphologische Merkmale erschlossen und in einem zweiten Schritt durch molekularbiologische Analysen ergänzt und verbessert. Die Suche nach dem Adelphotaxon wird mit beiden Methoden betrieben. Die Verbreitung und Diversitätsmuster der Arten bzw. Artengruppen auf den Kontinenten wird kartographisch erfasst. Aus der Zusammenschau der phylogenetisehen, chorologischen und ökologischen Befunde mit den plattentektonischen und klimatischen Veränderungen seit dem Tertiär werden biogeographische Hypothesen zur Erklärung des gegenwärtigen Verbreitungsbildes der Gattung und ihrer Gruppen erarbeitet.',
