    'title': 'Phylogenie und Phylogeographie von Brutbeutel tragenden Süßwasser-Gastropoden (Thiaridae in Australien: Implikationen für die Biogeographie und die evolutionäre Rolle viviparer Reproduktionsstrategien',
    'abstract': 'Die an oftmals isolierte limnische Habitate gebundenen Süßwasserschnecken stellen geeignete Mo-delle zur Rekonstruktion geographisch und klimatisch bedingter Veränderung des Lebenraumes dar. Sie erlauben, allgemeine evolutionsbiologische Zusammenhänge zwischen Besiedlungsereignissen, Artenbildungsprozessen und der Rolle intrinsischer Faktoren (wie etwa von Reproduktionsstrategien) aufzuklären. Ziel des Projektes ist die Rekonstruktion der Besiedlungsgeschichte am Beispiel einer Gruppe viviparer Süßwassergastropoden in Australien unter Verwendung molekularer Marker (mito-chondrialer und im Kerngenom basierter Genfragmente, inklusive der AFLP-Technik) sowie neuer Methoden biogeographischer Analysen. Die geographische Herkunft vieler Faunenelemente und die zeitliche Abfolge der Kolonisierung dieses seit dem Beginn des Tertiärs nordwärts wandernden Teil-kontinents von Gondwana, das durch Tektonik und globaler Klima-Veränderungen u.a. Aridifizierung unterliegt, sind vielfach nicht hinlänglich geklärt. Unsere Vorarbeiten haben gezeigt, dass die etwa ein Dutzend Thiariden-Arten Australiens diverse, oft an einzelne Drainagesysteme gebundene Besied-lungsmuster sowie damit korreliert verschiedene Fortpflanzungs-Modi aufweisen. Mit der Aufdeckung der stammesgeschichtlichen Beziehung zu nicht-australischen Verwandten und einer durch neue Methoden ermöglichten Altersbestimmung der phylogenetischen Verzweigungen sowie der Analyse historischer Areale sollen Hypothesen zur historischen Biogeographie getestet werden, insbesondere zur Kolonisierung einzelner Regionen und Drainagesysteme des australischen Kontinents, sowie zum Einfluss der Fortpflanzungsbiologie bei der Verbreitung.',
