    'title': 'Phylogeographie der Thecideoidea (Brachiopoda)',
    'abstract': 'Ziel des Projekts ist die Aufklärung der Verwandtschaftsverhältnisse und der Biogeographie der rezenten Thecideoidea, einer Teilgruppe der articulaten Brachiopoda, mithilfe morphologischer und molekularer Methoden. Das Projekt teilt sich in zwei Teile: Im ersten Teil steht die Ermittlung der Phylogenie der Thecideoidea im Vordergrund. Als Grundlage dafür werden morphologische Daten zur Entwicklung und zur Schalenmorphologie sowie molekulare Daten des Kern- (18S) und des mitochondrialen (16S, 12S) Genoms erhoben und für phylogenetische Analysen verwendet. Nach der Ermittlung der Verwandtschaftsverhältnisse können im zweiten Teil Hypothesen zur Biogeographie der Gruppe formuliert werden. Unterstützend sind hier Untersuchungen zur Ausbreitungsfähigkeit der Thecideoidea vorgesehen. Die Analyse schnell evolvierender ITS-Sequenzen kann zur Überprüfung des Status von drei Populationen der Art Thecidellina barretti im Atlantik genutzt werden. Die vermutlich geringe Ausbreitungsfähigkeit der Thecideoidea durch Brutpflege und lecithotrophe Larven steht möglicherweise im Widerspruch zur Conspezifität der atlantischen Formen. Die zu erwartenden Ergebnisse haben weitreichende Folgen für die Hypothese des ursprünglichen Lebenszyklus der Brachiopoda und können zudem als repräsentativ für andere sessile, brutpflege-treibende marine Wirbellose mit lecithotrophen Larvalstadien gelten.',
