    'title': 'Primär-Kondensate und moderat volatile Elemente in Chondriten: Implikationen für Fraktionierungsprozesse im Sonnennebel',
    'abstract': 'Chondrite, die mit 85% die größte Klasse der Meteoriten bilden, sind die ältesten uns bekannten Gesteine. Über 100 Jahre Forschung an Chondriten haben zahlreiche Einblicke in die Geschichte dieser Sonnennebel-Sedimente geliefert. Dennoch bleiben viele fundamentale Eigenschaften von Chondriten ungeklärt. Die Entstehung von Chondren, den namensgebenden Einschlüssen, oder die Fraktionierungsprozesse, die zu den charakteristischen Zusammensetzungen geführt haben sind nach wie vor Thema heftiger wissenschaftlicher Debatten. Das Ziel dieses Projektes ist, die Fraktionierungsprozesse mit Hilfe präziser Analyse bestimmter Elemente zu erforschen. Der analytische Schwerpunkt dieser Arbeit wird auf die Bestimmung von lithophilen Spurenelementen in verschiedenen Chondriten gelegt. Diese Untersuchungen werden ergänzt durch die Bestimmung von Hauptelementen, sowie, in ausgewählten Meteoriten, von siderophilen Elementen. Die so gewonnenen Daten stellen einen einheitlichen Datensatz von Elementkonzentrationen in Meteoriten dar, die Einblicke in die subtilen Unterschiede der Elementverhältnisse in Chondriten geben sollen. Die Ergebnisse sollen mit den verschiedenen Fraktionierungs- Modellen für Solarnebel verglichen werden, um diesen Prozess näher zu ergründen.',
