    'title': 'Rekonstruktion der Phylogenese der Amphipoda (Crustacea) auf der Grundlage molekularer Merkmale und Vergleich mit bekannten Daten über Morphologie und Lebensweise',
    'abstract': 'Die Systematisierung der Großgruppen der Amphipoda ist zur Zeit äußerst umstritten, da es an informativen Merkmalen mangelt. Es gibt derzeit sehr verschiedene, nicht kompatible Taxa und keine Grundlage für die Ausarbeitung von Bestimmungsschlüsseln. Im geplanten Vorhaben soll die Phylogenese der Großgruppen der Amphipoda mit Hilfe von DNA-Sequenzen analysiert und das Ergebnis mit Hypothesen anderer Autoren, die nur morphologische Merkmale berücksichtigt haben, verglichen werden. Parallel sollen morphologische Daten ausgewertet werden, die sich aus der taxonomischen Arbeit des ersten Antragstellers ergeben. Die Plausibilität der berechneten Dendrogramme soll durch Vergleich von molekularen und morphologischen Daten sowie anhand von Informationen über die Ökologie und Lebensweise der Taxa geprüft werden, Hypothesen über den Verlauf der Evolution von Lebensweisen sind zu entwickeln.',
