    'title': 'Bewegung in neue Nischen: Beine, Ökologie und Evolution mustellider Säuger',
    'abstract': "Umwelt und Ökologie haben einen starken Einfluss auf das Fortbewegungssystem in allen Wirbeltieren, was das Studium dieses Systems dazu prädestiniert, zu verstehen, wie Arten sich in der Vergangenheit an Veränderungen von Umwelt und ökologischer Nische angepasst haben. Gegenstand dieses Projekts ist die Untersuchung der Extremitätenmorphologie der Mustelidae, um zu verstehen, wie das Lokomotionssystem mit ökologischen Spezialisierungen koevloviert, und somit ein Vordringen in neue Nischen ermöglicht. Mustelidae, die Marderartigen, stellen aufgrund ihrer verschiedenen Abwandlungen im Lokomotionssystem ein ideales Vergleichssystem dar, um Anpassungen an unterschiedliche Lebensweisen und Fortbewegungsformen zuuntersuchen. Mustelidae sind mit ca. 60 Arten eine überschaubare Gruppe von Mardern und verwandten Taxa die, neben Generalisten, vielfältige Spezialisierungen an eine grabende, schwimmende oder kletternde Fortbewegung zeigen. Mustelidae sind mit einem Ursprung vor ca. 25 Millionen Jahren des Weiteren eine phylogenetisch vergleichsweise junge Gruppe, an der sich ökologische Anpassungen an eine sich verändernde Umwelt nachvollziehen lassen. Um diesen Fragen nachzugehen, werde ich ganze Tiere und Skelettpräparate von europäischen, afrikanischen und amerikanischen Arten untersuchen. Mit einem breiten und integrativen Ansatz werde ich dabei untersuchen, wie sich die Morphologie des Lokomotionssystems - von Gesamtbeinmorphologie und -form bis hin zu Fasertypenverteilung in einzelnen Muskeln - bei Mustelidae mit verschiedenen ökologischen Spezialisierungen unterscheidet. Dazu werde ich eine Vielzahl an für die Lokomotion relevanten Parametern auswerten, inklusive Charakteristika des ganzen Beins (Massenträgheit), des Skelettsystems (Knochenmasse und -dimensionen, Struktur, Aufbau und biomechanische Eigenschaften der Knochen anhand von Querschnitten) sowie des Muskelsystems (Muskel- und Muskelfaserarchitektur). Mit Hilfe von phylogenetisch basierten Vergleichsmethoden werde ich dann untersuchen, ob Veränderungen der Extremitätenmorphologie wesentlich mit Veränderungen und Expansion der ökologischen Nische zusammenhängen. Insbesondere mittels Tests von ,niche filling' und ,niche shifting' Modellen, soll ein Zusammenhang zwischen Veränderungen im Lokomotionssystem einerseits, und rapider Diversifikation und Adaptation an sich verändernde Umweltbedingungen andererseits, untersucht werden. Eine Untersuchung derEvolutionsraten des Lokomotionssystems soll darüber Aufschluss geben, ob Veränderungen im Lokomotionssystem Diversifikationsprozessen vorausgehen, und in welchem Umfang diese Veränderungen ein evolutionär erfolgreiches Überleben in neuen Lebensräumen ermöglichten. Die ganzheitliche Untersuchung von Extremitäten sowie deren Muskulatur und Skelett in einem phylogenetischen Rahmen, wird dazu beitragen, zu verstehen, wie die Koevolution funktionell integrierter Merkmalssysteme zur Adaptation an neu entstandene Nischen führt.",
