    'title': 'Rekonstruktion westafrikanischer Regenwaldrefugien mit Hilfe Laubstreu bewohnender Anuren - ein phylogeographischer Ansatz',
    'abstract': 'Die potentiellen Glazialrefugien afrikanischer Regenwälder wurden bisher mit bekannten Endemiezentren gleichgesetzt, wobei ihre genaue Lage und Form nicht definiert werden konnte. Aufgrund der Ergebnisse neuerer Studien ist dieser Ansatz umstritten. Dem gegenüber ist vor dem Hintergrund oszillierender Klimaschwankungen, die sich auch in Zukunft fortsetzen werden, ein erneuter Rückzug der Regenwälder und der sie zu beherbergenden Arten zu erwarten. Angesichts drastischer Abholzungen in den afrikanischen Ländern ist daher eine optimierte Prioritätensetzung beim Regenwaldschutz dringend notwendig. Im Rahmen des vorliegenden Antrags möchten wir die westafrikanischen Regenwaldrefugien detektieren und ihre Persistenz über einen längeren Zeitraum der Erdgeschichte prüfen. Hierzu werden wir die phylogeographischen Muster von waldabhängigen Froscharten der Gattungen Arthroleptis und Phrynobatrachus (Detektion junger Refugien) mit den phylogenetischen Mustern der Arten innerhalb beider Gattungen (Detektion alter Refugien) vergleichen. In beiden Gattungen finden sich Arten geeigneter Verbreitungsmuster. Wir werden typische Arten der relevanten Waldgebiete Westafrikas untersuchen. Es werden zwei mitochondriale (16S, D-Loop) und ein nukleärer (rag1) Genbereich verglichen.',
