    'end_date': 2008,
    'title': 'Rezente Pilzmücken Neuseelands: Schlüsselfauna für das Verständnis der Phylogenese der Mycetophilidae s. str.',
    'abstract': 'Pilzmücken im engen Sinne (Mycetophilidae s.str.) bilden innerhalb der pilzmückenartigen Zweiflügler (Sciaroidea) die am stärksten diversifizierte Gruppe. Die Pilzmücken-Faunen von Nord- und Südhemisphäre erscheinen nach derzeitigem Kenntnisstand gleichermaßen reich, aber fundamental verschieden. Bisherige phylogenetische Untersuchungen berücksichtigten nahezu ausschließlich Taxa der holarktischen und orientalischen Faunenregion, kaum aber solche der Südhemisphäre. Folglich ist die Phylogenese dieser Fliegengruppe bisher nur einseitig beleuchtet und deshalb weitgehend unverstanden. Die neuseeländische Pilzmücken-Fauna ist aufgrund ihrer extremen Diversität in besonderer Weise repräsentativ für die südhemisphärische Gesamtfauna, deren Wurzeln im Gondwana der Trias- und Jurazeit gesehen werden. Die erdgeschichtlich einmalig lange und effektive Isolation Neuseelands hat plesiomorphe Pilzmückenformen bewahrt, anhand derer die basalen Aufzweigungen im Stammbaum besonders gut untersucht werden können. Das vorliegende Projekt untersucht Fallbeispiele (Gattungen bzw. Gattungsgruppen) und wendet sich folgenden Fragen zu: 1) Wie eigenständig ist die Pilzmückenfauna der Südhemisphäre tatsächlich, d.h. lassen sich monophyletische Gruppen erkennen, die ausschließlich auf die Südhemisphäre bzw. Neuseeland beschränkt sind? 2) Welche dieser Taxa lassen Synapomorphien mit Taxa der Nordhalbkugel erkennen? 3) Wo liegen die basalen Aufspaltungen in der Pilzmücken-Linie, und wie lassen sich diese zeitlich einordnen? 4) Welche Konsequenzen ergeben sich daraus für das natürliche System der Mycetophilidae s.str. zum einen und der Sciaroidea zum anderen? Eine umfassende phylogenetische Analyse der Mycetophilidae weltweit geht über den Rahmen des vorgeschlagenen Projektes jedoch weit hinaus. Im vorliegenden Forschungsprojekt sollen die noch weitgehend unbekannten Taxa der Südhemisphäre, insbesondere Neuseelands, taxonomisch verfügbar gemacht werden. Darüberhinaus soll versucht werden, neue Merkmalskomplexe für die phylogenetische Analyse zu erschließen und zu dokumentieren. Es wird erwartet, dass dadurch ein wichtiger Beitrag zur Rekonstruktion des Grundmusters der Stammart der Mycetophilidae geleistet wird.',
