    'title': 'Schneller Zugang zum Softwarepaket Delta, der Merkmalsdatenbank für die biologische Systematik',
    'abstract': 'Mit dem Datenbankprogramm Delta lassen sich Merkmale von Organismen erfassen und in vielfältiger Weise verarbeiten. So lassen sich mit den Daten zum Beispiel Beschreibungen und Bestimmungsschlüssel generieren, Differentialdiagnosen erstellen und Daten für die phylogenetische Rekonstruktion zusammenstellen. Mit der Datenbank läßt sich das systematische Wissen konservieren, zentralisieren und leicht abrufen. Delta ist allerdings wie viele mächtige Softwarepakete schwer zugänglich und wird daher nur von wenigen Wissenschaftlern genutzt. Ziel des Projektes ist eine leicht verständliche, gut illustrierte ¿Schritt für Schritt¿ Einführung und vereinfachte ¿templates¿ zu erarbeiten, um potentiellen Nutzern den Einstieg zu ermöglichen.',
