    'title': 'Stratigraphie, Faziesentwicklung sowie Invertebraten- und Mikropaläontologie der Tendaguru-Formation (Oberjura und Unterkreide von Tansania, Ostafrika)',
    'abstract': 'Die durch ihre Dinosaurierfunde berühmte Tendaguru-Formation in Oberjura und Unterkreide von Tansania (Ostafrika) wurde seit den Ausgrabungen zu Anfang des Jahrhunderts nicht hinreichend auf Bio- und Sequenzstratigraphie sowie Faziesentwicklung und Paläoökologie untersucht. Zur Interpretation der reichen Dinosaurier- und mittlerweile hinzukommenden Mammalier-Fauna bezüglich Evolution, Lebensraum, Taphonomie und Stellung im Tendaguru-Ökosystem sind Neuuntersuchungen und Reinterpretationen auf aktuellem Forschungsstand unerläßlich. Zu diesem Zweck soll das hier beantragte Teilprojekt im engen Kontext mit den weiteren Teilanträgen des "Tendaguru-Bündels" folgende Teilziele erreichen:1. Neuaufnahme, Vermessung und Beprobung der Formation (ca. 140m) in mehreren Parallelprofilen, dabei eng horizontierte Neuaufsammlung von Makro-Invertebraten.2. Untersuchung der Makro-Invertebraten (v.a. Cepahlopoden und Pelecypoden) und der marinen wie nichtmarinen kalkigen Mikrofossilien (Ostracoden, Charophyten, Foraminiferen) auf biostratigraphische und paläoökologische Aussagen.3. Untersuchungen der Karbonat-Mikrofazies und Isotopengeochemie von Kalkschalern zur Erarbeitung weiterer paläoökologischer Aussagen (evtl. auch Klimatrends).4. Abschließende Gesamtinterpretation der Tendagru-Formation im sequenz- und biostratigraphischen, biogeographischen und paläoklimatologischen Kontext.',
