    'title': 'Stratigraphische und paläobiogeographische Position von unterkarbonischen Sedimenten in der algerischen Zentral-Sahara',
    'abstract': 'Die unterkarbonischen Sedimentgesteine des nordafrikanischen Schelfs (Abb.1) nehmen eine Sonderstellung hinsichtlich ihrer Faunen ein. Besonders die Ammonoideen-Faunen der Tournai-Stufe zeichnen sich durch eine Diversität aus, wie sie nur von wenigen anderen Regionen bekannt ist. Während Profile anderer Gebiete beispielsweise keine Abfolge von Faunen des Mittel-Tournai bis in das Unter-Visé zeigen, kann eine solche Sukzession an nordafrikanischen Lokalitäten untersucht werden. Diese Profile besitzen damit eine Schlüsselposition, um die bislang nur sehr lückenhaft bekannte Unterkarbon-Stratigraphie zu revidieren (vgl.Abb.2). Anders als in den meisten anderen Regionen, in denen Ammonoideen- und Conodonten-Faunen nur sehr lückenhaft auftreten, besitzen die hervorragenden nordafrikanischen Aufschlußverhältnisse die Möglichkeit, durchgehende Profile mit reichen Faunen-Sukzessionen zu untersuchen.',
