    'title': 'Structural geology, Petrology, and Geochronology of metamorphic rocks of the La Sepultura unit as part of the Chiapas Massif/Southeast Mexico',
    'abstract': 'In a joint project with German and Mexican scientists we intend to investigate the metamorphic history and geotectonic position of the "La Sepultura" unit in the centre of the Chiapas Massif, southern Mexico. This will involve detailed geological mapping, structural and petrological investigations, and isotopic age determinations. The La Spultura unit comprises middle- to highgrade metapelites and calcsilicate rocks and most probably is part of the pre-mesozoic basement of the Chiapas Massif. A profound understanding of the geology of the La Selpultura unit and the Chiapas Massif in total is crucial for the paleogeographic reconstruction of southern Mexico. From our studies we expect a major contribution for better understanding of the geotectonic connection betwenn Gondwana and Laurentia. Apart from the scientific aim of the project we intend to support the German-Mexican collaboration and to help setting up the Mexican research laboratories of the CICESE.',
