    'title': 'Systematik, Evolution und Biogeographie der Amphibienfauna von Irian Jaya',
    'abstract': 'Es ist vorgesehen, während drei Forschungsreisen nach Irian Jaya (Dauer jeweils 4-5 Wochen) Untersuchungen zur Ökologie, Ethologie und Ontogenese der dort heimischen Amphibien anzustellen. Weiterhin sollen jeweils kleinere Serien möglichst vieler Arten als Belegmaterial gesammelt werden, denen noch vor Ort Gewebeproben für spätere DNA-Untersuchungen zu entnehmen sind. Die Auswertung der im Freiland gesammelten ontogenetischen, bioakustischen und ökologischen Daten in Verbindung mit Merkmalsanalysen und -vergleichen der konsvervierten Tiere sowie DNA-Analysen im Berliner Labor haben zum Ziel, bisher unbekannte Arten hinreichend zu charakterisieren und damit der Wissenschaft und dem Naturschutz zugänglich zu machen. Weiterhin sollen ihre Verwandtschaftsbeziehungen und die der schon beschriebenen Arten ergründet werden, um damit systematisch-taxonomische und biogeographische Probleme zu lösen. (p)',
