    'title': 'Systematik und Biogeographie australischer Iphimediidae (Crustacea, Amphipoda) aus den Sammlungen des Australian Museum Sydney',
    'abstract': 'Eine Sammlung von Flohkrebsen aus dem Indik soll zusammen mit Dr. Jim Lowry am Australian Museum systematisch bearbeitet werden. Mindestens 19 neue Arten liegen in der Sammlung vor. Die taxonomischen Ergebnisse sollen publiziert werden, darüberhinaus die Merkmale in die Datenbank DELTA eingegeben werden und damit ein interaktiver Determinations-Schlüssel aller Iphimediidae weltweit generiert und ins Internet gestellt werden. Die Verbreitung des Taxons wird sich nach der Bearbeitung des neuen Materials erweitern und die biographische Hypothese von Watling & Thurtson (1989) soll überprüft werden.',
