    'start_date': 2000,
    'end_date': 2003,
    'title': 'Taxonomie jurassischer Bivalven aus Chile und Mexiko',
    'abstract': 'Der Erfolg paläobiogeographischer Untersuchungen hängt entscheidend von der Qualität der taxonomischen Bearbeitung der Organismen ab. Deshalb basierten meine bisherigen Forschungen zur paläogeographischen Entwicklung der ortsfremden Krustenfragmente der kanadischen Kordillere und des Hispannischen Korridors (einer schmalen Meeresverbindung zwischen Ostpazifik und westlicher Tethys) auf der Gruppe der modern bearbeiteten pectinoiden Muscheln. Da nur auf eine Muschelgruppe gestützt, stehen die Interpretationen noch auf schwachen Datenbeinen und das Potential der ökologisch so vielfältigen Muscheln für die Entschlüsselung geologischer Fragestellungen ist bei weitem nicht ausgenutzt. Um hierfür eine solide Datenbasis zu erarbeiten, sollen die unterjurassischen Muscheln aus Chile und Mexiko monographisch bearbeitet werden. Das Material liegt aus früheren, von der DFG geförderten Vorhaben bereits vor und ist weitestgehend präpariert. Weitere Geländeaufsammlungen sind nicht notwendig. Dagegen wurde durch meine bisherigen taxonomischen Arbeiten offenkundig, daß eingehende Analysen an südamerikanischen Originalen und europäischem Vergleichsmaterial für eine fundierte Bearbeitung unerläßlich sind. Zentraler Punkt des Antrags sind deshalb detaillierte Untersuchungen an relevantem Material, daß in ausgesuchten Museen Europas hinterlegt ist.',
    'href': '',
