    'end_date': 2011,
    'title': 'The Early Carboniferous biogeotraphic position of the Balkan Penninsula',
    'abstract': 'For the first time, a quantitative analysis of the Late Viséan and Serpukhovian (late Early Carboniferous) ammonoid assemblages of the Balkan Peninsula, best represented by the faunas from Druzetic-Milivojevici in Serbia, will be achieved. It will be tested if these assemblages belong to the North Variscan or South Variscan-North Gondwanan Realm, or if they are indifferent. Re-investigation and analyses of the ammonoid faunas, parallel to studies of conodonts and other microfossils, will reveal important data for the reconstruction of the Variscan Fold Belt and timing of the orogeny.',
