    'id': 48288231,
    'institution_id': 13232,
    'region': ['BW', 'GB', 'ZA'],
    'cooperating_institutions': [39769084, 58180770, 10208],
    'subject_area': 'Geologie, Ingenieurgeologie, Paläontologie',
    'review_board': 'Geologie und Paläontologie',
    'research_area': 'Naturwissenschaften (119 Mitglieder)',
