    'project_leader': 'Anonym',
    'start_date': 2014,
    'end_date': 2017,
    'title': 'Untersuchung eines vulkanisch in situ erhaltenen Wald-Ökosystems des unteren Perms',
    'abstract': 'Der Ausbruch des Zeisigwald-Vulkans hat im unteren Perm (290.6 ± 1.8 Ma) im Chemnitz-Becken (Leukersdorf-Formation) für die Konservierung eines Lebensraumes gesorgt, dessen umfangreiche Überlieferungen durch die Grabung des Museums für Naturkunde (2008-11) im Stadtgebiet von Chemnitz wissenschaftlich dokumentiert wurden. Die autochthone Fossillagerstätte repräsentiert das vollständigste bislang bekannte Wald-Ökosystem aus dem Perm weltweit. 53 noch aufrecht an ihren Wuchsorten stehende und im unterlagernden Paläoboden wurzelnde Stammbasen gewähren Einblick in einen einzigartigen jungpaläozoischen Tiefland-Lebensraum, der nicht nur eine dichte hygrophile Vegetation beherbergte, sondern auch eine reiche Fauna von Vertebraten, Arthropoden und Gastropoden lieferte, einige Formen repräsentieren Erstnachweise für das Perm. Im Ergebnis der Grabung konnte erstmals ein Fund- und Datenkomplex über die Pflanzen- und Tierwelt des Perms gewonnen werden, der auf exakten Lagedaten für jeden Fossilrest beruht. Damit wurde die Möglichkeit einer 3D-Modellsimulation als sukzessive zu vervollkommnendes Erkenntniswerkzeug der Paläontologie geschaffen. Die in den Zuwachszonen der Bäume abgebildete Habitatzyklizität offeriert erstmals die Chance, die vierte Dimension für das in-situ Ökosystem zu erfassen. Die taphonomische Analyse des Fossilberichts wird nicht nur die Beantwortung ungelöster Fragen der Entwicklung von Biotopstrukturen in den noch unzureichend verstandenen dynamischen Lebensräumen des Perms ermöglichen, sondern auch die Rekonstruktion des vulkanischen Geschehens und der Fossilisationsprozesse. Erstmalig entsteht die Chance, aus einer in situ-Taphozönose das Paläoenvironment mit seinen Bestandteilen Paläoboden, Vegetation (Bestandteile, Struktur, Dichte) und Begleitfauna zu studieren, paläoökologisch zu interpretieren und damit ein umfassenderes Bild von den nicht moorbildenden Tiefländern des unteren Perms, ihrer Lebewelt, Nahrungsbeziehungen und Evolutionsstufe zu gewinnen.',
