    'title': 'Untersuchungen zur Biodiversität und biogeographischen Bedeutung des Sneeubergs in Südafrika am Beispiel der Lepidoptera- und Trichoptera Fauna (Insecta)',
    'abstract': 'Die Lepidoptera- und Trichoptera-Arten des Sneeuberges werden qualitativ und quantitativ erfasst und dokumentiert. Die Zusammensetzung der Fauna wird unter ökologischen und biogeographischen Aspekten analysiert. Besonders berücksichtigt werden die zu erwartenden, endemischen Arten, die benannt und beschrieben werden. Das Projekt dient zur Beantwortung folgender Fragen: 1. - Erfüllt das Great Escarpment die Funktion eines Ausbreitungskorridors für montane bzw. temperate Arten aus der Drakensbergfauna oder aus den Western Escarpment Mountains (WEM)? 2. - Kann die Lepidoptera-Fauna des Sneeubergs biogeographisch den WEM zugerechnet werden? 3. - Kann der Sneeberg als Refugialraum für Arten aus der Fynbos Region (= Cape Floristic Region) gelten und wenn ja, wie groß ist seine Bedeutung?',
