    'title': 'Variabilität von MHC-Genen bei der Sackflügelfledermaus Saccopteryx bilineata',
    'abstract': 'Neuere Untersuchungen haben gezeigt, dass der Haupthistokompatibilitätskomplex (MHC) neben seiner immunologischen Bedeutung auch bei der Partnerwahl eine Rolle spielen kann. Welche generelle Bedeutung der MHC bei der Partnerwahl von Wirbeltieren hat, ist jedoch noch unbekannt. Ob und ggf. auf welche Weise MHC-Genotypen den Fortpflanzungserfolg von Individuen beeinflussen, möchten wir am Beispiel der Sackflügelfledermaus (Saccopteryx bilineata) untersuchen. Die Sozialstruktur der Sackflügelfledermäuse besteht aus langfristig stabilen Harems, wobei Haremmännchen nicht die Vaterschaften im eigenen Harem monopolisieren können. Vaterschaftsanalysen haben gezeigt, dass etwa 70 Prozent der Jungtiere eines Harems von haremfremden Männchen abstammen. Dies wirft die Frage auf, wonach die Weibchen ihre Paarungspartner wählen. Die Körperdüfte der Männchen könnten dabei eine zentrale Rolle spielen. Sie werden während eines aufwändigen Balzflugs den Weibchen zugefächert und können Informationen über die individuelle genetische Zusammensetzung des MHCs beinhalten.',
