    'title': 'Pollen metabarcoding an naturkundlichen Hummelsammlungen, um Pflanzen-Bestäuberinteraktionen in Deutschland retrospektive zu analysieren',
    'abstract': 'In Deutschland gibt es mehr als 35 nichtparasitäre pollensammelnde Hummelarten. Von diesen haben 20 Prozent eine wichtige Bestäuberfunktion. 16 Arten sind in Deutschland gefährdet oder vom Aussterben bedroht. Der z.T. starke Rückgang vieler Hummelpopulationen in den letzten Jahrzehnten ist primär auf Veränderungen in der Landnutzung und landwirtschaftlicher Verfahren zurückzuführen. In den Niederlanden, Belgien und Groß Britanniens konnten mikroskopische Analysen der Pollen an Wildbienen in naturkundlichen Sammlungen retrospektive zeigen, dass eine Veränderung der Blütenbesuche und des damit verbundenen Nahrungsangebots eine Hauptursache für den Rückgang der Wildbienen ist (Kleijn and Raemakers 2008, Scheper et al. 2014). Neue DNA-Metabarcoding-Methoden ermöglichen optimierte Pollenidentifikationen mit höherer Auflösung und Genauigkeit (Pornon et al. 2016). Die Methode kann noch weiter optimiert werden und soll im Rahmen dieses Projektes dazu dienen, Pollen an Hummeln in naturkundlichen Sammlungen in Deutschland in drei verschiedenen Zeiträumen (vor 1950, zwischen 1950-1980, nach 1980, in Zeiten drastischer landwirtschaftlicher Veränderungen) retrospektiv zu analysieren. Durch interdisziplinäre Zusammenarbeit zwischen Zoologen, Botanikern und Ökologen beabsichtigen wir (i) die Software zum Pollenmetabarcoding zu optimieren, um methodenbedingte Einflußfaktoren zu reduzieren, (ii) die Identifikationsgenauigkeit des Pollenmetabarcodings durch die Anwendung multipler Metabarcodingmarker zu erhöhen,(iii) die Nahrungspräferenzen von seltenen und häufigen Hummelarten in Deutschland anhand naturkundlicher Sammlungen retrospektiv zu untersuchen und (iv) zu analysieren, ob eine Veränderung des Nahrungsangebots im 20. Jahrhundert die Veränderungen der Hummelpopulationen sowie ihre Gefährdung erklären können.',
