    'title': 'Rekonstruktion von Fischbeständen im Bereich des Küstenauftriebs vor Namibia aus Sedimentkernen (M57, M48)',
    'abstract': 'Im laufenden Antrag rekonstruieren wir Abbilder heutiger ozeanographischer, geochemischer und biologischer Gradienten in Schelfsedimenten und nutzen diese, um Veränderungen der Fischpopulationen im küstennahen Auftrieb vor Namibia zu untersuchen. Temperatur- und Nährstoffinilieus sowie die heutige Zusammensetzung und Akkumulationsrate von Fischschuppen in küstenparallelen und - normalen Schnitten zeichnen die räumlichen Muster des Auftriebs und seiner Intensität nach. In langen Sedimentkernen werden Änderungen durch die Zeit rekonstruiert. Die Sedimentfolge umfasst die Zeit seit dem Ende der Transgression des Weltmeers auf den Schelf nach dem letzten Glazialen Maximum (bis etwa 5.000 14C-Jahren) bis in die Zeit von wissenschaftlichen Beobachtungen und Fischfangstatistiken. Bestimmungen der Oberflächentemperaturen (UK 37) ermöglichen uns, Gradienten und Änderungen in den Temperaturen des Auftriebs zu rekonstruieren. Die Art und Menge typischer Fischschuppen spiegelt entweder warme, pluviale Phasen (Benguela-Ninos) oder kalte, nährstoffreiche, aride Phasen wieder. Aus diesen Informationen werden wir einerseits Zeiten verstärkten Auftriebs erkennen und andererseits die Perioden von warmen Phasen niedriger Produktivität im Auftrieb rekonstruieren; beide Zustände resultieren in charakteristischen Fischpopulationen. Untersuchungen der isotopischen Zusammensetzung organischen Materials (δ13C, δ 15N) in den teilweise laminierten Sedimenten sollen Aufschluss über die Nährstofmutzung (und indirekt der trophischen Ebene) im Oberflächenwasser geben. In der ersten Antragsphase wurden bereits die ersten 3 Sedimentkerne von Meteor-Expedition M57 beprobt und weitgehend für die verschiedenen Untersuchungmethoden vorbereitet. An allen Kernen (SL 178, SL 180 und SL 201) liegen bereits δ15N- und δ13C- Verteilungen am Gesamtsediment, sowie N und C Gesamtgehalte vor. Zusätzlich wurden bereits erste Teilmessungen der δ18O-Verteilung im Foraminiferen-Kalzit zur SST Betsimmung in Kern SL 178 vorgenommen. Desweiteren wurden Messungen der Alkenongehalte und die Berechnung der Alkenon-SST an allen Schwerelotkernen durch die Hamburger Arbeitsgruppe von Prof. Emeis durchgeführt. Die ersten Daten erlauben bereits die Erkenntnis, dass die Selektion der Sedimentkerne zu sehr gut nutzbaren Resultaten für das Projektziel führen werden. Zusätzlich verifizieren sie die jüngsten Berechnungen aus den Isotopenwerten des Foraminiferen-Kalzit an Kern SL 178. Am Ende der zweiten Antragsphase wurden die ersten Ergebnisse bei einem internationalen GLOBEC Workshop am Naturkundemuseum in Berlin zur Diskussion gestellt.Nach dem Abschluss der Analytischen Phase des Projekts wird sich nun in der dritten auf die Auswertung und Publikation der Ergebnisse konzentriertNeben der schriftlichen Auswertung der Ergebnisse sollen diese auf einem internationalen Kongress in Shanghai präsentiert werden, um sie mit dem Fachpublikum diskutieren zu können.',
