    'title': 'Systematische Untersuchungen der Stoßwellenmetamorphose aller Marsmeteorite (Systematic investigation of shock metamorphism of all Martian meteorites)',
    'abstract': 'Die Gruppe der 16 Marsmeteorite (ehemals SNC-Meteorite) stellen das einzige Marsgestein dar, das für Laboranalysen zur Verfügung steht. Das Projekt "Systematische und umfassende interdisziplinäre Analyse aller Marsmeteorite" dient der umfassenden Analyse dieser Gesteine. Die geplanten Untersuchungen sollen übergeordnet Erkenntnisse (a) zum stofflichen Aufbau des Planeten Mars, (b) über die Art und die Chronologie der magmatischen Prozesse auf dem Mars und (c) zur Aufklärung der auf Verwitterung und hydrothermalen Prozessen beruhenden Veränderungen der Marsmeteorite liefern. Mit kosmogenen Radionukliden soll die Bestrahlungsgeschichte der Meteorite auf dem Mars und im interplanetaren Raum sowie das terrestrische Alter bestimmt werden. Untersuchungen zur Art und Verteilung organischer Materie dienen der Klärung der möglichen Existenz fossiler primitiver Lebensformen auf dem Mars. Die hier als Teil dieses umfassenden Projekts vorgeschlagenen Untersuchungen zur Stoßwellenmetamorphose dienen (a) der Ermittlung der Anzahl und Größe der Impaktereignisse, die zu Marsmeteoriten führten, vor allem im Zusammenhang mit den beobachteten Ejektionsaltern, (b) der exakten Bestimmung der stoßwelleninduzierten Druck-Temperatur, Bedingungen der Marsmeteorite und ihrer Bedeutung für die Interpretation der Kristallisationsalter und den Ejektionsmechanismen, (c) der Zuordnung der Marsmeteorite zu bestimmten regionalen, geologischen und stratigraphischen Einheiten der Marsoberfläche, (d) der Aufklärung der Frage, inwieweit primitive Lebensformen (z. B. Sporen) die hohen Drücke und Temperaturen während der Stoßwellenmetamorphose überleben und auf die Erde gelangen können.',
