    'title': 'Die lakustrinen Artenschwärme in den alten Seen Sulawesis - der Einfluß von Umweltveränderungen auf organismische Diversifikation',
    'abstract': "Alte Seen beherbergen einige der spektakulärsten Radiationen bzw. Artenschwärme der Erde, deren Erforschung bedeutende Beiträge zum allgemeinen Verständnis von Artbildungs- und Radiationsprozessengeliefert hat. In Südostasien stellen die Malili-Seen auf der indonesischen Insel Sulawesi einen 'Hotspot' aquatischer Biodiversität dar. Parallele adaptive Radiationen von Mollusken, Crustaceen, Fischen und anderenGruppen bieten hervorragende Möglichkeiten zum Vergleich von Diversifikationsmustern bei Organismen im gleichen Lebensraum, die sich aber fundamental in ihren intrinsischen Eigenschaften unterscheiden. Dasgerade erfolgreich abgeschlossene ICDP Bohrprogramm im Towuti-See, dem größten See des Systems, wird es ermöglichen, das Verständnis der Diversifikationsprozesse im System bedeutend zu erweitern, da sich hiermit die Gelegenheit zur Verbindung der an den rezenten Arten gewonnenen Daten mit der Variation in Umweltparametern über die letzten etwa 650000 Jahre ergibt. Damit kann der Einfluss externer Faktoren auf die Diversifikation aller größeren Artenschwärme im Malili-Seensystem getestet werden.Aus den Bohrkernen können verlässliche Informationen zum Alter des Towuti-Sees, die Zeitpunkte von Seespiegelschwankungen, Änderungen in der Verbindung der Seen untereinander und allgemein die Umweltbedingungen, welche die evolutionären Prozesse in den Seen bestimmen, gewonnen werden. Diese Daten werden letztendlich eine Abschätzung des Einflusses dieser Parameter auf Kolonisierungsereignisse in den Seen, Perioden introgressiver Hybridisierung, die Stabilität der Lebensräume sowie den räumlichenBedingungen von Artaufspaltungen (sympatrisch, allopatrisch) im Towuti-See und dem gesamten Seensystem erlauben. In diesem Projekt werden die Basisdaten für das Testen des Einflusses erheblicher Klima- und Umweltereignisse gewonnen, indem umfangreiche Metaanalysen von großen existierenden phylogenetischen Datensätzen aller bedeutenden Artenschwärme der Malili-Seen durchgeführt werden. Ziel ist es, Ereignisse wie Seenkolonisierung, rasche Artaufspaltungen, Lebensraumwechsel oder Hybridisierung in der Evolution dieser Gruppen zu identifizieren und sie mittels molekularer Uhr-Analysen zeitlich einzuordn. In der zweiten Projektphase sollen dabei über alle Gruppen hinweg vergleichbare Kerngendaten mittels eines Next Generation Sequencing-Ansatzes zur Absicherung der in der ersten Projektphase gewonnenen Ergebnisse aus mitochondrialen Genen gewonnen werden. Mit diesem Multimarkeransatz wird eine höhere Belastbarkeit der aus den genetischen Daten abgeleiteten Aussagen erreicht. Die Identifizierung und zeitliche Einordnung von Schlüsselereignissen in der Evolution der wichtigsten Taxa der Malili-Seen wird es erlauben, in einer späteren Phase des Projektes die Korrelation mit signifikanten Veränderungen in den Umweltparametern zu testen.",
