    'title': 'Geochemische und mineralogisch-petrographische Untersuchung der Kreide-Tertiär-Grenzschicht und der Impaktlithologien des Chicxulub-Kraters, Mexiko',
    'abstract': 'Gegenstand des Forschungsvorhabens ist die 200 km große Impaktstruktur Chicxulub in Yucatan, Mexico, welche das Alter der Kreide-Tertiär-Grenze aufweist und als Ursache für die an dieser Zeitmarke beobachtete Massenextinktion diskutiert wird. Mit geologischen, petrographischen und geochemischen Methoden (REM, Mikrosonde, INAA, TEM) sollen Untersuchungen an Impaktbrekzien (Suevit, Impaktschmelzgesteine) aus vorhandenen Bohrkernen sowie Brekzien und Proben der proximalen und distalen Auswurfsmassen des Kraters und darüber hinaus Geländearbeiten in diesen Formationen durchgeführt werden. Die Untersuchungen haben einerseits zum Ziel, den lithologischen Aufbau und die Größe der Impaktstruktur zu präzisieren und damit das geplante internationale ICDP Bohrprogramm in Chicxulub optimal vorzubereiten und andererseits einen Beitrag zum Verständnis folgender allgemeiner Aspekte des Chicxulub-Ereignisses zu liefern: (1) Auswirkung des Impakts auf die Litho-, Hydro-, Atmo- und Biosphäre der Erde, (2) Mechanik der Bildung großer komplexer Impaktstrukturen auf der Erde und Bedeutung für das Verständnis analoger Strukturen auf anderen Planeten. Unsere bisherigen Untersuchungen konnten dabei entscheidende Informationen zur Auswahl der geeigneten Bohrlokalitäten liefern. Das Bohrprogramm wird unter unserer intensiven Beteiligung voraussichtlich im Jahr 2000 beginnen.',
