    'title': 'Kieselalgen, Radiolarien und die känozoischen Silizium- und Kohlenstoffzyklen',
    'abstract': 'Moderne planktonische Meereskieselalgen wirken sich als Silicamineralisator und Primärproduzenten bedeutsam auf sowohl den Silizium- als auch den Kohlenstoffzyklen aus: sie dienen zugleich als Hauptexporteur der Silica als auch des Kohlenstoffs zu den Tiefsee. Zu Beginn von Eozän waren jedoch Radiolarien der Hauptexporteur der Silica, Kieselalgen waren zu der Zeit selten und geographisch begrenzt. Frühere Studien hoben zwei Hauptereignisse der känozoischen Kieselalgen- und Radiolariengeschichte hervor. Das erste Ereignis ist ein Hochstand der Kieselalgendiversität und deren Abundanz an der Eozän/Oligozän-Grenze, während welcher Zeit die Kieselalgen die Kontrolle über den marinen Siliziumszyklus übernommen haben. Das zweite Ereignis hat während des Mittelmiozäns stattgefunden: eine komplette räumliche Umstrukturierung der Ablagerung des biogenen Opals und eine kontinuierliche Erhöhung der Kieselalgendiversität und Abundanz erfolgten. Die beiden Ereignisse sind gleichgesetzt mit bekannten Veränderungen des atmosphärischen pCO2 und der Strontium- und Osmiumisotope (hinweisend Wechsel der Silikatverwitterung). In diese neue Projeckt schlage Ich vor absolute Kieselmikrofossilabundanz zu messen. Die Daten werden an verschiedenen DSDP-ODP-IODP Standorten, welche die letzen 55 Myr umspannen, erhoben. Die standorte können in unterschiedliche geographische Zonen eingeteilt werden, welche in ein Pilotstudie der Känozoikum Kieselalgenablagerungsstruktur hervorgehoben worden sind. Mit dieser Zeitreihe, habe ich vor, kausale Beziehungen zwischen Kieselalgen und dem Klimawandel im Känozoikum zu entwirren, sowie zu bestimmen, was es den Kieselalgen erlaubte, die Radiolarien auskonkurrieren und wie drastisch sich die Kieselalgenbiogeografie während des Känozoikums änderte. Biogener Opal ist der einzige Output des marinen Siliziumszyklus und Silikatverwitterung ist der Hauptinput: deshalb ist er mir schließlich möglich mit der gemessenen Zeitreihe, eine globale Akkumulationsquote des biogenen Opals und folglich der Intensität der Silikatverwitterung im Känozoikum einzuschätzen.',
