    'title': 'Radiolarien- und palynologische Untersuchungen an Neogen- und Kreidesedimenten des südlichen Ozeans, unter besonderer Berücksichtigung einer verbesserten Taxonomie und Biostratigraphie als Basis für weitere Studien zur Evolution und Paläoozeanographie',
    'abstract': "Mit dem Antrag wird eine Erarbeitung von taxonomisch/biostratigraphischen Daten vorgeschlagen, die sich auf zwei Teilprojekte verteilen. Beide (Sub)Projekte sind eingeladene `shore based' Studien, die zwei gerade durchgeführte ODP Legs unterstützen.Das Leg 178 Subprojekt (antarktische Halbinsel) wird sich auf die grundlegenden Beschreibungen von obermiozänen bis unterpliozänen Radiolarienfaunen konzentrieren. Dieses neue Wissen soll bei der Entwicklung von hochauflösender Feinstratigraphie bzw. Radiolarienchronologie auf die neogenen Kerne von Leg 178 und andere antarktische ODP Kerne angewendet werden. Diese Arbeit wird, das erste mal seit über einhundert Jahren, durch Neubeschreibungen von Typenmaterial aus der Sammlung Ehrenberg Radiolariengattungskonzepte stabilisieren.Es sollen im Leg 183 Subprojekt bereits erarbeitete Daten von südhemisphärischen Palynomorphen auf die Dinozystenstratigraphie und Rekonstruktion mariner und terrestrischer Biota anwenden werden. Die Erarbeitung dieser Floren soll dann paläoklima- tische und paläoökologische Rekonstruktionen ermöglichen. Ein Schwerpunkt wird u.a. das Studium der Angiospermenevolution anhand von Pollen sein. Einige dieser Pollentaxa können unser Wissen über Ursprung und paläobiogeographische Verbreitung einiger rezenter südhemisphärischer Angiospermenfamilien erweitern.",
