    'end_date': 2001,
    'title': 'Rekonstruktion der klimatischen Veränderungen in Zentralasien während der letzten 2,5 bis 3 Millionen Jahre am Beispiel des Baikalsees',
    'abstract': 'Durch Untersuchungen an einem 200 m langen Bohrkern besteht die Möglichkeit, die kontinentale Klimageschichte in Zentralasien für die letzten 5 Mio. Jahre nachzuzeichnen. Sedimente der Kerne BDP 96-1 und -2 sollen unter paläontologischen, sedimentologischen und geochemischen Gesichtspunkten beleuchtet werden. Kalt-/Warmzyklen sollen im Hinblick auf den fluviatilen bzw. atmosphärischen Eintrag, die Vegetationsgeschichte, die limnische Besiedlung und die biologische Produktivität betrachtet und im Kontext der klimabestimmenden Dynamik der Hydrosphäre gesehen werden. Der Vergleich mit der ozeanischen Klimageschichte ist dank einer guten zeitlichen Zuordnung der einzelnen im limnischen System abgebildeten Klimaereignisse durchführbar. Die hohe zeitliche Auflösung in den Baikalsee-Kernen soll auch dazu dienen, Phasenbeziehungen zwischen den einzelnen Parametern und den Klimaänderungen, die möglicherweise über orbitale Zyklen gesteuert werden, zu finden. Darüber hinaus soll gezeigt werden, welchen Einfluß das Monsunzirkulationsmuster im Gebiet des Baikalsees hatte.',
