    'title': 'Zeitnahe Probennahme von Spherule-Lagen in der 2011 ICDP Bohrung Barberton Mountain Land: Archiv von Meteoriteneinschlägen auf der frühen Erde',
    'abstract': 'We ask for financial support to attend the sampling party of the 2011-2012 ICDP drilling “Barberton Mountain Land”. The sampling party in Johannesburg, South Africa, expected to be scheduled for the second half of 2012, provides the best opportunity for detailed core logging, sample selection and acquisition. Thin sectioning and initial petrographic and geochemical description is planed as work in preparation for a full proposal to be submitted to the next ICDP call in fall 2012. In the follow up proposal the impact and meteorite research team at the Museum für Naturkunde aims to investigate the late Archean spherule layers, the oldest record of impact events on Earth. The ejecta layers contain millimeter sized spherules that are larger and form thicker layers compared to any impact ejecta layer known from Phanerozoic sediments, including the global ejecta layer of the Chicxulub impact catering event that terminated the Mesozoic era of Earth’s history.',
