    'title': 'Eine Phasen-spezifische geochemische Studie von mariner Produktivität und Nährstoffzyklen während des Perm/Trias-Massenaussterbens (PHoSPhoR)',
    'abstract': 'Mit dem beantragten Projekt möchte ich Veränderungen in der marinen Produktivität und der Nährstoff-Verfügbarkeit untersuchen, welche zum Massenaussterben am Ende des Perms beigetragen haben. Dieses Event gilt als die wichtigste Faunenwende in den vergangenen 500 Millionen Jahren; es wird gefolgt von eine zwei bis fünf Millionen Jahre andauernden Periode der Instabilität es Ökosystems. Die Gründe für das Aussterbeereignis werden noch immer intensiv diskutiert. Eine offene Frage ist, ob das Event mit einem weitgehend unbelebten Ozean (einen Kollaps der Primärproduktion) einhergeht oder ob der Niedergang der Biodiversität bei Vielzellern mit einer hohen Rate an Primärproduktion in Verbindung steht. (Erhöhter Zufuhr von Nährstoffen regt die Produktion von organischer Substanz an und resultiert in Sauerstoff-abgereicherten Zonen mit hohem Gehalt an Hydrogensulfiden, welche durch erhöhte aerobe und anaerobe Atmung verursacht werden.) Ich werde die gegensätzlichen Hypothesen für den Diversitätskollaps am Ende des Perms im Rahmen einer auf neue Techniken basierende geochemischen Studie von ausgesuchten marinen sedimentären Archiven untersuchen. Mit diesem Ansatz wird eine umfassendere Kenntnis über die Wechselwirkungen von Redox-Bedingungen, Nährstoffzyklen und biogeochemischen Zusammenhängen für dieses kritische Zeitinterwall der Erdgeschichte erreicht. Ein zentraler Punkt der Studie ist die detaillierte Bewertung der ozeanischen Redox-Bedingungen. Dies wird erreicht durch die erst kürzlich entwickelte Fe-speciation Technik (welche bisher erst einmal für die Perm-Trias Krise angewandt wurde). Diese Studie komplementiert in letzter Zeit erreichte Fortschritte im Verständnis der Eigenschaften von Spurenelementen unter Redox-Bedingungen. Die Methode wird präzise und robuste Proxydaten liefern, um die Reichweite des Redox-Systems zu erarbeiten (oxisch, dysoxisch, anoxisch-sulfidisch oder anoxisch-eisenhaltig). Diese Analysen dienen zur Vorbereitung der folgenden geochemischen Untersuchungsphase, die mit der ganz neuen Anwendung der Phosphor-Speziation und Barium-Konzentration Informationen über die früheren Nährstoff-Zufuhr (und Recycling) und der marinen Produktivität liefern wird. Derartigen Untersuchungen sind aus zwei Gründen essentiell: (1) Elementanalysen von Gesamtgestein (Standard-Technik) geben keinen Aufschluss über die biologisch verfügbaren Kreisläufe, da es die detritische Fraktion einschließt. (2) (Re)mobilisierung der aktiven Elemente nach der Ablagerung kann, unter bestimmten Bedingungen, nur durch eine Phasen-spezifische Technik ermittelt werden. Ich werde diese Techniken auf der Basis von geochemischen Analysen von spezifischen sedimentären Phasen, welche zu größerer Wahrscheinlichkeit die originalen Signale enthalten, durch Feststellung der präzisen Redox-Bedingungen verbessern. Dieses wird verbunden sein mit der Analyse von Schwefelisotopen, welche einen zusätzlichen Einblick in die Redox-Bedingungen der Wassersäule ermöglichen werden.',
