    'title': 'Die Herkunft des Urans in präkambrischen, Diskordanz-gebundenen Lagerstätten des Athabasca Beckens (Saskatchewan, Kanada) - Mikroanalytische Untersuchungen an potentiellen Uran-Liefergesteinen',
    'abstract': 'Die Diskordanz-gebundenen Uranlagerstätten des proterozoischen Athabasca Beckens (Saskatchewan, Kanada) gehören zu den größten hochgradigen Uranlagerstätten der Welt. Die Genese dieser Lagerstätten ist noch immer sehr umstritten. Von vielen diskutierten Genesemodellen wird derzeit das sogenannte hydrothermal-diagenetische Modell favorisiert, mit der Annahme, daß das Uran aus den Athabasca-Sandsteinen mobilisiert wurde. Bisher liegen jedoch keine speziellen Untersuchungen vor, welche eine Mobilisierung von Uran aus den möglichen Liefergesteinen (Grundgebirge, Paläoverwitterungshorizont oder überlagernde Sandsteine) belegen. Mit dem DFG-finanzierten Vorhaben wird die noch ungeklärte Herkunft und Mobilisierung des Urans aus den oben genannten Liefergesteinen untersucht. Zur Charakterisierung der U-führenden Phasen und U-mobilisierenden Reaktionen sowie den damit assoziierten Fluiden werden konventionelle und neu entwickelte mikroanalytische Verfahren eingesetzt (Spaltspurenmethode, Mikrosonde, Mikrothermometrie, Mikrolaserinduzierte Plasmaemissionsspektroskopie u.a.).',
