    'title': 'Die Untersuchung terrestrischer Einschlagstrukturen mit Hilfe numerischer Modellrechnungen und geophysikalischer Erkundung',
    'abstract': 'Die mit Kratern übersäten Oberflächen der terrestrischen Planeten dokumentieren eindrucksvoll die Bedeutung von Einschlagereignissen als wichtigen geologischen Prozeß in der Entwicklungsgeschichte des Sonnensystems und insbesondere der Erde. Durch Einschläge von Asteroiden oder Kometen entstehen Impaktstrukturen, deren Morphologie in Abhängigkeit von der Kratergröße deutliche Unterschiede aufweist. Wie es zur Bildung dieser unterschiedlichen Kraterformen kommt, ist nach wie vor nicht vollständig geklärt. Im Rahmen des beantragten Forschungsvorhabens soll mit Hilfe numerischer Modellrechnungen der Prozeß der Kraterbildung untersucht werden. Dabei sollen neben der Modellierung der Entstehung von typischen topographischen Merkmalen, wie Kraterform und morphometrische Abmessungen, auch die Auswirkungen eines Einschlagereignisses auf den Krateruntergrund bzw. auf die Kraterumgebung berücksichtigt werden. Geophysikalische Untersuchungen liefern grundlegende Informationen über die impakt-induzierten strukturellen Modifikationen sowie über die Zerrüttung des Gesteins im Untergrund. Eine quantitative Verknüpfung zwischen geophysikalischen, in Verbindung mit Einschlagstrukturen nachweisbaren Anomalien (geoelektrische, magnetische, seismische und gravimetrische Signaturen) und numerischen Modellrechnungen erscheint somit sinnvoll und wird wesentlich zum besseren Verständnis der Kraterbildung beitragen.',
