    'title': 'Diversität und Disparität der Anomodontia (Tetrapoda, Therapsida) über das Permisch-Triassische Aussterbeereignis',
    'abstract': "The end-Permian biotic crisis (~252.5 Ma) represents the most severe extinction event in Earth's history. My research investigates diversity patterns in Anomodontia, an extinct group of therapsid synapsids ('mammal-like reptiles'), through time and in particular across this event. As herbivores and the dominant terrestrial tetrapods of their time, anomodonts play a central role in assessing the impact of the end-Permian extinction on terrestrial ecosystems. The proposed study utilizes a combination of quantitative approaches to investigate phylogenetic and morphological diversity patterns within the group. A robust taxonomic and phylogenetic framework using modern systematic approaches forms the initial step of this study and will subsequently form the basis for an assessment of phylogenetic diversity and morphological disparity patterns within Anomodontia across the end-Permian extinction event. In addition to periods of biotic extinction, recovery, and diversification, this approach allows the identification of intervals of decelerated or accelerated rates of morphological evolution through time. My proposed research aims to shed new light on our understanding of the impact of the end-Permian extinction event on terrestrial ecosystems.",
