    'title': 'Hox- und Parahox-Gen Expressionsmuster bei Polyplacophora (Mollusca)',
    'abstract': 'Nach neueren molekularen Analysen und umfangreichen paläontologischen Daten wird an der Basis der Mollusca eine dichotome Aufspaltung favorisiert: monophyletische Aculifera (Aplacophora und Polyplacophora) bilden die Schwestergruppe zu den ebenfalls monophyletischen Conchifera. Ein hypothetischer Ur-Mollusk könnte demnach entweder mit einer einteiligen, mit einer seriellen oder aber ohne eine Schale ausgestattet gewesen sein. Fossile Befunde zeigen weiterhin, dass die Aplacophora und Polyplacophora von einem spätkambrischen, Polyplacophora-ähnlichen Mollusken abstammen könnten, welcher eventuell mit seriell überlappenden Schalenplatten ausgestattet war. Die Körperorganisation der Polyplacophora erscheint damit für die Rekonstruktion eines hypothetischen Ur-Mollusken von besonderem Interesse zu sein, selbstverständlich berücksichtigend, dass die Polyplacophora, wie die meisten Taxa, ein Muster aus ursprünglichen und abgeleiteten Merkmalen aufweisen. Vergleichende Genexpressionsanalysen zeigen, dass Hox- und Parahox-Gene, die während der Ontogenese exprimiert werden, eine entscheidende Rolle bei der Ausbildung der Körperorganisation der Bilateria spielen. Das hier vorgestellte Projekt hat das Ziel, die Genexpressionsmuster der Hox- und Parahox-Gene in der Entwicklung des Polyplacophoren Acanthochitona crinitus (Pennant, 1777) zu untersuchen.Durch den Vergleich mit den bereits vorliegenden Genexpressionsdaten zu den Gastropoda und Cephalopoda (Conchifera) sollen neue Erkenntnisse gewonnen werden, welche Funktionen Hox- und Parahox-Gene in der Ontogenese der Mollusca einnehmen können. Durch den Vergleich von Polyplacophora (als Vertreter der Aculifera) und Vertretern der Conchifera lassen sich Rückschlüsse ziehen, welche konservierten, aber auch welche plastischen Funktionen Hox- und Parahox-Gene bei den Mollusca besitzen. Das Projekt soll einen wesentlichen Beitrag zum evolutiven Verständnis des extrem variablen Körperbauplanes der Mollusca und der Funktionen der daran beteiligten Entwicklungsgene liefern, und ist Teil einer umfangreich angelegten vergleichenden entwicklungsbiologischen Studie verschiedenster Taxa der Mollusca in der Arbeitsgruppe von Prof. Wanninger, welche weitere wichtige Taxa wie Solenogastres, Scaphopoda, Bivalvia, Gastropoda und Cephalopoda umfasst.',
