    'title': 'Phylogenie, Funktionsweise der Mundwerkzeuge, Embryonalentwicklung und ökologische Beziehung der Histiostomatidae (Milben, Astigmata) zu ihren Transportinsekten',
    'abstract': 'Das Projekt greift interessante Fragen zur Phylogenie und Biologie der Histiostomatidae auf, die sich während der Arbeit an der Promotion ergeben haben. Die phoretischen Histiostomatidae sind eine Teilgruppe der astigmaten Milben und beinhalten etwa 300 Arten weltweit. Sie unterscheiden sich morphologisch vor allem in der ungewöhnlichen Gestalt ihrer Mundwerkzeuge von anderen Milben. Diese Anpassungen der Mundwerkzeuge an eine neue Form der Nahrungsaufnahme weist auf eine ebenfalls abgewandelte Biologie hin. Folgende Untersuchungen, basierend auf Ergebnissen der Doktorarbeit, sollen stattfinden: Die Funktionsweise der komplexen Mundwerkzeuge soll an lebenden Milbe mit Hilfe der digitalen Kameratechnik und der Lichtmikroskopie im Detail studiert werden. Der von mir erstellte Stammbaum für die Gruppe (der zugleich auch die erste phylogenetische Verwandtschaftsanalyse überhaupt für diese Milben ist) soll zunächst mit Hilfe morphologischer Daten vervollständigt werden. In Kooperation mit molekularbiologisch arbeitenden Milbenforschern soll er ferner mittels molekularer Merkmale getestet werden.Des weiteren sollen unter Laborbedingungen (da die meisten Histiostomatiden Arten gut kultiviert werden können) Versuche zur Ermittlung von Lebensstrategien stattfinden.Untersuchungen zur embryonalen Entwicklung der Histiostomatidae, sowie zur Morphologie der Embryostadien bzw. der Prälarve und dem Zeitpunkt der Häutung zur Larve im Ei sollen durchgeführt werden. Sie werden neue Merkmale für die vergleichende phylogenetische Analyse liefern.',
