    'title': 'Die Rolle von Hyperthermie im Massenaussterben an der Perm/Trias-Grenze',
    'abstract': 'Wir wollen die Rolle von Hyperthermie im Massenaussterben an der Perm/Trias-Grenze, der größten biotischen Krise in der Erdgeschichte, verstehen. Trotz ihrer erheblichen Bedeutung für die Evolution des Lebens werden die auslösenden Mechanismen für diese Krise noch immer sehr kontrovers diskutiert. Dieses Massenaussterben ist das gravierendste vergangene Beispiel einer durch Klimaveränderungen, besonders durch globale Erwärmung, ausgelöste Krise. Sie kann daher als ein Analogon für die Reaktion der Biodiversität auf die zukünftige anthropogene Klimaänderung angesehen werden. Wir schlagen hier ein Forschungsprojekt vor, in welchem die Konsequenzen von Stress durch Erwärmung während des end-Permischen Massenaussterbens und der Erholung in der frühen Trias untersucht wird. Wir wählen die Ostracoden als Modell-Organismen für simultane Untersuchungen ihrer Evolutionsgeschichte und ihrer Reaktion auf Klimaveränderungen (besonders hinsichtlich der Erwärmung am Perm/Trias-Grenzintervall). Die zu untersuchenden Aufschlüsse liegen im Nordwest-Iran (Region von Julfa), Zentraliran (Region von Abadeh) und dem Zagros-Gebirge (Region von Esfahan); diese Regionen repräsentieren Tiefschelf- bis Flachwasser-Habitate. Unsere Studie wird die Untersuchung von Isotopengeochemie (Analysen von delta13C und delta18O) unter Anwendung der SIMS-Technologie von Ostracodenschalen beinhalten. Außerdem werden die Ostracoden-Vergesellschaftungen hinsichtlich ihrer taxonomischen Diversität, morphologischen Disparität, Grad des Endemismus, Veränderungen in der Größe der Individuen usw. untersucht.',
