    'title': 'Entwicklung benthischer, mariner Faunen SW-Europas unter klimatischem Stress während des Unteren Jura (Pliensbach-Toarc) (EvoBiv)',
    'abstract': 'Die globale Klimaerwärmung und damit assozierte Stressfaktoren, insbesondere Sauerstoffverknappung und Ozeanversauerung, sind mitverantwortlich für die Verarmung vieler heutiger mariner Ökosysteme. Die geologische und fossile Überlieferung beinhaltet ein Archiv vergangener Phasen des Klimawandels und seiner Auswirkungen auf die Zusammensetzung, ökologische Funktionsweise und evolutionäre Dynamik mariner Faunen und erlaubt damit Aussagen zu langfristigen biotischen Veränderungen als Reaktion auf temperatur-gesteuerten Stress (TRS). Im beantragten Projekt soll dies für die mit einem Massenaussterben einhergehende Klimaerwärmung im Unteren Toarc (Unterer Jura, ca. 183 Millionen Jahre vor heute) in ausgewählten Profilen SW-Europas untersucht werden. Ziel ist es, mit einem interdisziplinären Forschungsansatz eine Verbindung zwischen wichtigen Umweltfaktoren (abgeleitet aus geochemischen Proxy-Daten und sedimentärer Fazies) und dem quantitativen Auftreten makrobenthischer Faunen (vor allem Muscheln und Brachiopoden) herzustellen, die ihrerseits eine große ökologische Bandbreite an Lebensweisen, Ernährungsweisen, Körpergrößen und Mobilitätsnivevaus repräsentieren. Durch die Anwendung physiologischer Prinzipien soll die relative Bedeutung einzelner Umweltfaltoren (Temperaturextreme, Sauerstoffmangel, Ozeanversauerung) auf die Faunenentwicklung ermittelt und verstanden werden. Darüber hinaus untersuchen wir, inwieweit eine Reduktion der Schalengrößen ein erstes Anzeichen von bevorstehenden Veränderungen auf Gemeinschaftsebene darstellt, und ob großwüchsige Arten besonders von TRS betroffen waren. Schließlich untersuchen wir, ob der Verlauf der ökologischen Erholung von TRS spiegelbildlich zur ökologischen Degradierung durch TRS ablief oder davon unabhängig. Solch ein unabhängiger, hysteresis-artiger Verlauf, der in einen alternativen ökologischen Zustand mündet, ist von einigen heutigen aquatischen Ökosystemen bekannt.',
