    'title': 'FOR 1508: Dynamisch adaptierbare Anwendungen zur Fledermausortung mittels eingebetteter kommunizierender Sensorsysteme',
    'abstract': 'Technologien zur effizienten Vernetzung energiesparsamer, miniaturisierter Sensoren sind ein Schlüssel für vielfältige innovative Anwendungen. Die Anwendungen reichen von weltumspannenden Sensornetzen, zum Beispiel zur Wettererfassung, bis hin zu lokal begrenzten Sensornetzen wie beispielsweise zur dynamischen Überwachung einer Vielzahl beweglicher Objekte, beispielsweise zur Erfassung des Zustands und der Bewegungen einer Tierpopulation. Besonders wertvoll werden Sensornetze, wenn sie die Umgebung einschließlich der beweglichen Objekte kaum beeinträchtigen und eine Datenerfassung auch in schwer zugänglichen oder problematischen Bereichen ermöglichen. Globales Ziel der Forschergruppe ist es, grundlegende Erkenntnisse zum Entwurf, Aufbau und adaptiven Betrieb ressourcenknapper, heterogener, intelligenter Netze aus statischen und beweglichen Sensoren zu gewinnen. Die interdisziplinär aufgestellte Forschergruppe aus Wissenschaftlerinnen und Wissenschaftlern der Biologie, Informatik und Elektrotechnik zielt darauf ab, richtungsweisende Methoden und Verfahren zur Datengewinnung, zum Datenmanagement und zur Datenauswertung zu erarbeiten und zu demonstrieren. Die neu entwickelten Methoden und Verfahren sollen beispielhaft zur Verhaltensforschung bei Fledermäusen eingesetzt werden, einer in der Fauna-Flora-Habitat-Richtlinie der Europäischen Union als besonders schützenswert eingestuften Tiergruppe. Konkret sollen Fledermäuse mit miniaturisierten, ultraleichten Funksendern ausgestattet werden, die auch über beschränkte Speicher- und Rechenkapazität zur Datenverarbeitung verfügen. Ein Netz aus bodengestützten, statischen Sensoren dient zur Überwachung einer Vielzahl derart ausgestatteter Fledermäuse. Bei Verhaltensstudien zu Fledermäusen reichen meist relativ grobe, das heißt wenige Meter genaue Schätzungen der geflogenen Trajektorien ohne Echtzeitanforderungen. Wie bei vielen Anwendungen rechnet sich daher der Energie- und Kosteneinsatz nicht, der mit einer hohen, das heißt submetergenauen Ortung bei gleichzeitiger Echtzeitfähigkeit verbunden ist. Nur gelegentlich ist orts- oder zeitabhängig eine präzisere Ortung von Interesse, um das Sozial- oder das Jagdverhalten genauer zu studieren. Primäre Entwurfsziele bei der Gestaltung des Sensornetzes sind daher Skalierbarkeit der räumlichen Netzausdehnung sowie minimales Gewicht (weniger als 2 Gramm), minimaler Energieverbrauch, minimales Volumen und fledermausgerechter Formfaktor der mobilen Sensornetzknoten.',
