    'title': 'Größenveränderungen von Cephalopoden während der Pliensbachium-Toarcium Krise',
    'abstract': 'Die Reduzierung der Körpergröße innerhalb von Taxa wird als eine der wichtigsten Antworten in Hinblick auf klimaabhängigen Stressfaktoren gesehen. Trotz der üblichen Deutungen bei ähnlichen Größenveränderungen im Umfeld verschiedener Massenaussterbeereignisse werden ihre globale Bedeutung ebenso wie ihre damit verbunden Mechanismen diese Lilliput-Effekts nach wie vor kontrovers diskutiert. Das Projekt hat zum Ziel, die Rolle der Erwärmung und damit verbundener Stressfaktoren (Anoxia) in Hinblick auf Größenänderungen von marinen Organismen während der unterjurassischen Faunenkrise im Toarcium zu verstehen. Wir betrachten Cephalopoden aus W-Europa und NW-Afrika entlang eines N/S-Gradienten, um Größenverteilungsmuster von einzelnen Taxa bis zu Vergesellschaftungen zu untersuchen. Die erhaltenen Muster werden in Hinblick auf Fazies, physiko-chemische Proxies und physiologische Vorhersagen gründlich analysiert, um die Korrelation von Körpergröße und Umweltparametern, wie Temperatur, Sauerstoffverfügbarkeit und Produktion/Einlagerung von organischem Kohlenstoff zu testen.',
