    'title': 'Untersuchung des Jagd- und Sozialverhaltens von Fledermäusen mit Hilfe von Sensorsystemen',
    'abstract': 'Fledermäuse lassen sich aufgrund ihrer nächtlichen Lebensweise, ihrer Fähigkeit zum aktiven Flug und ihrer kleinen Körpergröße im Freiland bisher nur sehr eingeschränkt direkt verfolgen. Wir wissen daher nur wenig über individuelle Bewegungsmuster von Fledermäusen außerhalb der Quartiere, während das Verhalten von Fledermäusen in ihren Quartieren bei einer Reihe von Arten vergleichsweise gut untersucht ist. Die Möglichkeit, Fledermäuse auch im Freiland individuell verfolgen zu können, ist jedoch die Voraussetzung für ein breites Spektrum an Untersuchungen in den Bereichen Tierökologie, Verhaltensökologie, Sinnesökologie und Naturschutz. Das im Rahmen der Forschergruppe zu entwickelnde Sensornetzwerk mit hoher Lokalisationsgenauigkeit soll erstmals an frei beweglichen Fledermäusen angewandt werden, um einerseits die technische Leistungsfähigkeit des Sensornetzwerks unter Freilandbedingungen zu testen und zu optimieren und um andererseits kleinräumige Muster der Habitatnutzung und die Interaktion zwischen Individuen zu untersuchen.',
