    'title': 'Bärenspinner-Gemeinschaften (Lepidoptera: Arctiidae) im Bergregenwald Südecuadors - Diversität, Life-history-Elemente, Ressourcenansprüche und Thermophysiologie',
    'abstract': 'Herbivore Insekten stellen eine wesentliche Komponente des Artenreichtums terrestrischer Ökosysteme und spielen zugleich als Bindeglied verschiedener Trophie-Ebenen eine wichtige Rolle in Stoffflüssen. Insbesondere für artenreiche Herbivorengemeinschaften ist bis heute unklar, ob Pflanzenartenreichtum oder eher Strukturparameter der Vegetation (neben abiotischen Faktoren wie Klima und Nährstoffangebot) die Diversität der Pflanzenfresser entscheidend determinieren. Am Beispiel mehrerer artenreicher Schmetterlings-Taxozönosen soll in einem südecuadorianischen Bergwaldgebiet diese Frage beantwortet werden, wobei Datensätze aus botanischer, bodenkundlicher und klimatologischer Forschung mit quantitativen Erhebungen zur Struktur und Vielfalt der Insekten-Artengemeinschaften zusammengeführt werden. Dabei stehen zunächst Taxozönosen in einem ausgeprägten Höhengradienten zur Analyse an, während in einem zweiten Schritt auch Muster und Mechanismen der Besiedlung anthropogen degradierter Landschaften (Weiden, Brache- und Sukzessionsflächen unterschiedlichen Alters, Aufforstungen) durch diese Herbivorentaxa bearbeitet werden.',
