    'title': 'Numerische Modellierung der Prozesse bei der Entstehung von Impakt-Kratern',
    'abstract': 'Numerische Simulationen liefern wesentliche Erkenntnisse zum umfassenden Verständnis natürlicher Impaktvorgänge und ergänzen dadurch in idealer Weise Labor- und geophysikalische Untersuchungen. Aktuelle Herausforderungen sind die Entwicklung eines besseren quantitativen Verständnisses der bei „hypervelocity“ Impakten auftretenden Prozesse sowie die Simulation der Bildung unterschiedlicher Kratermorphologien. Hierfür sind vor allem verbesserte Materialmodelle nötig, die die Materialantwort komplexer geologischer Materialien auf hohe Drücke in Stoßwellen, auf die anschließende Entlastung sowie auf große Deformationen bei hohen Dehnraten in der erforderlichen Genauigkeit abbilden können. In der ersten Phase des MEMIN Projekts lag der Schwerpunkt der Untersuchungen bei der Mesoskalen-Simulation des Verhaltens von porösem und trockenem Sandstein bei Kompression durch Stoßwellen. Auf dieser Basis wurden eine makroskopische Beschreibung der bei Kompressions- und Scher-/Zug-Aufweitungsprozessen auftretenden Ab- bzw. Zunahme des Porenraumes sowie eine auf der ANEOS beruhende Zustandsgleichung (EoS), die das thermodynamische Verhalten von porösen und (teilweise) wassergesättigtem Gestein beschreibt, entwickelt. Die neuen Modelle wurden mit Hilfe der Kraterbildungsexperimente in MEMIN kalibriert und mit diesen verglichen. Daneben wurden die Modelle eingesetzt um andere Projekte des Netzwerkes mit quantitativen Daten zu unterstützen (Interpretation von Deformationsmerkmalen bei niedrigen Stoßwellendrücken – P2, P7; Ultraschalluntersuchung der Schädigung des Zielgesteins – P3; Skalierung der Kraterdimensionen – P6; thermodynamische Bedingungen beim Projektil-Target Kontakt – P8; Aufbau der Kraterbildungsexperimente – P1). Im Nachfolgeprojekt sollen identifizierte Defizite in den Materialmodellen behoben und neue Prozesse in den Modellen berücksichtigt werden, die sich im Projektverlauf als wesentlich herausgestellt haben (Impaktblitz, Ejekta-Wolke, Spallationsprozesse). Projektschwerpunkte sind (1) die experimentell gestützte Erweiterung und Verallgemeinerung der neu entwickelten Materialmodelle; (2) die Simulation der Bildung und Expansion der Ejekta-Wolke; (3) Übertragung der Simulation von Laborexperimenten auf natürlicher Kraterdimensionen. Insbesondere soll die im Labor nicht reproduzierbare Ausbildung einer komplexen Kratermorphologie, die auf eine zeitweise Entfestigung der Gesteine zurückzuführen ist, simuliert werden. Hier wird die Bedeutung von Simulationsmodellen für die Übertragung von im Labormaßstab gewonnenen Erkenntnissen auf die Dimension natürlicher Krater besonders deutlich. Das Projekt soll einerseits Laborexperimente und Untersuchungen an natürlichen Kratern unterstützen, andererseits werden die wesentlichen Beobachtungen in einem konsistenten Modell zusammengeführt. Daher kommt der numerischen Modellierung eine Schlüsselrolle für die Verbindungen zwischen den einzelnen Teilprojekten und die gesamte Forschergruppe zu.',
