    'title': 'Projektil-Target-Interaktion, Schmelz- und Verdampfungsprozesse in Hochgeschwindigkeitsexperimenten und natürlichen Impaktiten',
    'abstract': 'Die Herkunft und Zusammensetzung extraterrestrischer Projektile lässt sich nur durch die Analyse von Projektilresten bzw. chemischen Spuren dieser Körper bestimmen. Im Rahmen der MEMIN-Forschergruppe verfolgt dieses Teilprojekt das Ziel, das Schicksal von Projektilen einschließlich der Fraktionierung der für Meteorite charakteristischen Spurenelemente bei Impaktereignissen besser zu verstehen. Dies wollen wir erreichen durch eine Kombination aus (i) Hochgeschwindigkeitsexperimenten (HVE) mit gut charakterisierten Stahl- und Basaltprojektilen, sowie Sandstein-, Quarzit-, und Karbonat-Targets, (ii) Analyse des sehr frühen Ejektastadiums mit Hilfe von zeitaufgelöster Hochgeschwindigkeitsspektrometrie, (iii) Untersuchung natürlicher Impaktite der Impaktkrater Wabar, Kamil und Meteor (Barringer), (iv) Laser-Schmelzexperimenten und (v) chemischer Modellierung. Im Verlauf von MEMIN I konnten wir anhand von Ejektamaterial aus HVE zeigen, dass es zwischen meteoritischen Elementen zu starken Fraktionierungsprozessen bei der Interaktion von Projektil- und Target-Schmelzen kommt. Dieses Teilprojekt von MEMIN II beinhaltet Experimente mit neuen experimentellen Parametern, wie neuen Target- und Projektilmaterialien, schiefwinkeligen Einschlägen, sowie neuen Analysetechniken zur Untersuchung der sehr frühen Impaktphase. Die Auswirkungen von Karbonatdissoziation und Aufschmelzung des Targets auf das Schicksal des Projektils soll untersucht werden. Basaltische Projektile dienen als Analogmaterial für Chondrite und Achondrite. Laser-Schmelzexperimente erlauben primäre Heterogenitäten der Projektil- und Target-Teilschmelzen analytisch besser einzugrenzen. Die Verdampfung von Projektil und Target findet im frühen Impaktstadium statt, das die sogenannte Jetting-Phase einschließt. Mithilfe zeitaufgelöster Hochgeschwindigkeitsspektrometrie sollen die Zusammensetzung und Temperatur des Jetting-Materials analysiert werden. Die aus den neu entwickelten Auffängereinrichtungen der HVE separierten hochgeschockte Ejektafragmente enthalten, wie unsere Analysen im Rahmen von MEMIN I zeigen, Projektilschmelzen- und vermutlich auch –Kondensate. Dieses Material planen wir mit hoch-sensitiven und räumlich hochauflösenden Methoden (LA-ICP-MS, EMP, TEM, INAA) zu analysieren. Mit der Untersuchung natürlicher Impaktite möchten wir überprüfen, wie sich unsere experimentellen Ergebnisse mit der Natur vergleichen lassen. Die LA-ICP-MS-Analyse der Platingruppenelemente (PGE) in Projektilkügelchen >50μm in natürlichen Impaktiten stellt einen wesentlichen, innovativen Teilaspekt des Projektes dar: PGE-Elementverhältnisse werden häufig zur Identifizierung des Projektiltyps in terrestrischen Impaktkratern verwendet. Schließlich werden die Untersuchungen an experimentellen und natürlichen Materialien durch chemische Modellierungen ergänzt, um den Einfluss von Temperatur und Schmelzzusammensetzung auf die Verteilung meteoritischer Elemente im Metall-Silikat-System besser zu verstehen.',
