    'title': 'Stoßwellenprozesse im Mikromaßstab in Sandstein',
    'abstract': 'Dieses Projekt bearbeitet innerhalb des “Multidisciplinary Experimental and Modelling Impact research Network” (MEMIN) mikro- bis nanoskalige Stoßwelleneffekte in porösem Sandstein und Quarzit. Das vorgeschlagene Projekt wird in einigen Arbeitsaspekten auf den Erkenntnissen des Vorgängerprojekts „Niedrigdruck-Stoßwellenmetamorphose von Quarz in porösen und nassen sedimentären Gesteinen” aufbauen. Dies umfasst (i) die Untersuchung des Einflusses der Wassersättigung auf die Kalibration und Klassifikation der progressiven Stoßwellenmetamorphose in Sandstein und (b) eine Anwendungsstudie des neu entwickelten Stoßwellen-Kalibrations- und -Klassifikations-Systems auf die natürlichen Impaktkrater BP, Oasis (beide in Lybien) und Santa Marta (Brasilien) mit Sandstein als Impakttargets. Der Schwerpunkt dieses Projekts liegt aber in der Aufklärung der Entstehung von einigen ausgewählten Stoßwelleneffekten in Quarz: (a) Die Bildung von planaren Deformationselementen (PDF) in Quarz und ihre Beziehung zur Orientierung der Wirtskristalle soll in experimentell geschocktem Sandstein und Quarzit untersucht werden. Insbesondere die Abhängigkeit der PDF-Bildung von der Orientierung des Wirtskristalls wurde in der Vergangenheit sowohl im Experiment, als auch in der Natur nur unzureichend untersucht. Eine solche Beziehung ist allerdings von großer Bedeutung zur Verifizierung der Bildungsmodelle für PDF. (b) Durch hohen Scherstress bei Impaktprozessen können in Quarz Dauphiné and Brasilianer Zwillinge gebildet werden. Experimentell geschockte Proben werden untersucht, um die Eignung dieser Verzwillingungen als diagnostische Stoßwelleneffekte und -Barometer in Quarz-führenden Gesteinen bei niedrig-gradigem Stoßwellendruck zu testen. Diese Studie ist ein erster experimenteller Ansatz um die Rolle und Bedeutung von mechanischer Verzwillingung in geschocktem Quarz zu verstehen Zusätzlich soll eine Pilotstudie zur lokalen Aufschmelzung in diesem System durchgeführt werden. In Stoßwellenrückgewinnungsexperimenten wurde die Aufschmelzung von Quarz bei extrem hohen Temperaturen (nachgewiesen durch die parallele Aufschmelzung von Rutil) in lokalen Bruchzonen, die mit Scherung assoziiert sind, beobachtet. Diese experimentell beobachtete Aufschmelzung ist möglicherweise ein Analogon zu dünnen pseudotachylitischen Schmelzadern, die in natürlichen Impaktkratern beobachtet werden können.',
