    'end_date': 2017,
    'title': 'Struktur und Bildung von Strahlenkegeln in experimentellen und natürlichen Impaktkratern',
    'abstract': 'Strahlenkegel sind wichtige Impaktindikatoren – es sind die einzigen, die bereits makroskopisch erkennbar sind. Sie sind damit diagnostisch wichtig, um alte erodierte Impaktkrater zu identifizieren. Dieser Antrag verfolgt das Ziel, die Bildungsbedingungen von Strahkenkegeln durch eine rigorose experimentelle Analyse und den Vergleich mit natürlichen Strahlenkegeln des Steinheim Kraters, Deutschland, besser einzugrenzen. Es gibt noch keinen Konsens hinsichtlich der physikalischen Randbedingungen unter denen sich Strahlenkegel bilden. Wir beabsichtigen, den verantwortlichen Stoßwellendruck, Druckimpulslänge und Druckprofil, den Spannungs- und Verformungstensor und Verformungsraten zu ermitteln, indem wir die im MEMIN Programm entwickelten numerischen Modelle anwenden. Es gibt auch keinen Konsens darüber wie Strahlenkegel entstehen und ob sie das Resultat von Zug- oder Scherversagen sind. Wir werden eine komplette morphometrische Analyse der Strahlenkegel durch erstmalige Anwendung von Weißlichtinterferometrie und Atomkraftmikrokopie (AFM) durchführen. Diese Analysen sowie mikrostrukturelle Untersuchungen mit Hilfe des SEM, EBSD und TEM werden es uns ermöglichen, die Bildung und den Versagens-Mechanismus bei den experimentell gebildeten und den natürlichen Strahlenkegeln zu entziffern. Die hochenergetischen MEMIN-Experimente an Festgestein sind hervorragend geeignet, um Strahlenkegel zu bilden und zu detektieren, da der Kraterbildungsprozess mit höchster Präzision aufgezeichnet wird und die resultierenden, dezimeter-großen Krater eine detaillierte räumliche Auswertung zulassen. Es gilt Laborbedingungen zu finden, die eine wiederholbare und vorhersagbare Bildung von Strahlenkegeln erlaubt. Ebenso wichtig ist es, Bedingungen abzugrenzen, unter denen keine Bildung möglich ist. Letztendliches Ziel ist es ein allgemeingültiges Modell zur Bildung von Strahlenkegeln aufzustellen, das mit den makroskopischen und mikroskopischen Beobachtungen und den physikalischen Randbedingungen im Einklang steht. Keines der bislang publizierten Modelle ist allgemein akzeptiert und liefert Erklärungen für die kegelförmige Gestalt und das hierarchisch gegliederte, divergierenden Furchensystem an den Oberflächen der Strahlenkegel. Die meisten Modelle erfordern eine größere Heterogenität (Inklusion, Pore) am Apex des Strahlenkegels. Diese Heterogenität verursacht einen Impedanzkontrast mit dem umgebenden Gestein und ist damit Auslöser für sphärisch ausbreitende Wellen, die mit der Hauptwelle interferieren. Wir bezweifeln dieses Modell, da Strahlenkegel insbesondere in feinkörnig, mikritischen Kalksteinen wie im Steinheimer Becken vorkommen, in denen derartige Inklusionen rar sind.',
