    'title': 'Digitalisierung / Erschließung von Objekten: Eine Community-Plattform für die Entwicklung und Dokumentation des ABCD-Standards für naturkundliche Sammlungsdaten',
    'abstract': 'ABCD (Access to Biological Collection Data) ist ein internationaler Standard für den Austausch biologischer Sammlungs- und Observationsdaten. Es wurde zunächst als XML-Schema entwickelt und 2005 als TDWG-Standard ratifiziert (Biodiversity Information Standards). Die ABCD-Entwicklung ist von Beginn an sehr eng an ein XML-Schema gekoppelt, indem die Dokumentation der einzelnen Konzepte als XML-Annotationen repräsentiert wird. Neue Versionen des ABCD-Schemas entstehen, indem in unregelmäßigen Abständen die bei der Koordination am BGBM eingegangenen Anforderungen der verschiedenen Nutzergruppen konsolidiert und in das Schema eingearbeitet werden. Dieses Verfahren war in der ersten Dekade der ABCD-Entwicklung effektiv, gerät aber nun durch die größer werdenden diversen Nutzerkreise und durch die Einführung semantischer Technologien an seine Grenzen. Die ABCD Konzepte sind hierarchisch angeordnet und werden über den Pfad (xpath) vom Wurzelknoten referenziert, was eine direkte Nutzung im Semantischen Web unmöglich macht. Im Rahmen des beantragten Projektes wird eine Plattform entwickelt werden, mit der ABCD-Konzepte in Form einer maschinenlesbaren und versionierten Dokumentation zur Verfügung gestellt werden. Die Konzepte sollen von der Abhängigkeit eines XML- Schemas gelöst und in Form einer Ontologie für das Semantische Web erschlossen werden. Unter Einbeziehung der “Fachcommunities” wird dabei die Version 3.0 des ABCD-Standards mit neuen domainspezifischen Erweiterungen entstehen, die sowohl als XML-Schema als auch als Ontologie im Semantischen Web nutzbar ist.',
