    'title': 'Digitalisierung / Erschließung von Objekten: eScience-konforme Standards für die Morphologie',
    'abstract': 'Die Forschungspraxis in den Lebenswissenschaften hat sich in den letzten Jahrzehnten stark verändert. Heutzutage nutzen viele Wissenschaftler das Internet, um Datensätze für Analysen zusammenzustellen. Dieser als eScience bezeichnete Ansatz erfordert, dass Daten über das Internet zugängliche sind und nutzt Anwendungen des Semantischen Webs. Bedauerlicherweise nehmen die Morphologie und morphologische Taxonomie noch nicht an eScience Teil, da momentan: 1) morphologische Daten nur aus der Literatur bezogen werden können und die dazugehören Medien und Rohdaten i.d.R. verloren gehen; 2) morphologische Beschreibungen in keinem allgemeinen Datenrepositorium hinterlegt werden können, da die entsprechenden eScience-konformen Standards fehlen. Die Lösung zu beiden Problemen involviert die Nutzung von semantisch transparenten Terminologien, d.h. Ontologien.Über einen User-Centered-Design Ansatz und in enger Koordination mit vier Fallstudien, werden wir eScience-konforme Standards für die Morphologie entwickeln sowie drei ontologiebasierte Module für das morphologische Datenrepositorium Morph•D•Base: 1) für morphologische Beschreibungen, 2) graphische Bildannotationen und 3) für taxonomische Beschreibungen und automatisch generierte dynamische "multiple entry" Bestimmungsschlüssel. Die vier Fallstudien werden ihre Nutzbarkeit bezüglich Zugänglichkeit von morphologischen Daten für Nichtexperten, eScience-konforme Standards für taxonomische Beschreibungen, Digitalisierung naturkundlicher Sammlungen und für die vergleichende Morphologie prüfen.',
