    'title': 'Digitalisierung / Erschließung von Objekten: Erschließung digitaler Sammlungsdaten am Museum für Naturkunde Berlin',
    'abstract': 'Die Sammlungsbestände des Museums für Naturkunde Berlin – und auch die der meisten anderen Naturkundemuseen – sind i.d.R. dezentral in den einzelnen Kustodien und in unterschiedlichen Datenformaten digital erfasst. Meist werden Tabellenformate des Programms Excel genutzt, aber auch einfache Textdateien oder unterschiedlich komplexe Datenbankformate. Die digital erfassten Sammlungsbestände sind häufig nur einem kleinen Kreis an Museumsmitarbeitern zugänglich.Mit Hilfe der hier beantragten Sachbeihilfe wollen wir bereits vorhandene digitale Datenbestände aufarbeiten, um sie über bereits etablierte Biodiversitätsdatenbanken öffentlich zugänglich zu machen. Damit könnten Sammlungsbestände und mit den einzelnen Sammlungsobjekten verbundene digitale Daten von außerhalb recherchiert werden, was Wissenschaftlern aus verschiedenen Fachdisziplinen (insbesondere Biowissenschaftler und Historiker) neue Perspektiven in der Nutzung der Sammlungsbestände ermöglicht. Zunächst sollen exemplarisch die Bestände der Säugetiersammlung am Museum für Naturkunde Berlin (viertgrößte Sammlung rezenter Säugetiere weltweit) bearbeitet werden. Die in diesem ersten Schritt entwickelten Verfahren und Erfahrungen werden anschließend sukzessive bei anderen Teilsammlungen des Museums für Naturkunde Berlin mit seinen insgesamt rund 30 Millionen Sammlungsstücken eingesetzt, um eine öffentlich zugängliche, umfassende Datenbank der digitalisierten Sammlungsobjekte des gesamten Museums zu schaffen.',
