    'title': 'Digitalisierung / Erschließung von Objekten: Referenzsystem für bioakustische Daten',
    'abstract': 'Der derzeitige Zustand bioakustischer Sammlungen (Tierstimmen) ermöglicht noch nicht, diese effektiv für einen weiten Bereich wissenschaftlicher Fragestellungen zu nutzen. Als Vergleichsmaterial für die Biodiversitätsforschung werden kurze Sequenzen gut dokumentierter, georeferierter Aufzeichnungen benötigt. Ziel des Projektes ist der Aufbau einer Referenzdatenbank von Stimmen lautgebender europäischer Arten auf der Grundlage bereits digitalisierter Aufzeichnungen des Tierstimmenarchivs des Museums für Naturkunde Berlin unter Einbeziehung weiterer Quellen und Experten. In das System sollen nur qualitativ hochwertige, einwandfrei determinierte und georeferenzierte Aufzeichnungen eingehen. Der Zugriff soll über eine Datenbank webbasiert ohne Einschränkungen erfolgen. Die akustischen Aufzeichnungen und Metadaten sollen frei zugänglich gemacht werden über die Webseite des Projektes, Global Biodiversity Information Facility (GBIF) und Europaeana. Neben der Suche über Metadaten soll eine inhaltsbasierte Suche implementiert werden, d.h. auf der Grundlage von Mustererkennungsalgorithmen sollen Vorschläge zur Artbestimmung unterbreitet werden. Die Anwendung des Systems ist für eine Breite von Aufgaben im Bereich Biodiversitätsforschung und Naturschutz vorgesehen. Daneben sollen durch seine enzyklopädische Anlage Lücken im Kenntnisstand aufgezeigt und zu gezielten Nachforschungen angeregt werden. Neben der Nutzung im zoologischen Bereich ist auch ein Einsatz für kultur- bzw. musikwissenschaftliche Fragestellungen zu erwarten.',
