    'title': 'Medizin und Herrschaft. Malariabekämpfung in Kamerun, Ostafrika und Ostfriesland, 1890-1919',
    'abstract': 'Malaria mobilisierte um 1900 enorme Beachtung auf Seiten europäischer Kolonialregierungen und Mediziner. Die Krankheit galt als Bedrohung für den "weißen Mann" und damit für das europäische koloniale Projekt. Was heute vergessen ist: Malaria kam zur selben Zeit auch in weiten Teilen Deutschlands vor. Nicht nur in deutschen Kolonien, auch in Deutschland selbst erprobten Mediziner und Gesundheitsbehörden deshalb Methoden zur Bekämpfung der Krankheit.Das Buch rekonstruiert Versuche, die in drei Gebieten des Deutschen Kaiserreichs zur Bekämpfung von Malaria unternommen wurden: in Kamerun, Deutsch-Ostafrika und Ost-Friesland. Für die betroffenen Bevölkerungen waren die medizinischen Maßnahmen neu und häufig unwillkommen. Der Fokus der Untersuchung liegt deshalb einerseits auf der Frage, mit welchen Praktiken und Diskursen Mediziner und Gesundheitsbehörden versuchten, die Maßnahmen gegen lokalen Widerstand durchzusetzen; anderseits auf der Frage, inwiefern dieses Vorgehen sich zwischen kolonisierten und nicht-kolonisierten Gebieten unterschied. Es zielt damit auf eine Erörterung der Unterschiede und Gemeinsamkeiten zwischen kolonialer und nicht-kolonialer Herrschaft."Medizin und Herrschaft" zeigt, dass unter anderem Reisen, Verhandeln und "Belehren" zentrale Praktiken zur Durchsetzung der Malariabekämpfung waren (Kapitel 2 und 3). Auch definierten die medizinischen Programme ihre Zielgruppen entlang von Ideen von Zivilisation, in die Vorstellungen von "Rasse" und Klassenunterschiede miteinander verschränkt waren (Kapitel 4).Diese Praktiken und Diskurse ähnelten sich über die Grenze zwischen kolonisierten und nicht-kolonisierten Gebieten hinweg – deshalb, so das Argument der Studie, weil Gesundheitspolitik und Zentralmacht in allen Regionen vor der Herausforderung standen, ihre Maßnahmen für die lokale Bevölkerung plausibel zu machen. Das Buch weist auch auf Unterschiede im Vorgehen hin, zeigt aber, dass diese nicht immer entlang der Grenze zwischen "Kolonie" und "Metropole" verliefen. Es plädiert davon ausgehend für einen genauen Blick sowohl auf übergreifende Mechanismen von Herrschaft als auch auf ihre lokalen Ausformungen.',
