    'title': 'Entstehung und Entwicklung von großen Einschlagsbecken auf dem Mond (A04)',
    'abstract': 'Große Einschlagsbecken sind die ältesten und einzigen erhaltenen sichtbaren Manifestationen der späten Akkretionsphase der terrestrischen Planeten. Ziel des Projektes ist es die Liste der bekannten Einschlagbecken des Mondes zu vervollständigen (u.a. mit verbesserten topographischen und geophysikalischen Daten), ihre Entstehung und spätere Modifikationen zu untersuchen und die Verteilung von Auswurfmassen und Impaktschmelze und ihre Vermischung mit Megaregolith zu erforschen. Insbesondere für die petrologische, geochemische und radiometrische Datierung von kritischen Mondproben ist ein quantitatives Verständnis der komplexen Auswurf und Ablagerungsgeschichte von Probenmaterial erforderlich.',
