    'title': 'Modellierung von planetaren Kollisionen und der thermochemischen Entwicklung von flüssigem Metall in konvektierenden Magmaozeanen (C02)',
    'abstract': 'Planetare Kollisionen beeinflussten die Kernbildung auf der Erde, jedoch ist über Details der Prozesse nur wenig bekannt. Ziel des Projektes ist es den Impaktprozess, die Fragmentierung des Impaktors in kleine Partikel oder große Klumpen von Metall- und Silikatschmelze und das Absinken der metallischen Komponenten des Impaktors in einem Magmaozean zu modellieren. Der kombinierte Ansatz aus Impakt- und thermodynamischer Modellierung eines Magmaozeans in Verbindung mit Kristallisationsprozessen wird neue Erkenntnisse über die Prozesse nach dem Impakt und die Verteilung von Material in Erdmantel und -kern liefern.',
