    'title': 'TRR 170: Späte Akkretion auf terrestrischen Planeten',
    'abstract': 'Die späte Wachstumsgeschichte der terrestrischen Planeten, von den letzten planetaren Kollisionen mit planetaren Embryos bis zur späten Bombardierung durch Planetesimale ist von kritischer Bedeutung für das Verständnis der frühen Stofftrennungsprozesse und die Entwicklung der terrestrischen Planeten. Das Ziel des Forschungsprogramms ist es, unser Verständnis der späten Akkretionsgeschichte von Erde, Mond und anderen terrestrischen Planeten in der Zeit zwischen 4.5 und 3.8 Milliarden Jahren zu verbessern. Ein interdisziplinärer Ansatz soll neue Einblicke in die Zeitskalen, Raten, chemische Budgets und die geodynamischen und physikochemischen Auswirkungen der späten Akkretion liefern. Im Detail soll die Bildungsabfolge und Verteilung der beckenbildenden Impakte auf dem Mond untersucht werden um grundlegende Parameter der Kraterchronologie im frühen Sonnensystem zu verbessern. Weiterhin sollen die Masse und Akkretionsrate des zwischen 4.5 und 3.8 Ga akkretionierten Materials bestimmt werden, die Zusammensetzung und Abschätzungen der Budgets eines Spektrums flüchtiger und metallliebender Elemente in Erde, Mond, und in anderen terrestrischen Planeten verbessert werden. Ein weiteres Ziel ist die Überprüfung der Hypothese, dass spät akkretioniertes Material reich an flüchtigen Elementen war und eine ähnliche Zusammensetzung wie das Material hatte, welches am Ende der Hauptphase der Planetenbildung vor etwa 4.5 Ga akkretioniert wurde. Schließlich sollen quantitative Modelle die Entwicklung der terrestrischen Planeten in diesem Zeitraum simulieren. Es wird erwartet, dass die Resultate unser fragmentarisches Verständnis verschiedener Schlüsselprozesse in dieser Entwicklungsphase der terrestrischen Planeten verbessern werden. Dies betrifft insbesondere die Rolle von planetaren Kollisionen beim Verlust flüchtiger Elemente und bei der Kernbildung, die Bildung und Entwicklung von Magmaozeanen, der Übergang zur Konvektion eines verfestigten Silikatmantels, die Homogenisierung von chemischen und isotopischen Heterogenitäten und ihre Zeitskala, sowie die Abkühlgeschichte von terrestrischen Planeten. Das wissenschaftliche Programm wird durch ein interdisziplinäres Graduiertenprogramm in Planetenwissenschaften ergänzt. Dieses Programm ist das einzige dieser Art in Deutschland und wird von der gebündelten Expertise in planetarer Fernerkundung, Planetenphysik, geodynamischer Modellierung, Kosmochemie und Geomaterialwissenschaften an den beteiligten Instituten in Berlin und Münster profitieren. Das Graduiertenprogramm wird durch die vorgesehene aktive Beteiligung von Gastwissenschaftlern und durch Stipendien unterstützte externe Studierende, sowie eine Sommer-/Winterschule eine internationale Ausstrahlung haben. Von besonderer Bedeutung werden die Förderung von Studentinnen, Doktorandinnen und weiblichen Postdocs (finanziell, aber auch durch das DFG-Kaskadenmodell bei Einstellungen), sowie Maßnahmen sein, um Familie und Beruf besser vereinbaren zu können.',
