    'title': 'Von der Bildung des Mondes zur "späten Bombardierung": thermochemische Entwicklung des frühen Erde-Mond-Systems (C04)',
    'abstract': 'Das Einschlagereignis, das zur Bildung des Mondes geführt hat, war vermutlich das letzte große Kollisionsereignis auf der Erde. Mit ihm war die Hauptakkretionsphase abgeschlossen und die wesentlichen Bedingungen für die anschließenden thermochemische Entwicklung festgelegt. Ziel des Projektes ist die Modellierung verschiedener Einschlagszenarien der Mondbildung und anderer großer Einschlagereignisse, die zur Bildung von Magmaozeanen geführt haben und die anschließende Abkühlgeschichte der Erde und des Mondes. Es sollen thermo-chemische Randbedingungen für den Zeitpunkt der Zufuhr des "Late Veneer" festgelegt werden, die konsistent sind mit der geochemischen Signatur von Erde und Mond.',
