    'title': 'GRK 503: Evolutive Transformationen und Faunenschnitte',
    'abstract': 'Die Geschichte des Lebens auf der Erde ist durch Perioden ungewöhnlich schneller Veränderungen gekennzeichnet, wobei Extinktion und nachfolgende Evolution zahlreicher neuer Formen aus geologischer Sicht in relativ kurzer Zeit stattgefunden haben. Während solcher evolutionärer Umwälzungen (Faunenschnitte oder Events) sind dominante Gruppen von Organismen plötzlich verschwunden und rasch durch neue Gruppen ersetzt worden. Letztere sind durch den Umbau ihrer Organisation, d.h. durch evolutive Transformationen aus den älteren entstanden. Die rezente Biosphäre der Erde wurde tiefgreifend durch diese Prozesse beeinflusst. Das im Rahmen des Graduiertenkollegs geplante multidisziplinäre Studium dieser Prozesse wird sich auf folgende Events konzentrieren: Übergang vom Eozän zum Oligozän, die Kreide-Tertiär-Grenze und Events im Oberdevon. Es sollen die Entstehungsbedingungen der Events und evolutiven Transformationen sowie deren Verlauf untersucht werden. Darüber hinaus werden allgemeine Gesetzmäßigkeiten, die im Laufe dieser Ereignisse auftreten, erarbeitet. Das Graduiertenkolleg vereinigt geowissenschaftliche, paläobiologische und evolutionsbiologische Denk- und Forschungsansätze mit dem Ziel eines umfassenden Verständnisses evolutiver Transformationen (Extinktion, Speziation, Radiation) und ihrer kausalen Verknüpfungen. Durch die Beteiligung von Forschergruppen aus mineralogisch-planetologischen, paläontologischen und zoologischen Einrichtungen wird ein sehr breites und kohärentes Angebot an wissenschaftlichen Themen garantiert. Das Forschungsprogramm ist so angelegt, dass ein Maximum an Kooperation zwischen den beteiligten Forschergruppen angestrebt wird, bis hin zur gemeinsamen Betreuung von Doktorarbeiten.',
