    'title': 'Extension and modification of Morph D Base producing a system for permanent storage and documentation of volume data of biological objects in high resolution',
    'abstract': 'In den letzten Jahren hat sich die morphologisch basierte Forschung an Organismen durch die sehr schnelle Etablierung neuer Methoden, wie der Röntgentomographie (μCT, SRμCT), der Laser Scanning Microscopie (cLSM), der Digitalisierung histologischer Schnittserien, etc., stark verändert. All diese Methoden erzeugen extrem große Datenmengen, die aufgrund ihres ungewöhnlich hohen Informationsgehaltes, von besonderem wissenschaftlichem Wert sind. Bisher existiert allerdings kein Repositorium für die dauerhafte Speicherung dieser Datenmengen. Unser Projektziel darauf ab, Morph D Base, die zentrale Datenbank des DFG SPP 1174, für die Verwaltung großer Mengen dreidimensionaler Daten und der zugehörigen Metadaten zu optimieren. Das erweiterte Morph D Base wird vom Museum König Bonn auch über die Laufzeit dieses Projektes hinaus als Kommunikationsplattform für Wissenschaftler und Speichersystem für Daten zur Morphologie ,weiterbetrieben werden. Die Metadaten werden frei über das Internet zugänglich sein, die Dateneingabe erfordert eine Registrierung am Datenbanksystem und der Zugriff auf die Originaldaten wird der Kontrolle der Person unterliegen, die die Daten in die Datenbank eingestellt hat. Ein Standard für Metadaten zur Beschreibung von Volumendaten wird in direkter Kommunikation mit den Nutzern der Datenbank kontinuierlich angepasst und weiterentwickelt. Die wissenschaftliche Gemeinschaft wird durch Vorträge, Poster und Symposien bei den einschlägigen Tagungen über die Datenbank informiert werden.',
