    'title': 'EXC 1027: Bild Wissen Gestaltung. Ein interdisziplinäres Labor',
    'abstract': 'Wissenschaft ist Gestaltung, und zwar in all ihren Elementen: von der Laboranordnung über die chemische Formel und die Gliederung einer Studie bis hin zum Theoriengebäude. Seit jeher wurde Wissen durch Architekturen, Werkzeuge und Modelle, Informationsmittel und Bilder gestaltet. Durch die Entwicklung digitaler Bildgebungsverfahren hat die Bedeutung von Gestaltung für die Herstellung und Wahrnehmung von Wissen seit gut einem halben Jahrhundert jedoch eine neue Qualität erreicht. Als Mittel der Sichtbarmachung und Verdichtung, der Modellierung und der Vermittlung, der Beweisführung und der Archivierung haben Bilder einen tief greifenden Wandel in Natur- wie Geisteswissenschaften, Technik und Medizin bewirkt. Sie machen unüberschaubare Datenmengen und Komplexitäten begreifbar. Indem sie keinesfalls nur immateriell wirksam werden, sondern vielmehr das Digitale und das Materielle verschränken, sind sie ein umfassendes Reservoir der Formen des Wissens. Bilder sprengen disziplinäre und lokale Grenzen und sie transportieren Stile und ästhetische Strategien. "Gestaltung", ein Paradigma moderner Entwurfs- und Fertigungsverfahren, rückt so von der Peripherie in den Kern der Forschung selbst. An diesem zentralen Punkt knüpft der Exzellenzcluster an: Bilder und Wissen werden als Gestaltungsprozesse untersucht. Dazu wird ein interdisziplinäres Labor als eine neue virtuelle und reale Architektur des Wissens aufgebaut, an dem Geistes-, Natur- und Technikwissenschaften ebenso wie die Gestaltungsdisziplinen gleichermaßen beteiligt sind. "Gestaltung" wird darin zum Modellbegriff wissenschaftlicher Tätigkeit. Erstmals in der 200-jährigen Geschichte der Humboldt-Universität zu Berlin entsteht damit unter der Mitwirkung von 22 Disziplinen aus zahlreichen universitären und außeruniversitären Forschungseinrichtungen und Museen eine integrative wissenschaftliche Plattform, die die Universität in markanter Weise verändern könnte.',
